tem_link_css_class = \"${nav_item_link_css_class} dropdown-toggle\"\n						/>\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\'\" />\n					</#if>\n\n					<#if navItem.isChildSelected() || navItem.isSelected()>\n						<#assign\n							nav_item_css_class = \"${nav_item_css_class} selected active\"\n						/>\n					</#if>\n\n					<li class=\"${nav_item_css_class}\" id=\"layout_${portletDisplay.getId()}_${portletDisplay.getId()}_${navItem.getLayoutId()}\" role=\"presentation\">\n						<a ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span class=\"text-truncate\"><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>', 0, 0, 28904, NULL, NULL),
(0, 0, '41fba36d-7987-2ad3-d6ec-a189583429fe', 28906, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.488000', '2022-07-05 09:10:28.488000', 20146, 0, 28834, 'NAVIGATION-MACRO-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering i vanliga makron</Name><Name language-id=\"pt_BR\">Macros de navegação comuns</Name><Name language-id=\"ja_JP\">ナビゲーションの一般的なマクロ</Name><Name language-id=\"fr_FR\">Macros de navigation ordinaires</Name><Name language-id=\"hu_HU\">Navigáció közös makrói</Name><Name language-id=\"de_DE\">Navigation häufige Makros</Name><Name language-id=\"ca_ES\">Macros comunes de navegació</Name><Name language-id=\"ar_SA\">وحدات الماكرو الشائعة للتنقل</Name><Name language-id=\"fi_FI\">Navigoinnin yleiset makrot</Name><Name language-id=\"en_US\">Navigation common macros</Name><Name language-id=\"zh_CN\">导航常用宏</Name><Name language-id=\"es_ES\">Macros comunes de navegación</Name><Name language-id=\"nl_NL\">Algemene navigatiemacro\'s</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Innehåller vanliga makron för navigeringsmenymallar.</Description><Description language-id=\"pt_BR\">Contém macros comuns para o modelo do menu de navegação.</Description><Description language-id=\"ja_JP\">ナビゲーションメニューテンプレート用のマクロを含みます</Description><Description language-id=\"fr_FR\">Contient les macros ordinaires pour les modèles de menu de navigation.</Description><Description language-id=\"hu_HU\">A navigációs menü sablonok közös makróit tartalmazza.</Description><Description language-id=\"de_DE\">Enthält häufige Makros für Navigationsmenüvorlagen.</Description><Description language-id=\"ca_ES\">Conté macros comunes per a les plantilles del menú de navegació.</Description><Description language-id=\"ar_SA\">يحتوي على وحدات ماكرو شائعة لقوالب قائمة التنقل.</Description><Description language-id=\"fi_FI\">Sisältää yleiset navigointivalikkomallien makrot.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description><Description language-id=\"zh_CN\">包含导航菜单模板的常用宏。</Description><Description language-id=\"es_ES\">Contiene macros comunes para plantillas del menú de navegación.</Description><Description language-id=\"nl_NL\">Bevat algemene macro\'s voor navigatiemenusjablonen.</Description></root>', 'macro', NULL, 'ftl', '<#macro buildChildrenNavItems\n	displayDepth\n	navItem\n	navItemLevel = 2\n>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n	/>\n\n	<#list navItem.getChildren() as childNavigationItem>\n		<#assign\n			nav_child_css_class = \"\"\n		/>\n\n		<#if !childNavigationItem.isChildSelected() && childNavigationItem.isSelected()>\n			<#assign\n				nav_child_css_class = \"active selected\"\n			/>\n		</#if>\n\n		<li class=\"${nav_child_css_class}\" id=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" role=\"presentation\">\n			<#if childNavigationItem.isBrowsable()>\n				<a class=\"dropdown-item\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n			<#else>\n				<span class=\"dropdown-item font-weight-semi-bold navigation-menu__submenu\">${childNavigationItem.getName()}</span>\n			</#if>\n		</li>\n\n		<#if childNavigationItem.hasBrowsableChildren() && ((displayDepth == 0) || (navItemLevel < displayDepth))>\n			<ul class=\"list-unstyled pl-3\">\n				<@buildChildrenNavItems\n					displayDepth=displayDepth\n					navItem=childNavigationItem\n					navItemLevel=(navItemLevel + 1)\n				/>\n			</ul>\n		</#if>\n	</#list>\n</#macro>\n\n<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if !navItem.isChildSelected() && navItem.isSelected()>\n					<#assign\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\">\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 0, 28907, NULL, NULL),
(0, 0, '64c51eaa-b389-e5a6-8e03-fe09f5d429c9', 28909, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.520000', '2022-07-05 09:10:28.520000', 20146, 0, 28834, 'SPLIT-BUTTON-DROPDOWNS-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Nedrullningsbara listor med delningsknappar</Name><Name language-id=\"pt_BR\">Dividir menus suspensos de botão</Name><Name language-id=\"ja_JP\">スプリットボタンのドロップダウン</Name><Name language-id=\"fr_FR\">Partager les boutons du menu déroulant</Name><Name language-id=\"hu_HU\">Osztott gomb legördülő elemei</Name><Name language-id=\"de_DE\">Dropdown mit geteilten Schaltflächen</Name><Name language-id=\"ca_ES\">Desplegables de botó de divisió</Name><Name language-id=\"ar_SA\">تقسيم القوائم المنسدلة للأزرار</Name><Name language-id=\"fi_FI\">Jakopainikkeen Pudotusvalikot</Name><Name language-id=\"en_US\">Split Button Dropdowns</Name><Name language-id=\"zh_CN\">拆分按钮下拉菜单</Name><Name language-id=\"es_ES\">Desplegables de botón de expansión</Name><Name language-id=\"nl_NL\">Rolmenu met uitgesplitste knoppen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en nedrullningsbar navigeringsmeny med rotmenyobjekt som visas som knappar.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegação suspenso com itens do menu raiz mostrados como botões.</Description><Description language-id=\"ja_JP\">ボタン形式のドロップダウンでナビゲーション メニューを表示します。</Description><Description language-id=\"fr_FR\">Affiche un menu de navigation déroulant dont les éléments sont affichés sous la forme de boutons.</Description><Description language-id=\"hu_HU\">Megjelenít egy lenyíló navigációs menüt, amelyben a gyökérszintű menüpontok gombokként jelennek meg.</Description><Description language-id=\"de_DE\">Zeigt ein Dropdown-Navigationsmenü mit Root-Menüelementen als Schaltflächen an.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació desplegable els elements de menú arrel que es mostren com a botons.</Description><Description language-id=\"ar_SA\">يعرض قائمة تنقل منسدلة تحتوي على عناصر قائمة جذر تظهر كأزرار.</Description><Description language-id=\"fi_FI\">Näyttää pudotusnavigointivalikon juurivalikon kohdat esitettynä painikkeina.</Description><Description language-id=\"en_US\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"zh_CN\">显示下拉式导航菜单，其中根菜单项显示为按钮。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación desplegable con elementos de menú raíz que se muestran como botones.</Description><Description language-id=\"nl_NL\">Geeft een rolmenu voor navigatie weer met rootmenu-items in de vorm van knoppen.</Description></root>', 'display', NULL, 'ftl', '<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul class=\"navbar-site split-button-dropdowns\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildrenNavItems>\n					<#assign\n						nav_item_css_class = \"\"\n						nav_item_href_link = \"\"\n					/>\n\n					<#if navItem.isChildSelected() || navItem.isSelected()>\n						<#assign nav_item_css_class = \"active\" />\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\' ${navItem.getTarget()}\" />\n					</#if>\n\n					<li>\n						<#if showChildrenNavItems>\n							<#assign toggle_text>\n								<@liferay.language key=\"toggle\" />\n							</#assign>\n\n							<div class=\"btn-group\">\n						</#if>\n\n						<a class=\"${nav_item_css_class} btn btn-secondary\" ${nav_item_href_link}><span>${navItem.getName()}</span></a>\n\n						<#if showChildrenNavItems>\n							<button aria-expanded=\"false\" aria-haspopup=\"true\" class=\"${nav_item_css_class} btn btn-secondary c-px-2 dropdown-toggle\" data-toggle=\"liferay-dropdown\" type=\"button\">\n								<@liferay_aui.icon\n									image=\"angle-down\"\n									markupView=\"lexicon\"\n								/>\n\n								<span class=\'sr-only\'>${toggle_text}</span>\n							</button>\n\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n\n							</div>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>', 0, 0, 28910, NULL, NULL),
(0, 0, '3581dc45-44cd-7df9-8b05-3c42f1583eca', 28912, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.573000', '2022-07-05 09:10:28.573000', 28804, 0, 28834, 'RSS-NAVIGATION-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering</Name><Name language-id=\"pt_BR\">Navegação</Name><Name language-id=\"ja_JP\">ナビゲーション</Name><Name language-id=\"fr_FR\">Navigation</Name><Name language-id=\"hu_HU\">Navigáció</Name><Name language-id=\"de_DE\">Navigation</Name><Name language-id=\"ca_ES\">Navegació</Name><Name language-id=\"ar_SA\">الملاحة</Name><Name language-id=\"fi_FI\">Navigointi</Name><Name language-id=\"en_US\">Navigation</Name><Name language-id=\"zh_CN\">导航</Name><Name language-id=\"es_ES\">Navegación</Name><Name language-id=\"nl_NL\">Navigatie</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar RSS-flödet som ett navigeringsfält i panelen till vänster. Om du klickar på flödet visas en lista med feedposter i panelen till höger.</Description><Description language-id=\"pt_BR\">Exibe os feeds RSS como uma barra de navegação no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id=\"ja_JP\">RSSフィードを左のパネルにナビゲーションバーとして表示します。フィードをクリックすると、右パネルにフィードの内容がリスト表示されます</Description><Description language-id=\"fr_FR\">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d\'entrées de flux sur le panneau droit.</Description><Description language-id=\"hu_HU\">Megjeleníti az RSS hírcsatornákat navigációs oszlopként a bal oldalon. Egy hírcsatornára kattintva megjeleníti a hírcsatorna bejegyzések listáját a jobb oldalon.</Description><Description language-id=\"de_DE\">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeinträge im rechten Bereich dargestellt.</Description><Description language-id=\"ca_ES\">Mostra els canals RSS com una barra de navegació en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d\'entrades en el tauler dret.</Description><Description language-id=\"ar_SA\">يعرض موجزات RSS كشريط تنقل في اللوحة اليسرى. إذ يؤدي النقر فوق موجز إلى عرض قائمة بإدخالات الموجزات على اللوحة اليمنى.</Description><Description language-id=\"fi_FI\">Näyttää RSS-syötteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla syötettä näytetään syötteen arvot oikeassa paneelissa.</Description><Description language-id=\"en_US\">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description><Description language-id=\"zh_CN\">在左侧面板上显示RSS源的导航栏。在右侧面板上点击Feed显示提要条目的列表。</Description><Description language-id=\"es_ES\">Muestra las fuentes RSS como una barra de navegación del panel izquierdo. Al hacer clic en una fuente se muestra una lista de entradas de la fuente en el panel derecho.</Description><Description language-id=\"nl_NL\">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description></root>', 'display', NULL, 'ftl', '<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div class=\"tab-pane\" id=\"tab-${curEntry_index}\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index >= entriesPerFeed?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												icon=\"calendar\"\n												label=true\n												markupView=\"lexicon\"\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>', 0, 0, 28913, NULL, NULL),
(0, 0, 'f9ca02ca-e586-34d4-2774-865d834f3d89', 28915, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.623000', '2022-07-05 09:10:28.623000', 28805, 0, 28834, 'DOCUMENTLIBRARY-CAROUSEL-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Carousel</Name><Name language-id=\"pt_BR\">Carrossel</Name><Name language-id=\"ja_JP\">カルーセル</Name><Name language-id=\"fr_FR\">Carrousel</Name><Name language-id=\"hu_HU\">Körhinta</Name><Name language-id=\"de_DE\">Karussel</Name><Name language-id=\"ca_ES\">Carrussel</Name><Name language-id=\"ar_SA\">مكتبة</Name><Name language-id=\"fi_FI\">Karuselli</Name><Name language-id=\"en_US\">Carousel</Name><Name language-id=\"zh_CN\">轮播</Name><Name language-id=\"es_ES\">Carrusel</Name><Name language-id=\"nl_NL\">Carrousel</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar bilder i carousel-format.</Description><Description language-id=\"pt_BR\">Exibe imagens num carrossel.</Description><Description language-id=\"ja_JP\">カルーセル内に画像を表示</Description><Description language-id=\"fr_FR\">Affiche les images dans un carrousel.</Description><Description language-id=\"hu_HU\">Megjeleníti a képeket körhintaszerűen.</Description><Description language-id=\"de_DE\">Darstellung von Bildern in einem Karussell.</Description><Description language-id=\"ca_ES\">Mostra imatges en format carrusel.</Description><Description language-id=\"ar_SA\">يعرض الصور في مكتبة.</Description><Description language-id=\"fi_FI\">Näyttää kuvat karusellissa.</Description><Description language-id=\"en_US\">Displays images in a carousel.</Description><Description language-id=\"zh_CN\">把图片显示在转盘中。</Description><Description language-id=\"es_ES\">Muestra imágenes en un carrusel.</Description><Description language-id=\"nl_NL\">Geeft afbeeldingen weer in een carrousel.</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<style>\n		#<@portlet.namespace />carousel .carousel-item {\n			background-color: #000;\n			height: 250px;\n			overflow: hidden;\n			text-align: center;\n			width: 700px;\n		}\n\n		#<@portlet.namespace />carousel .carousel-item img {\n			max-height: 250px;\n			max-width: 700px;\n		}\n	</style>\n\n	<div id=\"<@portlet.namespace />carousel\">\n		<#assign imageMimeTypes = propsUtil.getArray(\"dl.file.entry.preview.image.mime.types\") />\n\n		<#list entries as entry>\n			<#if imageMimeTypes?seq_contains(entry.getMimeType())>\n				<div class=\"carousel-item image-viewer-base-image\">\n					<img src=\"${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, \"\")}\" />\n				</div>\n			</#if>\n		</#list>\n	</div>\n\n	<@liferay_aui.script use=\"aui-carousel\">\n		var carousel = new A.Carousel(\n			{\n				after: {\n					responsive: function(event) {\n						event.stopImmediatePropagation();\n\n						var boundingBox = event.currentTarget.get(\'boundingBox\');\n\n						boundingBox.all(\'.image-viewer-base-image-list, .image-viewer-base-image\').setStyles(\n							{\n								height: \'auto\',\n								maxHeight: event.height,\n								maxWidth: event.width,\n								width: \'auto\'\n							}\n						);\n					}\n				},\n\n				contentBox: \'#<@portlet.namespace />carousel\',\n				height: 250,\n				intervalTime: 2,\n				width: 700\n			}\n		).render();\n	</@liferay_aui.script>\n</#if>', 0, 0, 28916, NULL, NULL),
(0, 0, '8edf0f55-f98f-7bd7-4ac0-f0c15e7a0da1', 28918, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.668000', '2022-07-05 09:10:28.668000', 28806, 0, 28834, 'COMMERCE-ADDRESS-BASIC-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Básico</Name><Name language-id=\"ja_JP\">通常の検索に戻る</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszerű</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"ca_ES\">Bàsic</Name><Name language-id=\"ar_SA\">أساسي</Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"en_US\">Basic</Name><Name language-id=\"zh_CN\">基本的</Name><Name language-id=\"es_ES\">Básico</Name><Name language-id=\"nl_NL\">Basis</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"ja_JP\">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id=\"hu_HU\">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>', 'display', NULL, 'ftl', '<#assign count = 0 />\n\n<div class=\"container-fluid container-fluid-max-xl\" style=\"text-align:center\">\n	<div class=\"row\" style=\"padding:15px\">\n		<#if entries?has_content>\n			<#list entries as curCommerceAddress>\n				<div class=\"col-md-4\" style=\"text-align:left\">\n					<#assign\n						editURL = commerceAddressDisplayContext.getEditCommerceAddressURL(curCommerceAddress.getCommerceAddressId())\n\n						deleteURL = commerceAddressDisplayContext.getDeleteCommerceAddressURL(curCommerceAddress.getCommerceAddressId())\n\n						editButtonValue = languageUtil.get(request, \"edit\")\n\n						removeButtonValue = languageUtil.get(request, \"remove\")\n\n						commerceCountry = curCommerceAddress.getCommerceCountry()\n					/>\n\n					<h2 style=\"color:#000\"><strong>${htmlUtil.escape(curCommerceAddress.getName())}</strong></h2>\n\n					<h3 style=\"color:#000\">${htmlUtil.escape(curCommerceAddress.getStreet1())}</h3>\n\n					<h3 style=\"color:#000\">${htmlUtil.escape(curCommerceAddress.getZip())}, ${htmlUtil.escape(curCommerceAddress.getCity())}</h3>\n\n					<#if commerceCountry??>\n						<h3 style=\"color:#000\">${htmlUtil.escape(commerceCountry.getName(themeDisplay.getLanguageId()))}</h3>\n					</#if>\n\n					<div class=\"row\" style=\"padding-top:30px\">\n						<@liferay_aui.button\n							cssClass=\"btn-lg\"\n							href=\"${editURL}\"\n							name=\"editAddressButton\"\n							value=\"${editButtonValue}\"\n						/>\n\n						<@liferay_aui.button\n							cssClass=\"btn-lg\"\n							href=\"${deleteURL}\"\n							name=\"removeAddressButton\"\n							value=\"${removeButtonValue}\"\n						/>\n					</div>\n				</div>\n\n				<#assign count = count + 1 />\n\n				<#if count gte 3>\n					</div>\n\n					<div class=\"row\" style=\"padding:15px\">\n\n					<#assign count = 0 />\n				</#if>\n			</#list>\n		</#if>\n	</div>\n\n	<div class=\"row\" style=\"padding:50px 0 15px 0\">\n		<#assign addButtonValue = languageUtil.get(request, \"add-address\") />\n\n		<@liferay_aui.button\n			cssClass=\"btn-lg btn-primary\"\n			href=\"${commerceAddressDisplayContext.getAddCommerceAddressURL()}\"\n			name=\"addAddressButton\"\n			value=\"${addButtonValue}\"\n		/>\n	</div>\n</div>', 0, 0, 28919, NULL, NULL),
(0, 0, 'b5dbb8a5-56da-1031-9534-cb15913c5526', 28921, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.720000', '2022-07-05 09:10:28.720000', 20015, 0, 28834, 'ASSET-CATEGORIES-NAVIGATION-MULTI-COLUMN-LAYOUT-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">تخطيط أعمدة متعددة</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn för varje ordlista. Varje kolumn inkluderar namnet på en ordlista med ordlistans toppnivåkategorier listade under.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulário. Cada coluna inclui o nome do vocabulário com as categorias de nível mais alto listadas abaixo dele.</Description><Description language-id=\"ja_JP\">各ボキャブラリ用に列を表示する。各列は以下にリストになっている、最上位に設定されている用語名を含んでいます</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d\'un vocabulaire avec les catégories du niveau racine listées en dessous.</Description><Description language-id=\"hu_HU\">Megjelenít egy oszlopot minden szótár számára. Minden oszlop tartalmazza a szótár nevét, alatta a szótár felső szintű kategóriáival.</Description><Description language-id=\"de_DE\">Stellt eine Spalte für jedes Vokabular dar. Jede Spalte enthält den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id=\"ca_ES\">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell més alta a sota.</Description><Description language-id=\"ar_SA\">يعرض عمودًا لكل مفرد. يتضمن كل عمود اسم المفرد مع فئات المستوى الأعلى للمفردات المدرجة تحتها.</Description><Description language-id=\"fi_FI\">Näyttää sarakkeen jokaiselle sanastolle. Jokainen sarake sisältää sanaston nimen, missä sanaston ylätason luokitukset on listattu.</Description><Description language-id=\"en_US\">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary\'s top level categories listed underneath.</Description><Description language-id=\"zh_CN\">显示一列中的每个词汇，每列包括顶级类别之下的词汇名字。</Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categorías de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"nl_NL\">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorieën eronder.</Description></root>', 'display', NULL, 'ftl', '<#assign hasCategories = false />\n\n<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<#assign categories = entry.getCategories() />\n\n			<#if categories?has_content>\n				<#assign hasCategories = true />\n\n				<@liferay_aui.col width=25>\n					<div class=\"results-header\">\n						<h3>\n							${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n						</h3>\n					</div>\n\n					<@displayCategories categories=categories />\n				</@liferay_aui.col>\n			</#if>\n		</#list>\n\n		<#if !hasCategories>\n			${renderRequest.setAttribute(\"PORTLET_CONFIGURATOR_VISIBILITY\", true)}\n\n			<div class=\"alert alert-info w-100\">\n				<@liferay_ui.message key=\"there-are-no-categories\" />\n			</div>\n		</#if>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 0, 28922, NULL, NULL),
(0, 0, '296cb285-4723-dea0-2508-8b097c4d1527', 28924, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.768000', '2022-07-05 09:10:28.768000', 28807, 0, 28834, 'CP-OPTION-FACET-CLOUD-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Cloud-layout</Name><Name language-id=\"pt_BR\">Layout de nuvem</Name><Name language-id=\"ja_JP\">クラウドのレイアウト</Name><Name language-id=\"fr_FR\">Disposition du cloud</Name><Name language-id=\"hu_HU\">Felhő elrendezés</Name><Name language-id=\"de_DE\">Cloudlayout</Name><Name language-id=\"ca_ES\">Disposició del núvol</Name><Name language-id=\"ar_SA\">مخطط السحابة</Name><Name language-id=\"fi_FI\">Pilviasettelu</Name><Name language-id=\"en_US\">Cloud Layout</Name><Name language-id=\"zh_CN\">云布局</Name><Name language-id=\"es_ES\">Diseño de nube</Name><Name language-id=\"nl_NL\">Cloudlay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med länkar med olika storlekar baserat på frekvens.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de links com tamanhos variados baseados pela frequência.</Description><Description language-id=\"ja_JP\">用語を頻度に応じてサイズが変わるインライン形式のリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme d\'une liste intégrée de liens dont les tailles varient en fonction des fréquences.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások sorközi listájaként a gyakoriságtól függően változó méretben.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Linkliste mit unterschiedlichen Größen auf Basis der Häufigkeit anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'enllaços amb diverses mides basats en la freqüència.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من الروابط بأحجام مختلفة تبعًا للتردد.</Description><Description language-id=\"fi_FI\">Näytä termit inline-luettelona koko vaihdellen esiintymistaajuuden mukaan.</Description><Description language-id=\"en_US\">Display terms as an inline list of links with varying sizes based on frequency.</Description><Description language-id=\"zh_CN\">将搜索词显示为大小随频率变化的内联链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces en línea con distintos tamaños basados en la frecuencia.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links van verschillende lengte op basis van frequentie.</Description></root>', 'display', NULL, 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetCPOptionsPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetCPOptionsPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${title}\"\n	>\n		<ul class=\"list-unstyled tag-cloud\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<span class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} tag-popularity-${entry.getPopularity()} term-name\"\n							data-term-id=\"${entry.getTerm()}\"\n							name=\"${name + entry?index}\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getTerm())}\n						</button>\n					</span>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>', 0, 0, 28925, NULL, NULL),
(0, 0, '6e8281bd-18ba-6724-3a44-a31feb5bbe04', 28927, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.798000', '2022-07-05 09:10:28.798000', 28807, 0, 28834, 'CP-OPTION-FACET-COMPACT-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezés</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposició compacta</Name><Name language-id=\"ar_SA\">مخطط مضغوط</Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\">紧凑布局</Name><Name language-id=\"es_ES\">Diseño compacto</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en lista med länkar.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista de links.</Description><Description language-id=\"ja_JP\">用語をリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste de liens.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások listájaként.</Description><Description language-id=\"de_DE\">Begriffe als Linkliste anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista d\'enllaços.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة من الروابط.</Description><Description language-id=\"fi_FI\">Näytä termit linkkien luettelona.</Description><Description language-id=\"en_US\">Display terms as a list of links.</Description><Description language-id=\"zh_CN\">将搜索词显示为链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces.</Description><Description language-id=\"nl_NL\">Termen weergeven als een lijst met links.</Description></root>', 'display', NULL, 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetCPOptionsPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetCPOptionsPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${title}\"\n	>\n		<ul class=\"list-unstyled\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<li class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term term-name ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')}\"\n							data-term-id=\"${entry.getTerm()}\"\n							name=\"${name + entry?index}\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getTerm())}\n								<#if showFrequencies>\n									<small class=\"term-count\">\n										(${entry.getFrequency()})\n									</small>\n								</#if>\n						</button>\n					</li>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>', 0, 0, 28928, NULL, NULL);
INSERT INTO `ddmtemplate` (`mvccVersion`, `ctCollectionId`, `uuid_`, `templateId`, `groupId`, `companyId`, `userId`, `userName`, `versionUserId`, `versionUserName`, `createDate`, `modifiedDate`, `classNameId`, `classPK`, `resourceClassNameId`, `templateKey`, `version`, `name`, `description`, `type_`, `mode_`, `language`, `script`, `cacheable`, `smallImage`, `smallImageId`, `smallImageURL`, `lastPublishDate`) VALUES
(0, 0, 'ddcf2076-d239-22e8-8e8c-4fdbf420d495', 28930, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.838000', '2022-07-05 09:10:28.838000', 28807, 0, 28834, 'CP-OPTION-FACET-LABEL-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Etikettlayout</Name><Name language-id=\"pt_BR\">Layout do Rótulo</Name><Name language-id=\"ja_JP\">ラベルレイアウト</Name><Name language-id=\"fr_FR\">Disposition des libellés</Name><Name language-id=\"hu_HU\">Címke elrendezése</Name><Name language-id=\"de_DE\">Bezeichnungslayout</Name><Name language-id=\"ca_ES\">Disposició de l\'etiqueta</Name><Name language-id=\"ar_SA\">مخطط التسمية</Name><Name language-id=\"fi_FI\">Selitteen Asettelu</Name><Name language-id=\"en_US\">Label Layout</Name><Name language-id=\"zh_CN\">标签布局</Name><Name language-id=\"es_ES\">Diseño de etiquetas</Name><Name language-id=\"nl_NL\">Labellay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med etiketter.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de rótulos.</Description><Description language-id=\"ja_JP\">用語をインライン形式のリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste intégrée de libellés.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket címkék sorközi listájaként.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Labelliste anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'etiquetes.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من التسميات.</Description><Description language-id=\"fi_FI\">Näytä termit linline-otsikkoluettelona.</Description><Description language-id=\"en_US\">Display terms as an inline list of labels.</Description><Description language-id=\"zh_CN\">将搜索词显示为内联标签列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de etiquetas en línea.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links.</Description></root>', 'display', NULL, 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetCPOptionsPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet search-facet-display-label\"\n		id=\"${namespace + \'facetCPOptionsPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${title}\"\n	>\n		<#if entries?has_content>\n			<div class=\"label-container\">\n				<#list entries as entry>\n					<button\n						class=\"btn label label-lg facet-term term-name ${(entry.isSelected())?then(\'label-primary facet-term-selected\', \'label-secondary facet-term-unselected\')}\"\n						data-term-id=\"${entry.getTerm()}\"\n						name=\"${name + entry?index}\"\n						onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						type=\"button\"\n					>\n						<span class=\"label-item label-item-expand\">\n							${htmlUtil.escape(entry.getTerm())}\n							<#if showFrequencies>\n								(${entry.getFrequency()})\n							</#if>\n						</span>\n					</button>\n				</#list>\n			</div>\n		</#if>\n	</@>\n</@>', 0, 0, 28931, NULL, NULL),
(0, 0, 'df325557-abc9-abd1-6fd2-4127e4a3420d', 28933, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.899000', '2022-07-05 09:10:28.899000', 28808, 0, 28834, 'COMMERCE-PRODUCT-DEFINITION-BASIC-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Básico</Name><Name language-id=\"ja_JP\">通常の検索に戻る</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszerű</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"ca_ES\">Bàsic</Name><Name language-id=\"ar_SA\">أساسي</Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"en_US\">Basic</Name><Name language-id=\"zh_CN\">基本的</Name><Name language-id=\"es_ES\">Básico</Name><Name language-id=\"nl_NL\">Basis</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"ja_JP\">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id=\"hu_HU\">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>', 'display', NULL, 'ftl', '<#assign count = 0\n/>\n\n<#if entries?has_content>\n	<div class=\"row\">\n		<#list entries as curCPCatalogEntry>\n			<#assign\n				image = curCPCatalogEntry.getDefaultImageFileUrl()\n\n				friendlyURL = cpContentHelper.getFriendlyURL(curCPCatalogEntry, themeDisplay)\n\n				name = curCPCatalogEntry.getName()\n			/>\n\n			<div class=\"col-md-4\">\n				<div>\n					<img src=\"${htmlUtil.escapeAttribute(image)}\">\n				</div>\n\n				<div>\n					<a href=\"${htmlUtil.escapeHREF(friendlyURL)}\">\n						<strong>${htmlUtil.escape(name)}</strong>\n					</a>\n				</div>\n			</div>\n\n			<#assign count = count + 1 />\n\n			<#if count gte 3>\n				</div>\n\n				<div class=\"row\">\n\n				<#assign count = 0 />\n			</#if>\n		</#list>\n	</div>\n<#else>\n	<div class=\"alert alert-info\">\n		<@liferay_ui[\"message\"] key=\"no-products-were-found\" />\n	</div>\n</#if>', 0, 0, 28934, NULL, NULL),
(0, 0, 'c7fbb237-051f-23e7-9b8b-5075b4828966', 28936, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.958000', '2022-07-05 09:10:28.958000', 28809, 0, 28834, 'CP-SPECIFICATION-OPTION-FACET-CLOUD-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Cloud-layout</Name><Name language-id=\"pt_BR\">Layout de nuvem</Name><Name language-id=\"ja_JP\">クラウドのレイアウト</Name><Name language-id=\"fr_FR\">Disposition du cloud</Name><Name language-id=\"hu_HU\">Felhő elrendezés</Name><Name language-id=\"de_DE\">Cloudlayout</Name><Name language-id=\"ca_ES\">Disposició del núvol</Name><Name language-id=\"ar_SA\">مخطط السحابة</Name><Name language-id=\"fi_FI\">Pilviasettelu</Name><Name language-id=\"en_US\">Cloud Layout</Name><Name language-id=\"zh_CN\">云布局</Name><Name language-id=\"es_ES\">Diseño de nube</Name><Name language-id=\"nl_NL\">Cloudlay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med länkar med olika storlekar baserat på frekvens.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de links com tamanhos variados baseados pela frequência.</Description><Description language-id=\"ja_JP\">用語を頻度に応じてサイズが変わるインライン形式のリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme d\'une liste intégrée de liens dont les tailles varient en fonction des fréquences.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások sorközi listájaként a gyakoriságtól függően változó méretben.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Linkliste mit unterschiedlichen Größen auf Basis der Häufigkeit anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'enllaços amb diverses mides basats en la freqüència.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من الروابط بأحجام مختلفة تبعًا للتردد.</Description><Description language-id=\"fi_FI\">Näytä termit inline-luettelona koko vaihdellen esiintymistaajuuden mukaan.</Description><Description language-id=\"en_US\">Display terms as an inline list of links with varying sizes based on frequency.</Description><Description language-id=\"zh_CN\">将搜索词显示为大小随频率变化的内联链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces en línea con distintos tamaños basados en la frecuencia.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links van verschillende lengte op basis van frequentie.</Description></root>', 'display', NULL, 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${panelContainerId}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${panelId}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${panelTitle}\"\n	>\n		<ul class=\"list-unstyled tag-cloud\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<span class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} tag-popularity-${entry.getPopularity()} term-name\"\n							data-term-id=\"${entry.getDisplayName()}\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getDisplayName())}\n						</button>\n					</span>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>', 0, 0, 28937, NULL, NULL),
(0, 0, '6f726c68-94da-eac6-4ab1-e9f0cfc9f2a5', 28939, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:28.992000', '2022-07-05 09:10:28.992000', 28809, 0, 28834, 'CP-SPECIFICATION-OPTION-FACET-COMPACT-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezés</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposició compacta</Name><Name language-id=\"ar_SA\">مخطط مضغوط</Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\">紧凑布局</Name><Name language-id=\"es_ES\">Diseño compacto</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en lista med länkar.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista de links.</Description><Description language-id=\"ja_JP\">用語をリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste de liens.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások listájaként.</Description><Description language-id=\"de_DE\">Begriffe als Linkliste anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista d\'enllaços.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة من الروابط.</Description><Description language-id=\"fi_FI\">Näytä termit linkkien luettelona.</Description><Description language-id=\"en_US\">Display terms as a list of links.</Description><Description language-id=\"zh_CN\">将搜索词显示为链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces.</Description><Description language-id=\"nl_NL\">Termen weergeven als een lijst met links.</Description></root>', 'display', NULL, 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${panelContainerId}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${panelId}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${panelTitle}\"\n	>\n		<ul class=\"list-unstyled\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<li class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} term-name\"\n							data-term-id=\"${entry.getDisplayName()}\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getDisplayName())}\n\n							<#if entry.isFrequencyVisible()>\n								<small class=\"term-count\">\n									(${entry.getFrequency()})\n								</small>\n							</#if>\n						</button>\n					</li>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>', 0, 0, 28940, NULL, NULL),
(0, 0, '4d81efe7-3202-0c54-8501-3e6fe2ab84c2', 28942, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:29.024000', '2022-07-05 09:10:29.024000', 28809, 0, 28834, 'CP-SPECIFICATION-OPTION-FACET-LABEL-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Etikettlayout</Name><Name language-id=\"pt_BR\">Layout do Rótulo</Name><Name language-id=\"ja_JP\">ラベルレイアウト</Name><Name language-id=\"fr_FR\">Disposition des libellés</Name><Name language-id=\"hu_HU\">Címke elrendezése</Name><Name language-id=\"de_DE\">Bezeichnungslayout</Name><Name language-id=\"ca_ES\">Disposició de l\'etiqueta</Name><Name language-id=\"ar_SA\">مخطط التسمية</Name><Name language-id=\"fi_FI\">Selitteen Asettelu</Name><Name language-id=\"en_US\">Label Layout</Name><Name language-id=\"zh_CN\">标签布局</Name><Name language-id=\"es_ES\">Diseño de etiquetas</Name><Name language-id=\"nl_NL\">Labellay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med etiketter.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de rótulos.</Description><Description language-id=\"ja_JP\">用語をインライン形式のリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste intégrée de libellés.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket címkék sorközi listájaként.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Labelliste anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'etiquetes.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من التسميات.</Description><Description language-id=\"fi_FI\">Näytä termit linline-otsikkoluettelona.</Description><Description language-id=\"en_US\">Display terms as an inline list of labels.</Description><Description language-id=\"zh_CN\">将搜索词显示为内联标签列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de etiquetas en línea.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links.</Description></root>', 'display', NULL, 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${panelContainerId}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet search-facet-display-label\"\n		id=\"${panelId}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${panelTitle}\"\n	>\n		<#if entries?has_content>\n			<div class=\"label-container\">\n				<#list entries as entry>\n					<button\n						class=\"btn label label-lg facet-term term-name ${(entry.isSelected())?then(\'label-primary facet-term-selected\', \'label-secondary facet-term-unselected\')}\"\n						data-term-id=\"${entry.getDisplayName()}\"\n						onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						type=\"button\"\n					>\n						<span class=\"label-item label-item-expand\">\n							${htmlUtil.escape(entry.getDisplayName())}\n\n							<#if entry.isFrequencyVisible()>\n								(${entry.getFrequency()})\n							</#if>\n						</span>\n					</button>\n				</#list>\n			</div>\n		</#if>\n	</@>\n</@>', 0, 0, 28943, NULL, NULL),
(0, 0, '0e4ea512-7cd0-2ac0-2c2e-27247b677d35', 28945, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:29.058000', '2022-07-05 09:10:29.058000', 20044, 0, 28834, 'SITE-MAP-MULTI-COLUMN-LAYOUT-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">تخطيط أعمدة متعددة</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn för varje sida på den högsta nivån. Varje kolumn inkluderar namnet på varje sida på den högsta nivån samt sidans omedelbara underordnade element listade under den.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada página de nível superior. Cada coluna inclui o nome de uma página de nível superior com os filhos imediatos da página listados abaixo.</Description><Description language-id=\"ja_JP\">最上位のページごとに列を表示します。各列には、トップレベルのページの名前と、直下のサブページのページ名を含みます。</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page de niveau supérieur. Chaque colonne comprend le nom d\'une page de niveau supérieur avec les enfants immédiats indiqués en-dessous.</Description><Description language-id=\"hu_HU\">Megjelenít egy oszlopot minden felső szintű oldalhoz. Mindegyik oszlop tartalmazza a legfelső szintű oldal nevét, alatta az oldal közvetlen utódjával.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte für jede Seite der obersten Ebene. Jede Spalte enthält den Namen einer Seite der obersten Ebene, darunter werden die direkten Unterseiten aufgelistet.</Description><Description language-id=\"ca_ES\">Mostra una columna per cada pàgina de nivell superior. A cada columna, s\'hi inclou el nom d\'una pàgina de nivell superior amb el fill immediat de la pàgina en una llista a la part inferior.</Description><Description language-id=\"ar_SA\">يعرض عمودًا لكل صفحة مستوى أعلى. يتضمن كل عمود اسم صفحة المستوى العلوي بفروع متوسطة للصفحة مدرجة أسفلها.</Description><Description language-id=\"fi_FI\">Näyttää sarakkeen jokaiselle ylätason sivulle. Jokainen sarake sisältää ylätason sivun nimen ja sivun välittömät alasivut lueteltuna alapuolella.</Description><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description><Description language-id=\"zh_CN\">为每个顶级页面显示一列。每一列都包含顶级页面的名称以及页面下所列的直接子级。</Description><Description language-id=\"es_ES\">Muestra una columna por cada página de nivel superior. En cada columna, se incluye el nombre de una página de nivel superior con el elemento secundario inmediato de la página en una lista de la parte inferior.</Description><Description language-id=\"nl_NL\">Geeft een kolom weer voor elke pagina op het hoogste niveau. Elke kolom bevat de naam van een bovenliggende pagina met alle directe onderliggende pagina\'s eronder.</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<#if (getterUtil.getBoolean(showHiddenPages) || !entry.isHidden()) && layoutPermission.containsWithoutViewableGroup(permissionChecker, entry, \"VIEW\")>\n				<@liferay_aui.col width=25>\n					<div class=\"results-header\">\n						<h3>\n							<a\n\n							<#assign layoutType = entry.getLayoutType() />\n\n							<#if layoutType.isBrowsable()>\n								href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n							</#if>\n\n							>${entry.getName(locale)}</a>\n						</h3>\n					</div>\n\n					<@displayPages\n						depth=1\n						pages=entry.getChildren(permissionChecker)\n					/>\n				</@liferay_aui.col>\n			</#if>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	depth\n	pages\n>\n	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<#if getterUtil.getBoolean(showHiddenPages) || !page.isHidden()>\n					<li>\n						<a\n\n						<#assign pageType = page.getLayoutType() />\n\n						<#if pageType.isBrowsable()>\n							href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n						</#if>\n\n						>${page.getName(locale)}</a>\n\n						<@displayPages\n							depth=depth + 1\n							pages=page.getChildren(permissionChecker)\n						/>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 0, 28946, NULL, NULL),
(0, 0, '72669474-27ae-bda4-caf0-2db686b4e951', 28948, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:29.104000', '2022-07-05 09:10:29.104000', 28812, 0, 28834, 'BREADCRUMB-ARROWS-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Pilar</Name><Name language-id=\"pt_BR\">Setas</Name><Name language-id=\"ja_JP\">矢印</Name><Name language-id=\"fr_FR\">Flèches</Name><Name language-id=\"hu_HU\">Nyilak</Name><Name language-id=\"de_DE\">Pfeile</Name><Name language-id=\"ca_ES\">Fletxes</Name><Name language-id=\"ar_SA\">الأسهم</Name><Name language-id=\"fi_FI\">Nuolet</Name><Name language-id=\"en_US\">Arrows</Name><Name language-id=\"zh_CN\">箭头</Name><Name language-id=\"es_ES\">Flechas</Name><Name language-id=\"nl_NL\">Pijlen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en länkstig där varje navigeringselement representeras av en pil med titel och länk.</Description><Description language-id=\"pt_BR\">Exibe um caminho de navegação onde cada elemento de navegação é representado por uma seta com seu título e link.</Description><Description language-id=\"ja_JP\">すべてのナビゲーション要素が矢印とタイトル、リンクで表示されるように、パンくずリストを表示します。</Description><Description language-id=\"fr_FR\">Affiche un fil d\'Ariane dans lequel chaque élément de navigation est représenté par une flèche avec son propre titre et son propre lien.</Description><Description language-id=\"hu_HU\">Megjelenít egy úrkövetőt, amelyen minden navigációs elemet egy nyíl képvisel címmel és hivatkozással tartalmaz.</Description><Description language-id=\"de_DE\">Zeigt eine Breadcrumbnavigation an, bei der jedes Navigationselement durch einen Pfeil mit seinem Titel und einem Link dargestellt wird.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegació en què cada element de navegació es representa amb una fletxa amb el seu títol i enllaç.</Description><Description language-id=\"ar_SA\">يعرض مسار تنقل تفصيلي يتم فيه تمثيل كل عنصر تنقل بواسطة سهم به عنوانه ورابطه.</Description><Description language-id=\"fi_FI\">Näyttää murupolun, jossa jokainen navigointielementti näkyy nuolena otsikkoineen ja linkkinä.</Description><Description language-id=\"en_US\">Displays a breadcrumb in which every navigation element is represented by an arrow with its title and link.</Description><Description language-id=\"zh_CN\">显示一个面包屑导航，其中每一个导航元素都由箭头及其标题和链接表示。</Description><Description language-id=\"es_ES\">Muestra una ruta de navegación donde cada elemento de navegación se representa mediante una flecha con su título y enlace.</Description><Description language-id=\"nl_NL\">Geeft een broodkruimel weer waarin elk navigatie-element voorgesteld wordt door een pijl met een titel en link.</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<@liferay_util[\"html-top\"]>\n		<style>\n			.breadcrumb-arrows li {\n				background-color: #EFEFEF;\n				margin-bottom: 3px;\n				overflow: visible;\n			}\n\n			.breadcrumb-arrows li + li::before {\n				content: none;\n			}\n\n			.breadcrumb-arrows li > a {\n				border-right: 4px solid #FFF;\n				display: block;\n				max-width: 100%;\n				position: relative;\n			}\n\n			.breadcrumb-arrows .entry {\n				line-height: 40px;\n				overflow: hidden;\n				padding-left: 30px;\n				padding-right: 7px;\n				text-overflow: ellipsis;\n				white-space: nowrap;\n			}\n\n			.breadcrumb-arrows a::after {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #EFEFEF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				position: absolute;\n				right: -20px;\n				top: 0;\n				width: 0;\n				z-index: 2;\n			}\n\n			.breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child {\n				border-bottom-right-radius: 4px;\n				border-right-width: 0;\n				border-top-right-radius: 4px;\n				position: relative;\n			}\n\n			.breadcrumb-arrows li:last-child::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child .entry {\n				padding-right: 23px;\n			}\n\n			.breadcrumb-arrows li:first-child {\n				border-bottom-left-radius: 4px;\n				border-top-left-radius: 4px;\n			}\n\n			.breadcrumb-arrows li:first-child::before {\n				border-left-width: 0;\n			}\n\n			.breadcrumb-arrows li:first-child .entry {\n				padding-left: 23px;\n			}\n\n			.breadcrumb-arrows .active {\n				background-color: #007ACC;\n			}\n\n			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {\n				color: #FFF;\n			}\n\n			.breadcrumb-arrows .active a::after {\n				border-left-color: #007ACC;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {\n				border-right-color: #F5F7F8;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-left-color: #F5F7F8;\n			}\n		</style>\n	</@>\n\n	<div class=\"breadcrumb breadcrumb-arrows\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\" <#if entry?is_last>aria-current=\"page\"</#if>>\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				<div class=\"entry\">\n					${htmlUtil.escape(entry.getTitle())}\n				</div>\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</div>\n</#if>', 0, 0, 28949, NULL, NULL),
(0, 0, 'c57f2bbf-98d4-b192-a169-acc4d8ac4f5f', 28951, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:29.148000', '2022-07-05 09:10:29.148000', 28812, 0, 28834, 'BREADCRUMB-HORIZONTAL-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Horisontell</Name><Name language-id=\"pt_BR\">Horizontal</Name><Name language-id=\"ja_JP\">水平方向</Name><Name language-id=\"fr_FR\">Horizontal(e)</Name><Name language-id=\"hu_HU\">Vízszintes</Name><Name language-id=\"de_DE\">Horizontal</Name><Name language-id=\"ca_ES\">Horitzontal</Name><Name language-id=\"ar_SA\">أفقي</Name><Name language-id=\"fi_FI\">Vaakasuuntainen</Name><Name language-id=\"en_US\">Horizontal</Name><Name language-id=\"zh_CN\">水平</Name><Name language-id=\"es_ES\">Horizontal</Name><Name language-id=\"nl_NL\">Horizontaal</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en länkstig horisontellt.</Description><Description language-id=\"pt_BR\">Exibe um caminho de navegação horizontalmente.</Description><Description language-id=\"ja_JP\">パンくずリストをを水平方向に表示します</Description><Description language-id=\"fr_FR\">Affiche un fil d\'Ariane de manière horizontale.</Description><Description language-id=\"hu_HU\">Megjelenít egy útkövetőjelet vízszintesen.</Description><Description language-id=\"de_DE\">Zeigt eine Breadcrumbnavigation horizontal an.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegació horitzontalment.</Description><Description language-id=\"ar_SA\">يعرض مسار تنقل أفقيًا.</Description><Description language-id=\"fi_FI\">Näyttää murupolun vaakasuoraan.</Description><Description language-id=\"en_US\">Displays a breadcrumb horizontally.</Description><Description language-id=\"zh_CN\">水平显示面包屑导航。</Description><Description language-id=\"es_ES\">Muestra una ruta de navegación horizontalmente.</Description><Description language-id=\"nl_NL\">Geeft een broodkruimel horizontaal weer.</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<ol class=\"breadcrumb\">\n		<#list entries as entry>\n			<li class=\"breadcrumb-item\">\n				<#if entry?has_next>\n					<a class=\"breadcrumb-link\" href=\"${entry.getURL()!\"\"}\" title=\"${htmlUtil.escape(entry.getTitle())}\">\n						<span class=\"breadcrumb-text-truncate\">${htmlUtil.escape(entry.getTitle())}</span>\n					</a>\n				<#else>\n					<span class=\"active breadcrumb-text-truncate\">${htmlUtil.escape(entry.getTitle())}</span>\n				</#if>\n			</li>\n		</#list>\n	</ol>\n</#if>', 0, 0, 28952, NULL, NULL),
(0, 0, 'fb36f098-ec8d-b502-e53d-c7ac7ae2eed2', 28954, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:29.182000', '2022-07-05 09:10:29.182000', 28812, 0, 28834, 'BREADCRUMB-VERTICAL-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Vertikal</Name><Name language-id=\"pt_BR\">Vertical</Name><Name language-id=\"ja_JP\">垂直方向</Name><Name language-id=\"fr_FR\">Vertical</Name><Name language-id=\"hu_HU\">Függőleges</Name><Name language-id=\"de_DE\">Vertikal</Name><Name language-id=\"ca_ES\">Vertical</Name><Name language-id=\"ar_SA\">رأسي</Name><Name language-id=\"fi_FI\">Pystysuora</Name><Name language-id=\"en_US\">Vertical</Name><Name language-id=\"zh_CN\">垂直</Name><Name language-id=\"es_ES\">Vertical</Name><Name language-id=\"nl_NL\">Verticaal</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en länkstig vertikalt.</Description><Description language-id=\"pt_BR\">Exibe um caminho de navegação verticalmente.</Description><Description language-id=\"ja_JP\">パンくずリストをを垂直方向に表示します</Description><Description language-id=\"fr_FR\">Affiche un fil d\'Ariane vertical.</Description><Description language-id=\"hu_HU\">Megjelenít egy útkövetőjelet függőlegesen.</Description><Description language-id=\"de_DE\">Zeigt eine Breadcrumbnavigation vertikal an.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegació verticalment.</Description><Description language-id=\"ar_SA\">يعرض مسار تنقل رأسيًا.</Description><Description language-id=\"fi_FI\">Näyttää murupolun pystysuoraan.</Description><Description language-id=\"en_US\">Displays a breadcrumb vertically.</Description><Description language-id=\"zh_CN\">垂直显示面包屑导航。</Description><Description language-id=\"es_ES\">Muestra una ruta de navegación verticalmente.</Description><Description language-id=\"nl_NL\">Geeft een broodkruimel verticaal weer.</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<ul class=\"breadcrumb breadcrumb-vertical\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\" <#if entry?is_last>aria-current=\"page\"</#if>>\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				${htmlUtil.escape(entry.getTitle())}\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</ul>\n</#if>', 0, 0, 28955, NULL, NULL),
(0, 0, 'ebfc8cd0-3307-e2d1-04b9-158df302cc4a', 28957, 20125, 20099, 20103, NULL, 20103, NULL, '2022-07-05 09:10:29.228000', '2022-07-05 09:10:29.228000', 28813, 0, 28834, 'CATEGORY-FACET-CLOUD-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Cloud-layout</Name><Name language-id=\"pt_BR\">Layout de nuvem</Name><Name language-id=\"ja_JP\">クラウドのレイアウト</Name><Name language-id=\"fr_FR\">Disposition du cloud</Name><Name language-id=\"hu_HU\">Felhő elrendezés</Name><Name language-id=\"de_DE\">Cloudlayout</Name><Name language-id=\"ca_ES\">Disposició del núvol</Name><Name language-id=\"ar_SA\">مخطط السحابة</Name><Name language-id=\"fi_FI\">Pilviasettelu</Name><Name language-id=\"en_US\">Cloud Layout</Name><Name language-id=\"zh_CN\">云布局</Name><Name language-id=\"es_ES\">Diseño de nube</Name><Name language-id=\"nl_NL\">Cloudlay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med länkar med olika storlekar baserat på frekvens.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de links com tamanhos variados baseados pela frequência.</Description><Description language-id=\"ja_JP\">用語を頻度に応じてサイズが変わるインライン形式のリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme d\'une liste intégrée de liens dont les tailles varient en fonction des fréquences.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások sorközi listájaként a gyakoriságtól függően változó méretben.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Linkliste mit unterschiedlichen Größen auf Basis der Häufigkeit anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'enllaços amb diverses mides basats en la freqüència.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من الروابط بأحجام مختلفة تبعًا للتردد.</Description><Description language-id=\"fi_FI\">Näytä termit inline-luettelona koko vaihdellen esiintymistaajuuden mukaan.</Description><Description language-id=\"en_US\">Display terms as an inline list of links with varying sizes based on frequency.</Description><Description language-id=\"zh_CN\">将搜索词显示为大小随频率变化的内联链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces en línea con distintos tamaños basados en la frecuencia.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links van verschillende lengte op basis van frequentie.</Description></root>', 'display', NULL, 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetAssetCategoriesPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetAssetCategoriesPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"category\"\n	>\n		<ul class=\"list-unstyled tag-cloud\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<span class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} tag-popularity-${entry.getPopularity()} term-name\"\n							data-term-id=\"${entry.getAssetCategoryId()}\"\n							disabled\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getDisplayName())}\n						</button>\n					</span>\n				</#list>\n			</#if>\n		</ul>\n\n		<#if !assetCategoriesSearchFacetDisplayContext.isNothingSelected()>\n			<@liferay_aui.button\n				cssClass=\"btn-link btn-unstyled facet-clear-btn\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n				value=\"clear\"\n			/>\n		</#if>\n	</@>\n</@>', 0, 0, 28958, NULL, NULL),
