 language-id=\"en_US\">Display terms as a list of links.</Description><Description language-id=\"zh_CN\">将搜索词显示为链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces.</Description><Description language-id=\"nl_NL\">Termen weergeven als een lijst met links.</Description></root>', 'display', NULL, 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetUserPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetUserPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"user\"\n	>\n		<ul class=\"list-unstyled\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<li class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} term-name\"\n							data-term-id=\"${entry.getUserName()}\"\n							disabled\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getUserName())}\n\n							<#if entry.isFrequencyVisible()>\n								<small class=\"term-count\">\n									(${entry.getFrequency()})\n								</small>\n							</#if>\n						</button>\n					</li>\n				</#list>\n			</#if>\n		</ul>\n\n		<#if !userSearchFacetDisplayContext.isNothingSelected()>\n			<@liferay_aui.button\n				cssClass=\"btn-link btn-unstyled facet-clear-btn\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n				value=\"clear\"\n			/>\n		</#if>\n	</@>\n</@>', 0, 0, 29021, NULL, NULL),
