ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>', 'ftl', '<#if commerceCartContentTotalDisplayContext.getCommerceOrderPrice()??>\n	<#assign\n		commerceOrderPrice = commerceCartContentTotalDisplayContext.getCommerceOrderPrice()\n\n		commerceOrderTotal = commerceOrderPrice.getTotal()\n	/>\n\n	<h4>\n		<strong><@liferay_ui[\"message\"] key=\"total\" /> ${commerceOrderTotal.format(locale)}</strong>\n	</h4>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:27.931000'),
(0, 0, 28846, 20125, 20099, 20103, NULL, '2022-07-05 09:10:27.988000', 20146, 0, 28844, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Listmeny</Name><Name language-id=\"pt_BR\">Menu de lista</Name><Name language-id=\"ja_JP\">リスト メニュー</Name><Name language-id=\"fr_FR\">Menu de Liste</Name><Name language-id=\"hu_HU\">Lista menü</Name><Name language-id=\"de_DE\">Listenmenü</Name><Name language-id=\"ca_ES\">Menú de llista</Name><Name language-id=\"ar_SA\">قائمة القوائم</Name><Name language-id=\"fi_FI\">Luettelovalikko</Name><Name language-id=\"en_US\">List Menu</Name><Name language-id=\"zh_CN\">列表菜单</Name><Name language-id=\"es_ES\">Menú de lista</Name><Name language-id=\"nl_NL\">Lijstmenu</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en navigeringsmeny med en lista.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegação com uma lista.</Description><Description language-id=\"ja_JP\">ナビゲーションメニューをリストで表示します</Description><Description language-id=\"fr_FR\">Affiche un menu de navigation avec une liste.</Description><Description language-id=\"hu_HU\">Megjelenít egy navigációs menüt egy listával.</Description><Description language-id=\"de_DE\">Zeigt ein Navigationsmenü mit einer Liste.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació amb una llista.</Description><Description language-id=\"ar_SA\">يعرض قائمة تنقل تحتوي على قائمة.</Description><Description language-id=\"fi_FI\">Näyttää navigointivalikon luettelolla.</Description><Description language-id=\"en_US\">Displays a navigation menu with a list.</Description><Description language-id=\"zh_CN\">显示带有列表的导航菜单。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación con una lista.</Description><Description language-id=\"nl_NL\">Geeft een navigatiemenu weer met een lijst.</Description></root>', 'ftl', '<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<div aria-label=\"<@liferay.language key=\"site-pages\" />\" class=\"list-menu\">\n		<@buildNavigation\n			branchNavItems=branchNavItems\n			cssClass=\"layouts\"\n			displayDepth=displayDepth\n			includeAllChildNavItems=true\n			navItemLevel=1\n			navItems=entries\n		/>\n	</div>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:27.988000'),
(0, 0, 28849, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.039000', 20146, 0, 28847, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Piller horisontellt</Name><Name language-id=\"pt_BR\">Comprimidos horizontais</Name><Name language-id=\"ja_JP\">水平方向のピル形式</Name><Name language-id=\"fr_FR\">Pilules horizontales</Name><Name language-id=\"hu_HU\">Vízszintes tabletták</Name><Name language-id=\"de_DE\">Pills horizontal</Name><Name language-id=\"ca_ES\">Càpsules horitzontals</Name><Name language-id=\"ar_SA\">أزرار أفقية</Name><Name language-id=\"fi_FI\">Pills Vaakasuunta</Name><Name language-id=\"en_US\">Pills Horizontal</Name><Name language-id=\"zh_CN\">水平药丸</Name><Name language-id=\"es_ES\">Globos horizontales</Name><Name language-id=\"nl_NL\">Horizontale pillen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en navigeringsmeny med navigeringsobjekt som visas som piller.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegação com itens de navegação exibidos como pills.</Description><Description language-id=\"ja_JP\">ピル形式でナビゲーションメニューを表示します。</Description><Description language-id=\"fr_FR\">Affiche un menu de navigation dont les éléments sont affichés sous la forme de pilules.</Description><Description language-id=\"hu_HU\">Megjelenít egy navigációs menüt tablettákként megjelenített navigációs elemekkel.</Description><Description language-id=\"de_DE\">Zeigt ein Navigationsmenü mit Navigationselementen als Pills an.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació amb elements de navegació que es mostren com a càpsules.</Description><Description language-id=\"ar_SA\">يعرض قائمة تنقل بعناصر تنقل يتم عرضها في شكل أزرار.</Description><Description language-id=\"fi_FI\">Näyttää navigointivalikon navigointikohteet pillereinä.</Description><Description language-id=\"en_US\">Displays a navigation menu with navigation items shown as pills.</Description><Description language-id=\"zh_CN\">显示导航菜单，其中导航项显示为药丸。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación con elementos de navegación que se muestran como globos.</Description><Description language-id=\"nl_NL\">Geeft een navigatiemenu weer met navigatie-items in de vorm van pillen.</Description></root>', 'ftl', '<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul aria-label=<@liferay.language key=\"site-pages\" />\" class=\"nav nav-pills navbar-site\" role=\"menubar\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildrenNavItems>\n					<#assign\n						nav_item_attr_has_popup = \"\"\n						nav_item_caret = \"\"\n						nav_item_css_class = \"lfr-nav-item nav-item\"\n						nav_item_href_link = \"\"\n						nav_item_link_css_class = \"nav-link text-truncate\"\n					/>\n\n					<#if showChildrenNavItems>\n						<#assign\n							nav_item_attr_has_popup = \"aria-haspopup=\'true\'\"\n							nav_item_caret = \'<span class=\"lfr-nav-child-toggle\"><i class=\"icon-caret-down\"></i></span>\'\n							nav_item_css_class = \"${nav_item_css_class} dropdown\"\n							nav_item_link_css_class = \"${nav_item_link_css_class} dropdown-toggle\"\n						/>\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\'\" />\n					</#if>\n\n					<#if navItem.isChildSelected() || navItem.isSelected()>\n						<#assign\n							nav_item_css_class = \"${nav_item_css_class} selected active\"\n						/>\n					</#if>\n\n					<li class=\"${nav_item_css_class}\" id=\"layout_${portletDisplay.getId()}_${navItem.getLayoutId()}\" role=\"presentation\">\n						<a ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span class=\"text-truncate\"><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:28.039000'),
(0, 0, 28852, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.089000', 20146, 0, 28850, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Piller justerat</Name><Name language-id=\"pt_BR\">Pills justificados</Name><Name language-id=\"ja_JP\">等幅ピル形式</Name><Name language-id=\"fr_FR\">Pilules justifiées</Name><Name language-id=\"hu_HU\">Sorkizárt tabletták</Name><Name language-id=\"de_DE\">Pills justiert</Name><Name language-id=\"ca_ES\">Càpsules justificades</Name><Name language-id=\"ar_SA\">أزرار معدلة</Name><Name language-id=\"fi_FI\">Pills Tasattu</Name><Name language-id=\"en_US\">Pills Justified</Name><Name language-id=\"zh_CN\">两端对齐药丸</Name><Name language-id=\"es_ES\">Globos justificados</Name><Name language-id=\"nl_NL\">Uitgevulde pillen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en navigeringsmeny med justerade navigeringsobjekt som visas som piller.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegação com itens de navegação justificados exibidos como pills.</Description><Description language-id=\"ja_JP\">等幅のピル形式でナビゲーションメニューを表示します</Description><Description language-id=\"fr_FR\">Affiche un menu de navigation dont les éléments justifiés sont affichés sous la forme de pilules.</Description><Description language-id=\"hu_HU\">Megjelenít egy navigációs menüt tablettákként megjelenített sorkizárt navigációs elemekkel.</Description><Description language-id=\"de_DE\">Zeigt ein Navigationsmenü mit justierten Navigationselementen als Pills an.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació amb elements de navegació justificats que es mostren com a càpsules.</Description><Description