ئمة تنقل بشريط تنقل بنمط افتراضي.</Description><Description language-id=\"fi_FI\">Näyttää navigointivalikon oletustyylisellä navigointipalkilla.</Description><Description language-id=\"en_US\">Displays a navigation menu with a default styled navigation bar.</Description><Description language-id=\"zh_CN\">显示带有默认样式导航栏的导航菜单。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación con una barra de navegación con un estilo predeterminado.</Description><Description language-id=\"nl_NL\">Geeft een navigatiemenu weer met een standaard navigatiebalk.</Description></root>', 'ftl', '<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul aria-label=\"<@liferay.language key=\"site-pages\" />\" class=\"nav navbar-nav navbar-site\" role=\"menubar\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildrenNavItems>\n					<#assign\n						nav_item_attr_has_popup = \"\"\n						nav_item_caret = \"\"\n						nav_item_css_class = \"lfr-nav-item nav-item\"\n						nav_item_href_link = \"\"\n						nav_item_link_css_class = \"nav-link text-truncate\"\n					/>\n\n					<#if showChildrenNavItems>\n						<#assign\n							nav_item_attr_has_popup = \"aria-haspopup=\'true\'\"\n							nav_item_caret = \'<span class=\"lfr-nav-child-toggle\"><i class=\"icon-caret-down\"></i></span>\'\n							nav_item_css_class = \"${nav_item_css_class} dropdown\"\n							nav_item_link_css_class = \"${nav_item_link_css_class} dropdown-toggle\"\n						/>\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\'\" />\n					</#if>\n\n					<#if navItem.isChildSelected() || navItem.isSelected()>\n						<#assign\n							nav_item_css_class = \"${nav_item_css_class} selected active\"\n						/>\n					</#if>\n\n					<li class=\"${nav_item_css_class}\" id=\"layout_${portletDisplay.getId()}_${portletDisplay.getId()}_${navItem.getLayoutId()}\" role=\"presentation\">\n						<a ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span class=\"text-truncate\"><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:28.445000'),
(0, 0, 28908, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.488000', 20146, 0, 28906, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering i vanliga makron</Name><Name language-id=\"pt_BR\">Macros de navegação comuns</Name><Name language-id=\"ja_JP\">ナビゲーションの一般的なマクロ</Name><Name language-id=\"fr_FR\">Macros de navigation ordinaires</Name><Name language-id=\"hu_HU\">Navigáció közös makrói</Name><Name language-id=\"de_DE\">Navigation häufige Makros</Name><Name language-id=\"ca_ES\">Macros comunes de navegació</Name><Name language-id=\"ar_SA\">وحدات الماكرو الشائعة للتنقل</Name><Name language-id=\"fi_FI\">Navigoinnin yleiset makrot</Name><Name language-id=\"en_US\">Navigation common macros</Name><Name language-id=\"zh_CN\">导航常用宏</Name><Name language-id=\"es_ES\">Macros comunes de navegación</Name><Name language-id=\"nl_NL\">Algemene navigatiemacro\'s</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Innehåller vanliga makron för navigeringsmenymallar.</Description><Description language-id=\"pt_BR\">Contém macros comuns para o modelo do menu de navegação.</Description><Description language-id=\"ja_JP\">ナビゲーションメニューテンプレート用のマクロを含みます</Description><Description language-id=\"fr_FR\">Contient les macros ordinaires pour les modèles de menu de navigation.</Description><Description language-id=\"hu_HU\">A navigációs menü sablonok közös makróit tartalmazza.</Description><Description language-id=\"de_DE\">Enthält häufige Makros für Navigationsmenüvorlagen.</Description><Description language-id=\"ca_ES\">Conté macros comunes per a les plantilles del menú de navegació.</Description><Description language-id=\"ar_SA\">يحتوي على وحدات ماكرو شائعة لقوالب قائمة التنقل.</Description><Description language-id=\"fi_FI\">Sisältää yleiset navigointivalikkomallien makrot.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description><Description language-id=\"zh_CN\">包含导航菜单模板的常用宏。</Description><Description language-id=\"es_ES\">Contiene macros comunes para plantillas del menú de navegación.</Description><Description language-id=\"nl_NL\">Bevat algemene macro\'s voor navigatiemenusjablonen.</Description></root>', 'ftl', '<#macro buildChildrenNavItems\n	displayDepth\n	navItem\n	navItemLevel = 2\n>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n	/>\n\n	<#list navItem.getChildren() as childNavigationItem>\n		<#assign\n			nav_child_css_class = \"\"\n		/>\n\n		<#if !childNavigationItem.isChildSelected() && childNavigationItem.isSelected()>\n			<#assign\n				nav_child_css_class = \"active selected\"\n			/>\n		</#if>\n\n		<li class=\"${nav_child_css_class}\" id=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" role=\"presentation\">\n			<#if childNavigationItem.isBrowsable()>\n				<a class=\"dropdown-item\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n			<#else>\n				<span class=\"dropdown-item font-weight-semi-bold navigation-menu__submenu\">${childNavigationItem.getName()}</span>\n			</#if>\n		</li>\n\n		<#if childNavigationItem.hasBrowsableChildren() && ((displayDepth == 0) || (navItemLevel < displayDepth))>\n			<ul class=\"list-unstyled pl-3\">\n				<@buildChildrenNavItems\n					displayDepth=displayDepth\n					navItem=childNavigationItem\n					navItemLevel=(navItemLevel + 1)\n				/>\n			</ul>\n		</#if>\n	</#list>\n</#macro>\n\n<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if !navItem.isChildSelected() && navItem.isSelected()>\n					<#assign\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\">\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 20103, NULL, '2022-07-05 09:10:28.488000'),
(0, 0, 28911, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.520000', 20146, 0, 28909, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Nedrullningsbara listor med delningsknappar</Name><Name language-id=\"pt_BR\">Dividir menus suspensos de botão</Name><Name language-id=\"ja_JP\">スプリットボタンのドロップダウン</Name><Name language-id=\"fr_FR\">Partager les boutons du menu déroulant</Name><Name language-id=\"hu_HU\">Osztott gomb legördülő elemei</Name><Name language-id=\"de_DE\">Dropdown mit geteilten Schaltflächen</Name><Name language-id=\"ca_ES\">Desplegables de botó de divisió</Name><Name language-id=\"ar_SA\">تقسيم القوائم المنسدلة للأزرار</Name><Name language-id=\"fi_FI\">Jakopainikkeen Pudotusvalikot</Name><Name language-id=\"en_US\">Split Button Dropdowns</Name><Name language-id=\"zh_CN\">拆分按钮下拉菜单</Name><Name language-id=\"es_ES\">Desplegables de botón de expansión</Name><Name language-id=\"nl_NL\">Rolmenu met uitgesplitste knoppen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en nedrullningsbar navigeringsmeny med rotmenyobjekt som visas som knappar.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegação suspenso com itens do menu raiz mostrados como botões.</Description><Description language-id=\"ja_JP\">ボタン形式のドロップダウンでナビゲーション メニューを表示します。</Description><Description language-id=\"fr_FR\">Affiche un menu de navigation déroulant dont les éléments sont affichés sous la forme de boutons.</Description><Description language-id=\"hu_HU\">Megjelenít egy lenyíló navigációs menüt, amelyben a gyökérszintű menüpontok gombokként jelennek meg.</Description><Description language-id=\"de_DE\">Zeigt ein Dropdown-Navigationsmenü mit Root-Menüelementen als Schaltflächen an.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació desplegable els elements de menú arrel que es mostren com a botons.</Description><Description language-id=\"ar_SA\">يعرض قائمة تنقل منسدلة تحتوي على عناصر قائمة جذر تظهر كأزرار.</Description><Description language-id=\"fi_FI\">Näyttää pudotusnavigointivalikon juurivalikon kohdat esitettynä painikkeina.</Description><Description language-id=\"en_US\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"zh_CN\">显示下拉式导航菜单，其中根菜单项显示为按钮。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación desplegable con elementos de menú raíz que se muestran como botones.</Description><Description language-id=\"nl_NL\">Geeft een rolmenu voor navigatie weer met rootmenu-items in de vorm van knoppen.</Description></root>', 'ftl', '<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul class=\"navbar-site split-button-dropdowns\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildrenNavItems>\n					<#assign\n						nav_item_css_class = \"\"\n						nav_item_href_link = \"\"\n					/>\n\n					<#if navItem.isChildSelected() || navItem.isSelected()>\n						<#assign nav_item_css_class = \"active\" />\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\' ${navItem.getTarget()}\" />\n					</#if>\n\n					<li>\n						<#if showChildrenNavItems>\n							<#assign toggle_text>\n								<@liferay.language key=\"toggle\" />\n							</#assign>\n\n							<div class=\"btn-group\">\n						</#if>\n\n						<a class=\"${nav_item_css_class} btn btn-secondary\" ${nav_item_href_link}><span>${navItem.getName()}</span></a>\n\n						<#if showChildrenNavItems>\n							<button aria-expanded=\"false\" aria-haspopup=\"true\" class=\"${nav_item_css_class} btn btn-secondary c-px-2 dropdown-toggle\" data-toggle=\"liferay-dropdown\" type=\"button\">\n								<@liferay_aui.icon\n									image=\"angle-down\"\n									markupView=\"lexicon\"\n								/>\n\n								<span class=\'sr-only\'>${toggle_text}</span>\n							</button>\n\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n\n							</div>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:28.520000'),
(0, 0, 28914, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.573000', 28804, 0, 28912, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering</Name><Name language-id=\"pt_BR\">Navegação</Name><Name language-id=\"ja_JP\">ナビゲーション</Name><Name language-id=\"fr_FR\">Navigation</Name><Name language-id=\"hu_HU\">Navigáció</Name><Name language-id=\"de_DE\">Navigation</Name><Name language-id=\"ca_ES\">Navegació</Name><Name language-id=\"ar_SA\">الملاحة</Name><Name language-id=\"fi_FI\">Navigointi</Name><Name language-id=\"en_US\">Navigation</Name><Name language-id=\"zh_CN\">导航</Name><Name language-id=\"es_ES\">Navegación</Name><Name language-id=\"nl_NL\">Navigatie</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar RSS-flödet som ett navigeringsfält i panelen till vänster. Om du klickar på flödet visas en lista med feedposter i panelen till höger.</Description><Description language-id=\"pt_BR\">Exibe os feeds RSS como uma barra de navegação no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id=\"ja_JP\">RSSフィードを左のパネルにナビゲーションバーとして表示します。フィードをクリックすると、右パネルにフィードの内容がリスト表示されます</Description><Description language-id=\"fr_FR\">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d\'entrées de flux sur le panneau droit.</Description><Description language-id=\"hu_HU\">Megjeleníti az RSS hírcsatornákat navigációs oszlopként a bal oldalon. Egy hírcsatornára kattintva megjeleníti a hírcsatorna bejegyzések listáját a jobb oldalon.</Description><Description language-id=\"de_DE\">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeinträge im rechten Bereich dargestellt.</Description><Description language-id=\"ca_ES\">Mostra els canals RSS com una barra de navegació en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d\'entrades en el tauler dret.</Description><Description language-id=\"ar_SA\">يعرض موجزات RSS كشريط تنقل في اللوحة اليسرى. إذ يؤدي النقر فوق موجز إلى عرض قائمة بإدخالات الموجزات على اللوحة اليمنى.</Description><Description language-id=\"fi_FI\">Näyttää RSS-syötteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla syötettä näytetään syötteen arvot oikeassa paneelissa.</Description><Description language-id=\"en_US\">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description><Description language-id=\"zh_CN\">在左侧面板上显示RSS源的导航栏。在右侧面板上点击Feed显示提要条目的列表。</Description><Description language-id=\"es_ES\">Muestra las fuentes RSS como una barra de navegación del panel izquierdo. Al hacer clic en una fuente se muestra una lista de entradas de la fuente en el panel derecho.</Description><Description language-id=\"nl_NL\">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description></root>', 'ftl', '<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div class=\"tab-pane\" id=\"tab-${curEntry_index}\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index >= entriesPerFeed?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												icon=\"calendar\"\n												label=true\n												markupView=\"lexicon\"\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:28.573000'),
(0, 0, 28917, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.623000', 28805, 0, 28915, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Carousel</Name><Name language-id=\"pt_BR\">Carrossel</Name><Name language-id=\"ja_JP\">カルーセル</Name><Name language-id=\"fr_FR\">Carrousel</Name><Name language-id=\"hu_HU\">Körhinta</Name><Name language-id=\"de_DE\">Karussel</Name><Name language-id=\"ca_ES\">Carrussel</Name><Name language-id=\"ar_SA\">مكتبة</Name><Name language-id=\"fi_FI\">Karuselli</Name><Name language-id=\"en_US\">Carousel</Name><Name language-id=\"zh_CN\">轮播</Name><Name language-id=\"es_ES\">Carrusel</Name><Name language-id=\"nl_NL\">Carrousel</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar bilder i carousel-format.</Description><Description language-id=\"pt_BR\">Exibe imagens num carrossel.</Description><Description language-id=\"ja_JP\">カルーセル内に画像を表示</Description><Description language-id=\"fr_FR\">Affiche les images dans un carrousel.</Description><Description language-id=\"hu_HU\">Megjeleníti a képeket körhintaszerűen.</Description><Description language-id=\"de_DE\">Darstellung von Bildern in einem Karussell.</Description><Description language-id=\"ca_ES\">Mostra imatges en format carrusel.</Description><Description language-id=\"ar_SA\">يعرض الصور في مكتبة.</Description><Description language-id=\"fi_FI\">Näyttää kuvat karusellissa.</Description><Description language-id=\"en_US\">Displays images in a carousel.</Description><Description language-id=\"zh_CN\">把图片显示在转盘中。</Description><Description language-id=\"es_ES\">Muestra imágenes en un carrusel.</Description><Description language-id=\"nl_NL\">Geeft afbeeldingen weer in een carrousel.</Description></root>', 'ftl', '<#if entries?has_content>\n	<style>\n		#<@portlet.namespace />carousel .carousel-item {\n			background-color: #000;\n			height: 250px;\n			overflow: hidden;\n			text-align: center;\n			width: 700px;\n		}\n\n		#<@portlet.namespace />carousel .carousel-item img {\n			max-height: 250px;\n			max-width: 700px;\n		}\n	</style>\n\n	<div id=\"<@portlet.namespace />carousel\">\n		<#assign imageMimeTypes = propsUtil.getArray(\"dl.file.entry.preview.image.mime.types\") />\n\n		<#list entries as entry>\n			<#if imageMimeTypes?seq_contains(entry.getMimeType())>\n				<div class=\"carousel-item image-viewer-base-image\">\n					<img src=\"${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, \"\")}\" />\n				</div>\n			</#if>\n		</#list>\n	</div>\n\n	<@liferay_aui.script use=\"aui-carousel\">\n		var carousel = new A.Carousel(\n			{\n				after: {\n					responsive: function(event) {\n						event.stopImmediatePropagation();\n\n						var boundingBox = event.currentTarget.get(\'boundingBox\');\n\n						boundingBox.all(\'.image-viewer-base-image-list, .image-viewer-base-image\').setStyles(\n							{\n								height: \'auto\',\n								maxHeight: event.height,\n								maxWidth: event.width,\n								width: \'auto\'\n							}\n						);\n					}\n				},\n\n				contentBox: \'#<@portlet.namespace />carousel\',\n				height: 250,\n				intervalTime: 2,\n				width: 700\n			}\n		).render();\n	</@liferay_aui.script>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:28.623000'),
(0, 0, 28920, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.668000', 28806, 0, 28918, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Básico</Name><Name language-id=\"ja_JP\">通常の検索に戻る</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszerű</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"ca_ES\">Bàsic</Name><Name language-id=\"ar_SA\">أساسي</Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"en_US\">Basic</Name><Name language-id=\"zh_CN\">基本的</Name><Name language-id=\"es_ES\">Básico</Name><Name language-id=\"nl_NL\">Basis</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"ja_JP\">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id=\"hu_HU\">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>', 'ftl', '<#assign count = 0 />\n\n<div class=\"container-fluid container-fluid-max-xl\" style=\"text-align:center\">\n	<div class=\"row\" style=\"padding:15px\">\n		<#if entries?has_content>\n			<#list entries as curCommerceAddress>\n				<div class=\"col-md-4\" style=\"text-align:left\">\n					<#assign\n						editURL = commerceAddressDisplayContext.getEditCommerceAddressURL(curCommerceAddress.getCommerceAddressId())\n\n						deleteURL = commerceAddressDisplayContext.getDeleteCommerceAddressURL(curCommerceAddress.getCommerceAddressId())\n\n						editButtonValue = languageUtil.get(request, \"edit\")\n\n						removeButtonValue = languageUtil.get(request, \"remove\")\n\n						commerceCountry = curCommerceAddress.getCommerceCountry()\n					/>\n\n					<h2 style=\"color:#000\"><strong>${htmlUtil.escape(curCommerceAddress.getName())}</strong></h2>\n\n					<h3 style=\"color:#000\">${htmlUtil.escape(curCommerceAddress.getStreet1())}</h3>\n\n					<h3 style=\"color:#000\">${htmlUtil.escape(curCommerceAddress.getZip())}, ${htmlUtil.escape(curCommerceAddress.getCity())}</h3>\n\n					<#if commerceCountry??>\n						<h3 style=\"color:#000\">${htmlUtil.escape(commerceCountry.getName(themeDisplay.getLanguageId()))}</h3>\n					</#if>\n\n					<div class=\"row\" style=\"padding-top:30px\">\n						<@liferay_aui.button\n							cssClass=\"btn-lg\"\n							href=\"${editURL}\"\n							name=\"editAddressButton\"\n							value=\"${editButtonValue}\"\n						/>\n\n						<@liferay_aui.button\n							cssClass=\"btn-lg\"\n							href=\"${deleteURL}\"\n							name=\"removeAddressButton\"\n							value=\"${removeButtonValue}\"\n						/>\n					</div>\n				</div>\n\n				<#assign count = count + 1 />\n\n				<#if count gte 3>\n					</div>\n\n					<div class=\"row\" style=\"padding:15px\">\n\n					<#assign count = 0 />\n				</#if>\n			</#list>\n		</#if>\n	</div>\n\n	<div class=\"row\" style=\"padding:50px 0 15px 0\">\n		<#assign addButtonValue = languageUtil.get(request, \"add-address\") />\n\n		<@liferay_aui.button\n			cssClass=\"btn-lg btn-primary\"\n			href=\"${commerceAddressDisplayContext.getAddCommerceAddressURL()}\"\n			name=\"addAddressButton\"\n			value=\"${addButtonValue}\"\n		/>\n	</div>\n</div>', 0, 20103, NULL, '2022-07-05 09:10:28.668000'),
(0, 0, 28923, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.720000', 20015, 0, 28921, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">تخطيط أعمدة متعددة</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn för varje ordlista. Varje kolumn inkluderar namnet på en ordlista med ordlistans toppnivåkategorier listade under.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulário. Cada coluna inclui o nome do vocabulário com as categorias de nível mais alto listadas abaixo dele.</Description><Description language-id=\"ja_JP\">各ボキャブラリ用に列を表示する。各列は以下にリストになっている、最上位に設定されている用語名を含んでいます</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d\'un vocabulaire avec les catégories du niveau racine listées en dessous.</Description><Description language-id=\"hu_HU\">Megjelenít egy oszlopot minden szótár számára. Minden oszlop tartalmazza a szótár nevét, alatta a szótár felső szintű kategóriáival.</Description><Description language-id=\"de_DE\">Stellt eine Spalte für jedes Vokabular dar. Jede Spalte enthält den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id=\"ca_ES\">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell més alta a sota.</Description><Description language-id=\"ar_SA\">يعرض عمودًا لكل مفرد. يتضمن كل عمود اسم المفرد مع فئات المستوى الأعلى للمفردات المدرجة تحتها.</Description><Description language-id=\"fi_FI\">Näyttää sarakkeen jokaiselle sanastolle. Jokainen sarake sisältää sanaston nimen, missä sanaston ylätason luokitukset on listattu.</Description><Description language-id=\"en_US\">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary\'s top level categories listed underneath.</Description><Description language-id=\"zh_CN\">显示一列中的每个词汇，每列包括顶级类别之下的词汇名字。</Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categorías de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"nl_NL\">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorieën eronder.</Description></root>', 'ftl', '<#assign hasCategories = false />\n\n<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<#assign categories = entry.getCategories() />\n\n			<#if categories?has_content>\n				<#assign hasCategories = true />\n\n				<@liferay_aui.col width=25>\n					<div class=\"results-header\">\n						<h3>\n							${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n						</h3>\n					</div>\n\n					<@displayCategories categories=categories />\n				</@liferay_aui.col>\n			</#if>\n		</#list>\n\n		<#if !hasCategories>\n			${renderRequest.setAttribute(\"PORTLET_CONFIGURATOR_VISIBILITY\", true)}\n\n			<div class=\"alert alert-info w-100\">\n				<@liferay_ui.message key=\"there-are-no-categories\" />\n			</div>\n		</#if>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 20103, NULL, '2022-07-05 09:10:28.720000'),
(0, 0, 28926, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.768000', 28807, 0, 28924, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Cloud-layout</Name><Name language-id=\"pt_BR\">Layout de nuvem</Name><Name language-id=\"ja_JP\">クラウドのレイアウト</Name><Name language-id=\"fr_FR\">Disposition du cloud</Name><Name language-id=\"hu_HU\">Felhő elrendezés</Name><Name language-id=\"de_DE\">Cloudlayout</Name><Name language-id=\"ca_ES\">Disposició del núvol</Name><Name language-id=\"ar_SA\">مخطط السحابة</Name><Name language-id=\"fi_FI\">Pilviasettelu</Name><Name language-id=\"en_US\">Cloud Layout</Name><Name language-id=\"zh_CN\">云布局</Name><Name language-id=\"es_ES\">Diseño de nube</Name><Name language-id=\"nl_NL\">Cloudlay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med länkar med olika storlekar baserat på frekvens.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de links com tamanhos variados baseados pela frequência.</Description><Description language-id=\"ja_JP\">用語を頻度に応じてサイズが変わるインライン形式のリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme d\'une liste intégrée de liens dont les tailles varient en fonction des fréquences.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások sorközi listájaként a gyakoriságtól függően változó méretben.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Linkliste mit unterschiedlichen Größen auf Basis der Häufigkeit anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'enllaços amb diverses mides basats en la freqüència.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من الروابط بأحجام مختلفة تبعًا للتردد.</Description><Description language-id=\"fi_FI\">Näytä termit inline-luettelona koko vaihdellen esiintymistaajuuden mukaan.</Description><Description language-id=\"en_US\">Display terms as an inline list of links with varying sizes based on frequency.</Description><Description language-id=\"zh_CN\">将搜索词显示为大小随频率变化的内联链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces en línea con distintos tamaños basados en la frecuencia.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links van verschillende lengte op basis van frequentie.</Description></root>', 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetCPOptionsPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetCPOptionsPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${title}\"\n	>\n		<ul class=\"list-unstyled tag-cloud\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<span class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} tag-popularity-${entry.getPopularity()} term-name\"\n							data-term-id=\"${entry.getTerm()}\"\n							name=\"${name + entry?index}\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getTerm())}\n						</button>\n					</span>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:28.768000'),
(0, 0, 28929, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.798000', 28807, 0, 28927, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezés</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposició compacta</Name><Name language-id=\"ar_SA\">مخطط مضغوط</Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\">紧凑布局</Name><Name language-id=\"es_ES\">Diseño compacto</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en lista med länkar.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista de links.</Description><Description language-id=\"ja_JP\">用語をリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste de liens.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások listájaként.</Description><Description language-id=\"de_DE\">Begriffe als Linkliste anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista d\'enllaços.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة من الروابط.</Description><Description language-id=\"fi_FI\">Näytä termit linkkien luettelona.</Description><Description language-id=\"en_US\">Display terms as a list of links.</Description><Description language-id=\"zh_CN\">将搜索词显示为链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces.</Description><Description language-id=\"nl_NL\">Termen weergeven als een lijst met links.</Description></root>', 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetCPOptionsPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetCPOptionsPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${title}\"\n	>\n		<ul class=\"list-unstyled\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<li class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term term-name ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')}\"\n							data-term-id=\"${entry.getTerm()}\"\n							name=\"${name + entry?index}\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getTerm())}\n								<#if showFrequencies>\n									<small class=\"term-count\">\n										(${entry.getFrequency()})\n									</small>\n								</#if>\n						</button>\n					</li>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:28.798000');
