(0, 0, 28932, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.838000', 28807, 0, 28930, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Etikettlayout</Name><Name language-id=\"pt_BR\">Layout do Rótulo</Name><Name language-id=\"ja_JP\">ラベルレイアウト</Name><Name language-id=\"fr_FR\">Disposition des libellés</Name><Name language-id=\"hu_HU\">Címke elrendezése</Name><Name language-id=\"de_DE\">Bezeichnungslayout</Name><Name language-id=\"ca_ES\">Disposició de l\'etiqueta</Name><Name language-id=\"ar_SA\">مخطط التسمية</Name><Name language-id=\"fi_FI\">Selitteen Asettelu</Name><Name language-id=\"en_US\">Label Layout</Name><Name language-id=\"zh_CN\">标签布局</Name><Name language-id=\"es_ES\">Diseño de etiquetas</Name><Name language-id=\"nl_NL\">Labellay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med etiketter.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de rótulos.</Description><Description language-id=\"ja_JP\">用語をインライン形式のリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste intégrée de libellés.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket címkék sorközi listájaként.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Labelliste anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'etiquetes.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من التسميات.</Description><Description language-id=\"fi_FI\">Näytä termit linline-otsikkoluettelona.</Description><Description language-id=\"en_US\">Display terms as an inline list of labels.</Description><Description language-id=\"zh_CN\">将搜索词显示为内联标签列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de etiquetas en línea.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links.</Description></root>', 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetCPOptionsPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet search-facet-display-label\"\n		id=\"${namespace + \'facetCPOptionsPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${title}\"\n	>\n		<#if entries?has_content>\n			<div class=\"label-container\">\n				<#list entries as entry>\n					<button\n						class=\"btn label label-lg facet-term term-name ${(entry.isSelected())?then(\'label-primary facet-term-selected\', \'label-secondary facet-term-unselected\')}\"\n						data-term-id=\"${entry.getTerm()}\"\n						name=\"${name + entry?index}\"\n						onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						type=\"button\"\n					>\n						<span class=\"label-item label-item-expand\">\n							${htmlUtil.escape(entry.getTerm())}\n							<#if showFrequencies>\n								(${entry.getFrequency()})\n							</#if>\n						</span>\n					</button>\n				</#list>\n			</div>\n		</#if>\n	</@>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:28.838000'),
(0, 0, 28935, 20125, 20099, 20103, NULL, '2022-07-05 09:10:28.899000', 28808, 0, 28933, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Básico</Name><Name language-id=\"ja_JP\">通常の検索に戻る</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszerű</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"ca_ES\">Bàsic</Name><Name language-id=\"ar_SA\">أساسي</Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"en_US\">Basic</Name><Name language-id=\"zh_CN\">基本的</Name><Name language-id=\"es_ES\">Básico</Name><Name language-id=\"nl_NL\">Basis</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"ja_JP\">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id=\"hu_HU\">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>', 'ftl', '<#assign count = 0\n/>\n\n<#if entries?has_content>\n	<div class=\"row\">\n		<#list entries as curCPCatalogEntry>\n			<#assign\n				image = curCPCatalogEntry.getDefaultImageFileUrl()\n\n				friendlyURL = cpContentHelper.getFriendlyURL(curCPCatalogEntry, themeDisplay)\n\n				name = curCPCatalogEntry.getName()\n			/>\n\n			<div class=\"col-md-4\">\n				<div>\n					<img src=\"${htmlUtil.escapeAttribute(image)}\">\n				</div>\n\n				<div>\n					<a href=\"${htmlUtil.escapeHREF(friendlyURL)}\">\n						<strong>${htmlUtil.escape(name)}</strong>\n					</a>\n				</div>\n			</div>\n\n			<#assign count = count + 1 />\n\n			<#if count gte 3>\n				</div>\n\n				<div class=\"row\">\n\n				<#assign count = 0 />\n			</#if>\n		</#list>\n	</div>\n<#else>\n	<div class=\"alert alert-info\">\n		<@liferay_ui[\"message\"] key=\"no-products-were-found\" />\n	</div>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:28.899000'),
