显示为链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces.</Description><Description language-id=\"nl_NL\">Termen weergeven als een lijst met links.</Description></root>', 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${panelContainerId}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${panelId}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${panelTitle}\"\n	>\n		<ul class=\"list-unstyled\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<li class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} term-name\"\n							data-term-id=\"${entry.getDisplayName()}\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getDisplayName())}\n\n							<#if entry.isFrequencyVisible()>\n								<small class=\"term-count\">\n									(${entry.getFrequency()})\n								</small>\n							</#if>\n						</button>\n					</li>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:28.992000'),
(0, 0, 28944, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.024000', 28809, 0, 28942, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Etikettlayout</Name><Name language-id=\"pt_BR\">Layout do Rótulo</Name><Name language-id=\"ja_JP\">ラベルレイアウト</Name><Name language-id=\"fr_FR\">Disposition des libellés</Name><Name language-id=\"hu_HU\">Címke elrendezése</Name><Name language-id=\"de_DE\">Bezeichnungslayout</Name><Name language-id=\"ca_ES\">Disposició de l\'etiqueta</Name><Name language-id=\"ar_SA\">مخطط التسمية</Name><Name language-id=\"fi_FI\">Selitteen Asettelu</Name><Name language-id=\"en_US\">Label Layout</Name><Name language-id=\"zh_CN\">标签布局</Name><Name language-id=\"es_ES\">Diseño de etiquetas</Name><Name language-id=\"nl_NL\">Labellay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med etiketter.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de rótulos.</Description><Description language-id=\"ja_JP\">用語をインライン形式のリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste intégrée de libellés.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket címkék sorközi listájaként.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Labelliste anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'etiquetes.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من التسميات.</Description><Description language-id=\"fi_FI\">Näytä termit linline-otsikkoluettelona.</Description><Description language-id=\"en_US\">Display terms as an inline list of labels.</Description><Description language-id=\"zh_CN\">将搜索词显示为内联标签列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de etiquetas en línea.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links.</Description></root>', 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${panelContainerId}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet search-facet-display-label\"\n		id=\"${panelId}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${panelTitle}\"\n	>\n		<#if entries?has_content>\n			<div class=\"label-container\">\n				<#list entries as entry>\n					<button\n						class=\"btn label label-lg facet-term term-name ${(entry.isSelected())?then(\'label-primary facet-term-selected\', \'label-secondary facet-term-unselected\')}\"\n						data-term-id=\"${entry.getDisplayName()}\"\n						onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						type=\"button\"\n					>\n						<span class=\"label-item label-item-expand\">\n							${htmlUtil.escape(entry.getDisplayName())}\n\n							<#if entry.isFrequencyVisible()>\n								(${entry.getFrequency()})\n							</#if>\n						</span>\n					</button>\n				</#list>\n			</div>\n		</#if>\n	</@>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:29.024000'),
(0, 0, 28947, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.058000', 20044, 0, 28945, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">تخطيط أعمدة متعددة</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn för varje sida på den högsta nivån. Varje kolumn inkluderar namnet på varje sida på den högsta nivån samt sidans omedelbara underordnade element listade under den.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada página de nível superior. Cada coluna inclui o nome de uma página de nível superior com os filhos imediatos da página listados abaixo.</Description><Description language-id=\"ja_JP\">最上位のページごとに列を表示します。各列には、トップレベルのページの名前と、直下のサブページのページ名を含みます。</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page de niveau supérieur. Chaque colonne comprend le nom d\'une page de niveau supérieur avec les enfants immédiats indiqués en-dessous.</Description><Description language-id=\"hu_HU\">Megjelenít egy oszlopot minden felső szintű oldalhoz. Mindegyik oszlop tartalmazza a legfelső szintű oldal nevét, alatta az oldal közvetlen utódjával.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte für jede Seite der obersten Ebene. Jede Spalte enthält den Namen einer Seite der obersten Ebene, darunter werden die direkten Unterseiten aufgelistet.</Description><Description language-id=\"ca_ES\">Mostra una columna per cada pàgina de nivell superior. A cada columna, s\'hi inclou el nom d\'una pàgina de nivell superior amb el fill immediat de la pàgina en una llista a la part inferior.</Description><Description language-id=\"ar_SA\">يعرض عمودًا لكل صفحة مستوى أعلى. يتضمن كل عمود اسم صفحة المستوى العلوي بفروع متوسطة للصفحة مدرجة أسفلها.</Description><Description language-id=\"fi_FI\">Näyttää sarakkeen jokaiselle ylätason sivulle. Jokainen sarake sisältää ylätason sivun nimen ja sivun välittömät alasivut lueteltuna alapuolella.</Description><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description><Description language-id=\"zh_CN\">为每个顶级页面显示一列。每一列都包含顶级页面的名称以及页面下所列的直接子级。</Description><Description language-id=\"es_ES\">Muestra una columna por cada página de nivel superior. En cada columna, se incluye el nombre de una página de nivel superior con el elemento secundario inmediato de la página en una lista de la parte inferior.</Description><Description language-id=\"nl_NL\">Geeft een kolom weer voor elke pagina op het hoogste niveau. Elke kolom bevat de naam van een bovenliggende pagina met alle directe onderliggende pagina\'s eronder.</Description></root>', 'ftl', '<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<#if (getterUtil.getBoolean(showHiddenPages) || !entry.isHidden()) && layoutPermission.containsWithoutViewableGroup(permissionChecker, entry, \"VIEW\")>\n				<@liferay_aui.col width=25>\n					<div class=\"results-header\">\n						<h3>\n							<a\n\n							<#assign layoutType = entry.getLayoutType() />\n\n							<#if layoutType.isBrowsable()>\n								href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n							</#if>\n\n							>${entry.getName(locale)}</a>\n						</h3>\n					</div>\n\n					<@displayPages\n						depth=1\n						pages=entry.getChildren(permissionChecker)\n					/>\n				</@liferay_aui.col>\n			</#if>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	depth\n	pages\n>\n	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<#if getterUtil.getBoolean(showHiddenPages) || !page.isHidden()>\n					<li>\n						<a\n\n						<#assign pageType = page.getLayoutType() />\n\n						<#if pageType.isBrowsable()>\n							href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n						</#if>\n\n						>${page.getName(locale)}</a>\n\n						<@displayPages\n							depth=depth + 1\n							pages=page.getChildren(permissionChecker)\n						/>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 20103, NULL, '2022-07-05 09:10:29.058000'),
(0, 0, 28950, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.104000', 28812, 0, 28948, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Pilar</Name><Name language-id=\"pt_BR\">Setas</Name><Name language-id=\"ja_JP\">矢印</Name><Name language-id=\"fr_FR\">Flèches</Name><Name language-id=\"hu_HU\">Nyilak</Name><Name language-id=\"de_DE\">Pfeile</Name><Name language-id=\"ca_ES\">Fletxes</Name><Name language-id=\"ar_SA\">الأسهم</Name><Name language-id=\"fi_FI\">Nuolet</Name><Name language-id=\"en_US\">Arrows</Name><Name language-id=\"zh_CN\">箭头</Name><Name language-id=\"es_ES\">Flechas</Name><Name language-id=\"nl_NL\">Pijlen</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en länkstig där varje navigeringselement representeras av en pil med titel och länk.</Description><Description language-id=\"pt_BR\">Exibe um caminho de navegação onde cada elemento de navegação é representado por uma seta com seu título e link.</Description><Description language-id=\"ja_JP\">すべてのナビゲーション要素が矢印とタイトル、リンクで表示されるように、パンくずリストを表示します。</Description><Description language-id=\"fr_FR\">Affiche un fil d\'Ariane dans lequel chaque élément de navigation est représenté par une flèche avec son propre titre et son propre lien.</Description><Description language-id=\"hu_HU\">Megjelenít egy úrkövetőt, amelyen minden navigációs elemet egy nyíl képvisel címmel és hivatkozással tartalmaz.</Description><Description language-id=\"de_DE\">Zeigt eine Breadcrumbnavigation an, bei der jedes Navigationselement durch einen Pfeil mit seinem Titel und einem Link dargestellt wird.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegació en què cada element de navegació es representa amb una fletxa amb el seu títol i enllaç.</Description><Description language-id=\"ar_SA\">يعرض مسار تنقل تفصيلي يتم فيه تمثيل كل عنصر تنقل بواسطة سهم به عنوانه ورابطه.</Description><Description language-id=\"fi_FI\">Näyttää murupolun, jossa jokainen navigointielementti näkyy nuolena otsikkoineen ja linkkinä.</Description><Description language-id=\"en_US\">Displays a breadcrumb in which every navigation element is represented by an arrow with its title and link.</Description><Description language-id=\"zh_CN\">显示一个面包屑导航，其中每一个导航元素都由箭头及其标题和链接表示。</Description><Description language-id=\"es_ES\">Muestra una ruta de navegación donde cada elemento de navegación se representa mediante una flecha con su título y enlace.</Description><Description language-id=\"nl_NL\">Geeft een broodkruimel weer waarin elk navigatie-element voorgesteld wordt door een pijl met een titel en link.</Description></root>', 'ftl', '<#if entries?has_content>\n	<@liferay_util[\"html-top\"]>\n		<style>\n			.breadcrumb-arrows li {\n				background-color: #EFEFEF;\n				margin-bottom: 3px;\n				overflow: visible;\n			}\n\n			.breadcrumb-arrows li + li::before {\n				content: none;\n			}\n\n			.breadcrumb-arrows li > a {\n				border-right: 4px solid #FFF;\n				display: block;\n				max-width: 100%;\n				position: relative;\n			}\n\n			.breadcrumb-arrows .entry {\n				line-height: 40px;\n				overflow: hidden;\n				padding-left: 30px;\n				padding-right: 7px;\n				text-overflow: ellipsis;\n				white-space: nowrap;\n			}\n\n			.breadcrumb-arrows a::after {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #EFEFEF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				position: absolute;\n				right: -20px;\n				top: 0;\n				width: 0;\n				z-index: 2;\n			}\n\n			.breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child {\n				border-bottom-right-radius: 4px;\n				border-right-width: 0;\n				border-top-right-radius: 4px;\n				position: relative;\n			}\n\n			.breadcrumb-arrows li:last-child::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child .entry {\n				padding-right: 23px;\n			}\n\n			.breadcrumb-arrows li:first-child {\n				border-bottom-left-radius: 4px;\n				border-top-left-radius: 4px;\n			}\n\n			.breadcrumb-arrows li:first-child::before {\n				border-left-width: 0;\n			}\n\n			.breadcrumb-arrows li:first-child .entry {\n				padding-left: 23px;\n			}\n\n			.breadcrumb-arrows .active {\n				background-color: #007ACC;\n			}\n\n			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {\n				color: #FFF;\n			}\n\n			.breadcrumb-arrows .active a::after {\n				border-left-color: #007ACC;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {\n				border-right-color: #F5F7F8;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-left-color: #F5F7F8;\n			}\n		</style>\n	</@>\n\n	<div class=\"breadcrumb breadcrumb-arrows\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\" <#if entry?is_last>aria-current=\"page\"</#if>>\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				<div class=\"entry\">\n					${htmlUtil.escape(entry.getTitle())}\n				</div>\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</div>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:29.104000'),
