US\">Display terms as an inline list of labels.</Description><Description language-id=\"zh_CN\">将搜索词显示为内联标签列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de etiquetas en línea.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links.</Description></root>', 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetFolderPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet search-facet-display-label\"\n		id=\"${namespace + \'facetFolderPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"folder\"\n	>\n		<#if entries?has_content>\n			<div class=\"label-container\">\n				<#list entries as entry>\n					<button\n						class=\"btn label label-lg facet-term term-name ${(entry.isSelected())?then(\'label-primary facet-term-selected\', \'label-secondary facet-term-unselected\')}\"\n						data-term-id=\"${entry.getFolderId()}\"\n						disabled\n						onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						type=\"button\"\n					>\n						<span class=\"label-item label-item-expand\">\n							${htmlUtil.escape(entry.getDisplayName())}\n\n							<#if entry.isFrequencyVisible()>\n								(${entry.getFrequency()})\n							</#if>\n						</span>\n					</button>\n				</#list>\n			</div>\n		</#if>\n\n		<#if !folderSearchFacetDisplayContext.isNothingSelected()>\n			<@liferay_aui.button\n				cssClass=\"btn-link btn-unstyled facet-clear-btn\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n				value=\"clear\"\n			/>\n		</#if>\n	</@>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:29.490000'),
(0, 0, 28983, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.526000', 28817, 0, 28981, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Radio-layout</Name><Name language-id=\"pt_BR\">Layout de rádio</Name><Name language-id=\"ja_JP\">ラジオのレイアウト</Name><Name language-id=\"fr_FR\">Disposition radio</Name><Name language-id=\"hu_HU\">Rádió elrendezés</Name><Name language-id=\"de_DE\">Optionsfelderlayout</Name><Name language-id=\"ca_ES\">Disposició de ràdio</Name><Name language-id=\"ar_SA\">مخطط الراديو</Name><Name language-id=\"fi_FI\">Valintapainikeasettelu</Name><Name language-id=\"en_US\">Radio Layout</Name><Name language-id=\"zh_CN\">单选按钮布局</Name><Name language-id=\"es_ES\">Diseño de radio</Name><Name language-id=\"nl_NL\">Keuzerondjeslay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren med radioknappar.</Description><Description language-id=\"pt_BR\">Exibir termos como botões de rádio.</Description><Description language-id=\"ja_JP\">用語をラジオボタン付きで表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes avec les boutons radio.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket rádiógombokkal.</Description><Description language-id=\"de_DE\">Begriffe mit Optionsfeldern anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes amb botons de ràdio.</Description><Description language-id=\"ar_SA\">عرض المصطلحات بأزرار اختيار.</Description><Description language-id=\"fi_FI\">Näytä termit radiopainikkeina.</Description><Description language-id=\"en_US\">Display terms with radio buttons.</Description><Description language-id=\"zh_CN\">将搜索词显示为单选按钮。</Description><Description language-id=\"es_ES\">Muestra términos con botones de radio.</Description><Description language-id=\"nl_NL\">Termen weergeven met checkboxen.</Description></root>', 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetModifiedPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetModifiedPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"last-modified\"\n	>\n		<ul class=\"list-unstyled modified\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<li class=\"facet-value\">\n						<div class=\"custom-control custom-radio\">\n							<label class=\"facet-checkbox-label\" for=\"${entry.getLabel()}\">\n								<input\n									${(entry.isSelected())?then(\"checked\", \"\")}\n									class=\"custom-control-input facet-term\"\n									disabled\n									id=\"${entry.getLabel()}\"\n									name=\"${entry.getLabel()}\"\n									onChange=\'${\"window.location.href = \\\"${entry.getRangeURL()}\\\";\"}\'\n									role=\"radio\"\n									type=\"radio\"\n								/>\n\n								<span class=\"custom-control-label term-name ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')}\">\n									<span class=\"custom-control-label-text\">\n										<@liferay_ui[\"message\"] key=\"${htmlUtil.escape(entry.getLabel())}\" />\n									</span>\n								</span>\n\n								<small class=\"term-count\">\n									(${entry.getFrequency()})\n								</small>\n							</label>\n						</div>\n					</li>\n				</#list>\n			</#if>\n\n			<li class=\"facet-value\">\n				<div class=\"custom-control custom-radio\">\n					<label class=\"facet-checkbox-label\" for=\"${customRangeModifiedFacetTermDisplayContext.getLabel()}\">\n						<input\n							${(customRangeModifiedFacetTermDisplayContext.isSelected())?then(\"checked\", \"\")}\n							class=\"custom-control-input facet-term\"\n							disabled\n							id=\"${customRangeModifiedFacetTermDisplayContext.getLabel()}\"\n							name=\"${customRangeModifiedFacetTermDisplayContext.getLabel()}\"\n							onChange=\'${\"window.location.href = \\\"${customRangeModifiedFacetTermDisplayContext.getRangeURL()}\\\";\"}\'\n							role=\"radio\"\n							type=\"radio\"\n						/>\n\n						<span class=\"custom-control-label term-name ${(customRangeModifiedFacetTermDisplayContext.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')}\">\n							<span class=\"custom-control-label-text\">\n								<@liferay_ui[\"message\"] key=\"${htmlUtil.escape(customRangeModifiedFacetTermDisplayContext.getLabel())}\" />\n							</span>\n						</span>\n\n						<#if customRangeModifiedFacetTermDisplayContext.isSelected()>\n							<small class=\"term-count\">\n								(${customRangeModifiedFacetTermDisplayContext.getFrequency()})\n							</small>\n						</#if>\n					</label>\n				</div>\n			</li>\n\n			<div class=\"${(!modifiedFacetCalendarDisplayContext.isSelected())?then(\"hide\", \"\")} modified-custom-range\" id=\"${namespace}customRange\">\n				<div class=\"col-md-6\" id=\"${namespace}customRangeFrom\">\n					<@liferay_aui[\"field-wrapper\"] label=\"from\">\n						<@liferay_ui[\"input-date\"]\n							cssClass=\"modified-facet-custom-range-input-date-from\"\n							dayParam=\"fromDay\"\n							dayValue=modifiedFacetCalendarDisplayContext.getFromDayValue()\n							disabled=false\n							firstDayOfWeek=modifiedFacetCalendarDisplayContext.getFromFirstDayOfWeek()\n							monthParam=\"fromMonth\"\n							monthValue=modifiedFacetCalendarDisplayContext.getFromMonthValue()\n							name=\"fromInput\"\n							yearParam=\"fromYear\"\n							yearValue=modifiedFacetCalendarDisplayContext.getFromYearValue()\n						/>\n					</@>\n				</div>\n\n				<div class=\"col-md-6\" id=\"${namespace}customRangeTo\">\n					<@liferay_aui[\"field-wrapper\"] label=\"to\">\n						<@liferay_ui[\"input-date\"]\n							cssClass=\"modified-facet-custom-range-input-date-to\"\n							dayParam=\"toDay\"\n							dayValue=modifiedFacetCalendarDisplayContext.getToDayValue()\n							disabled=false\n							firstDayOfWeek=modifiedFacetCalendarDisplayContext.getToFirstDayOfWeek()\n							monthParam=\"toMonth\"\n							monthValue=modifiedFacetCalendarDisplayContext.getToMonthValue()\n							name=\"toInput\"\n							yearParam=\"toYear\"\n							yearValue=modifiedFacetCalendarDisplayContext.getToYearValue()\n						/>\n					</@>\n				</div>\n\n				<@liferay_aui.button\n					cssClass=\"modified-facet-custom-range-filter-button\"\n					disabled=modifiedFacetCalendarDisplayContext.isRangeBackwards()\n					name=\"searchCustomRangeButton\"\n					value=\"search\"\n				/>\n			</div>\n		</ul>\n\n		<#if !modifiedFacetDisplayContext.isNothingSelected()>\n			<@liferay_aui.button\n				cssClass=\"btn-link btn-unstyled facet-clear-btn\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n				value=\"clear\"\n			/>\n		</#if>\n	</@>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:29.526000'),
(0, 0, 28986, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.613000', 28818, 0, 28984, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout för vänsterjusterad ikon</Name><Name language-id=\"pt_BR\">Layout do Ícone Alinhado à Esquerda</Name><Name language-id=\"ja_JP\">左揃えのアイコンレイアウト</Name><Name language-id=\"fr_FR\">Disposition icône alignée à gauche</Name><Name language-id=\"hu_HU\">Elrendezés balra igazított ikonnal</Name><Name language-id=\"de_DE\">Links ausgerichtetes Symbollayout</Name><Name language-id=\"ca_ES\">Disposició de la icona alineada a l\'esquerra</Name><Name language-id=\"ar_SA\">مخطط رموز تمت محاذاتها لليسار</Name><Name language-id=\"fi_FI\">Vasemmalle Tasattu Kuvakkeiden Asettelu</Name><Name language-id=\"en_US\">Left Aligned Icon Layout</Name><Name language-id=\"zh_CN\">左对齐图标布局</Name><Name language-id=\"es_ES\">Diseño de icono alineado a la izquierda</Name><Name language-id=\"nl_NL\">Lay-out met pictogram links uitgelijnd</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa sökikonen till vänster.</Description><Description language-id=\"pt_BR\">Exibir o ícone de busca à esquerda.</Description><Description language-id=\"ja_JP\">検索アイコンを左側に表示します。</Description><Description language-id=\"fr_FR\">Afficher l\'icône de recherche sur la gauche.</Description><Description language-id=\"hu_HU\">Jelenítse meg a keresés ikonját a bal oldalon.</Description><Description language-id=\"de_DE\">Such-Symbol links anzeigen.</Description><Description language-id=\"ca_ES\">Mostra la icona de cerca a l\'esquerra.</Description><Description language-id=\"ar_SA\">عرض رمز البحث على اليسار.</Description><Description language-id=\"fi_FI\">Näytä hakukuvake vasemmalla.</Description><Description language-id=\"en_US\">Display the search icon on the left.</Description><Description language-id=\"zh_CN\">在左侧显示搜索图标。</Description><Description language-id=\"es_ES\">Muestra el icono de buscar en la parte izquierda.</Description><Description language-id=\"nl_NL\">Het zoekpictogram links weergeven.</Description></root>', 'ftl', '<@liferay_aui.fieldset cssClass=\"search-bar\">\n	<@liferay_aui.input\n		cssClass=\"search-bar-empty-search-input\"\n		name=\"emptySearchEnabled\"\n		type=\"hidden\"\n		value=searchBarPortletDisplayContext.isEmptySearchEnabled()\n	/>\n\n	<div class=\"input-group ${searchBarPortletDisplayContext.isLetTheUserChooseTheSearchScope()?then(\"search-bar-scope\",\"search-bar-simple\")}\">\n		<#if searchBarPortletDisplayContext.isLetTheUserChooseTheSearchScope()>\n			<div class=\"input-group-item input-group-item-shrink input-group-prepend\">\n				<button aria-label=\"${languageUtil.get(locale, \"submit\")}\" class=\"btn btn-secondary\" type=\"submit\">\n					<@clay.icon symbol=\"search\" />\n				</button>\n			</div>\n\n			<@liferay_aui.select\n				cssClass=\"search-bar-scope-select\"\n				label=\"\"\n				name=htmlUtil.escape(searchBarPortletDisplayContext.getScopeParameterName())\n				title=\"scope\"\n				useNamespace=false\n				wrapperCssClass=\"input-group-item input-group-item-shrink input-group-prepend search-bar-search-select-wrapper\"\n			>\n				<@liferay_aui.option\n				label=\"this-site\"\n				selected=searchBarPortletDisplayContext.isSelectedCurrentSiteSearchScope()\n				value=searchBarPortletDisplayContext.getCurrentSiteSearchScopeParameterString()\n				/>\n\n				<#if searchBarPortletDisplayContext.isAvailableEverythingSearchScope()>\n					<@liferay_aui.option\n						label=\"everything\"\n						selected=searchBarPortletDisplayContext.isSelectedEverythingSearchScope()\n						value=searchBarPortletDisplayContext.getEverythingSearchScopeParameterString()\n					/>\n				</#if>\n			</@>\n\n			<#assign data = {\n				\"test-id\": \"searchInput\"\n			} />\n\n			<@liferay_aui.input\n				autoFocus=true\n				cssClass=\"search-bar-keywords-input\"\n				data=data\n				label=\"\"\n				name=htmlUtil.escape(searchBarPortletDisplayContext.getKeywordsParameterName())\n				placeholder=searchBarPortletDisplayContext.getInputPlaceholder()\n				title=languageUtil.get(locale, \"search\")\n				type=\"text\"\n				useNamespace=false\n				value=htmlUtil.escape(searchBarPortletDisplayContext.getKeywords())\n				wrapperCssClass=\"input-group-item input-group-append search-bar-keywords-input-wrapper\"\n			/>\n		<#else>\n			<div class=\"input-group-item search-bar-keywords-input-wrapper\">\n				<input\n					class=\"form-control input-group-inset input-group-inset-before search-bar-keywords-input\"\n					data-qa-id=\"searchInput\"\n					id=\"${namespace + stringUtil.randomId()}\"\n					name=\"${htmlUtil.escape(searchBarPortletDisplayContext.getKeywordsParameterName())}\"\n					placeholder=\"${searchBarPortletDisplayContext.getInputPlaceholder()}\"\n					title=\"${languageUtil.get(locale, \"search\")}\"\n					type=\"text\"\n					value=\"${htmlUtil.escape(searchBarPortletDisplayContext.getKeywords())}\"\n				/>\n\n				<div class=\"input-group-inset-item input-group-inset-item-before\">\n					<button aria-label=\"${languageUtil.get(locale, \"submit\")}\" class=\"btn btn-unstyled\" type=\"submit\">\n						<@clay.icon symbol=\"search\" />\n					</button>\n				</div>\n\n				<@liferay_aui.input\n					name=htmlUtil.escape(searchBarPortletDisplayContext.getScopeParameterName())\n					type=\"hidden\"\n					value=searchBarPortletDisplayContext.getScopeParameterValue()\n				/>\n			</div>\n		</#if>\n	</div>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:29.613000'),
(0, 0, 28989, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.659000', 28819, 0, 28987, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezés</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposició compacta</Name><Name language-id=\"ar_SA\">مخطط مضغوط</Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\">紧凑布局</Name><Name language-id=\"es_ES\">Diseño compacto</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa bara resultat med titel.</Description><Description language-id=\"pt_BR\">Exibir resultados com apenas seus títulos.</Description><Description language-id=\"ja_JP\">結果についてタイトルのみを表示します。</Description><Description language-id=\"fr_FR\">Afficher les résultats avec seulement leur intitulé.</Description><Description language-id=\"hu_HU\">Az eredményeket csak a címükkel jelenítse meg.</Description><Description language-id=\"de_DE\">Ergebnisse nur mit ihrem Titel anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els resultats només amb el títol.</Description><Description language-id=\"ar_SA\">عرض النتائج باستخدام عنوانها فقط.</Description><Description language-id=\"fi_FI\">Näytä tulokset vain otsikoinaan.</Description><Description language-id=\"en_US\">Display results with only their title.</Description><Description language-id=\"zh_CN\">显示结果及其标题。</Description><Description language-id=\"es_ES\">Muestra resultados solo con el título.</Description><Description language-id=\"nl_NL\">Resultaten weergeven met enkel hun titel.</Description></root>', 'ftl', '<div class=\"search-total-label\">\n	${languageUtil.format(locale, \"x-results-for-x\", [searchContainer.getTotal(), \"<strong>\" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + \"</strong>\"], false)}\n</div>\n\n<div class=\"display-compact\">\n	<ul>\n		<#if entries?has_content>\n			<#list entries as entry>\n				<#if !entry.isTemporarilyUnavailable()>\n					<li>\n						<a class=\"link-primary single-link\" href=\"${entry.getViewURL()}\">\n							${entry.getHighlightedTitle()}\n						</a>\n					</li>\n				</#if>\n			</#list>\n		</#if>\n	</ul>\n</div>', 0, 20103, NULL, '2022-07-05 09:10:29.659000'),
(0, 0, 28992, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.693000', 28819, 0, 28990, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Listlayout</Name><Name language-id=\"pt_BR\">Layout da lista</Name><Name language-id=\"ja_JP\">リストレイアウト</Name><Name language-id=\"fr_FR\">Disposition en liste</Name><Name language-id=\"hu_HU\">Lista elrendezés</Name><Name language-id=\"de_DE\">Listenlayout</Name><Name language-id=\"ca_ES\">Disposició de la llista</Name><Name language-id=\"ar_SA\">مخطط القائمة</Name><Name language-id=\"fi_FI\">Luetteloasettelu</Name><Name language-id=\"en_US\">List Layout</Name><Name language-id=\"zh_CN\">列表布局</Name><Name language-id=\"es_ES\">Diseño de lista</Name><Name language-id=\"nl_NL\">Lijstlay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa resultat med titel, skaparens användarnamn, tillgångstyp och skapandedatum.</Description><Description language-id=\"pt_BR\">Exibir resultados com seus títulos, nome de usuário do criador, tipo de conteúdo e data de criação.</Description><Description language-id=\"ja_JP\">結果とそのタイトル、作成者のユーザー名、アセットタイプ、作成日を表示します。</Description><Description language-id=\"fr_FR\">Afficher les résultats avec leur intitulé, le nom d\'utilisateur du créateur, le type d\'actif et la date de création.</Description><Description language-id=\"hu_HU\">A találatokat jelenítse meg címmel, a készítő felhasználónevével, tartalomtípussal és leírással.</Description><Description language-id=\"de_DE\">Ergebnisse mit deren Titel, Benutzername des Erstellers, Assettyp und Erstellungsdatum anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els resultats amb el títol, el nom d\'usuari del creador, el tipus de contingut i la data de creació.</Description><Description language-id=\"ar_SA\">عرض النتائج من خلال عناوينها، واسم المستخدم المنشئ ونوع الأصل وتاريخ الإنشاء.</Description><Description language-id=\"fi_FI\">Näytä tulokset otsikoineen, luojan käyttäjänimineen, sisältötyyppeineen ja luontipäivineen.</Description><Description language-id=\"en_US\">Display results with their title, creator\'s user name, asset type, and creation date.</Description><Description language-id=\"zh_CN\">显示结果及其标题、创建者用户名、资源类型和创建日期。</Description><Description language-id=\"es_ES\">Muestra resultados con el título, el nombre de usuario del autor, el tipo de activo y la fecha de creación.</Description><Description language-id=\"nl_NL\">Resultaten weergeven met hun titel, de gebruikersnaam van de maker, het assettype en de aanmaakdatum.</Description></root>', 'ftl', '<div class=\"search-total-label\">\n	${languageUtil.format(locale, \"x-results-for-x\", [searchContainer.getTotal(), \"<strong>\" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + \"</strong>\"], false)}\n</div>\n\n<div class=\"display-list\">\n	<ul class=\"list-group\" id=\"search-results-display-list\">\n		<#if entries?has_content>\n			<#list entries as entry>\n				<li class=\"list-group-item list-group-item-flex\">\n					<#if !entry.isTemporarilyUnavailable()>\n						<div class=\"autofit-col\">\n							<#if entry.isThumbnailVisible()>\n								<span class=\"sticker\">\n									<span class=\"sticker-overlay\">\n										<img\n											alt=\"${languageUtil.get(locale, \"thumbnail\")}\"\n											class=\"sticker-img\"\n											src=\"${entry.getThumbnailURLString()}\"\n										/>\n									</span>\n								</span>\n							<#elseif entry.isUserPortraitVisible() && stringUtil.equals(entry.getClassName(), userClassName)>\n								<@liferay_ui[\"user-portrait\"] userId=entry.getAssetEntryUserId() />\n							<#elseif entry.isIconVisible()>\n								<span class=\"sticker sticker-rounded sticker-secondary sticker-static\">\n									<@clay.icon symbol=\"${entry.getIconId()}\" />\n								</span>\n							</#if>\n						</div>\n\n						<div class=\"autofit-col autofit-col-expand\">\n							<section class=\"autofit-section\">\n								<div class=\"list-group-title\">\n									<a href=\"${entry.getViewURL()}\">\n										${entry.getHighlightedTitle()}\n									</a>\n								</div>\n\n								<div class=\"search-results-metadata\">\n									<p class=\"list-group-subtext\">\n										<#if entry.isModelResourceVisible()>\n											<span class=\"subtext-item\">\n												<strong>${entry.getModelResource()}</strong>\n											</span>\n										</#if>\n\n										<#if entry.isLocaleReminderVisible()>\n											<@liferay_ui[\"icon\"]\n												icon=\"../language/${entry.getLocaleLanguageId()}\"\n												message=entry.getLocaleReminder()\n											/>\n										</#if>\n\n										<#if entry.isCreatorVisible()>\n											<span class=\"subtext-item\">\n												&#183;\n\n												<@liferay.language key=\"written-by\" />\n\n												<strong>${htmlUtil.escape(entry.getCreatorUserName())}</strong>\n											</span>\n										</#if>\n\n										<#if entry.isCreationDateVisible()>\n											<span class=\"subtext-item\">\n												<@liferay.language key=\"on-date\" />\n\n												${entry.getCreationDateString()}\n											</span>\n										</#if>\n									</p>\n\n									<#if entry.isContentVisible()>\n										<p class=\"list-group-subtext\">\n											<span class=\"subtext-item\">\n												${entry.getContent()}\n											</span>\n										</p>\n									</#if>\n\n									<#if entry.isFieldsVisible()>\n										<p class=\"list-group-subtext\">\n											<#assign separate = false />\n\n											<#list entry.getFieldDisplayContexts() as fieldDisplayContext>\n												<#if separate>\n													&#183;\n												</#if>\n\n												<span class=\"badge\">${fieldDisplayContext.getName()}</span>\n\n												<span>${fieldDisplayContext.getValuesToString()}</span>\n\n												<#assign separate = true />\n											</#list>\n										</p>\n									</#if>\n\n									<#if entry.isAssetCategoriesOrTagsVisible()>\n										<div class=\"h6 search-document-tags text-default\">\n											<@liferay_asset[\"asset-tags-summary\"]\n												className=entry.getClassName()\n												classPK=entry.getClassPK()\n												paramName=entry.getFieldAssetTagNames()\n												portletURL=entry.getPortletURL()\n											/>\n\n											<@liferay_asset[\"asset-categories-summary\"]\n												className=entry.getClassName()\n												classPK=entry.getClassPK()\n												paramName=entry.getFieldAssetCategoryIds()\n												portletURL=entry.getPortletURL()\n											/>\n										</div>\n									</#if>\n\n									<#if entry.isDocumentFormVisible()>\n										<div class=\"expand-details h6 text-default\">\n											<span class=\"list-group-text\" style=\"\">\n												<a href=\"javascript:;\">\n													<@liferay.language key=\"details\" />...\n												</a>\n											</span>\n										</div>\n\n										<div class=\"hide search-results-list table-details table-responsive\">\n											<table class=\"table\">\n												<thead>\n													<tr>\n														<th class=\"key-column\">\n															<@liferay.language key=\"key\" />\n														</th>\n														<th>\n															<@liferay.language key=\"value\" />\n														</th>\n													</tr>\n												</thead>\n\n												<tbody>\n													<#list entry.getDocumentFormFieldDisplayContexts() as fieldDisplayContext>\n														<tr>\n															<td class=\"key-column table-details-content\">\n																<strong>${htmlUtil.escape(fieldDisplayContext.getName())}</strong>\n															</td>\n															<td class=\"table-details-content\">\n																<code>\n																	${fieldDisplayContext.getValuesToString()}\n																</code>\n															</td>\n														</tr>\n													</#list>\n												</tbody>\n											</table>\n										</div>\n									</#if>\n								</div>\n							</section>\n						</div>\n					<#else>\n						<div class=\"autofit-col\">\n							<div class=\"alert alert-danger\">\n								<@liferay.language_format\n									arguments=\"result\"\n									key=\"is-temporarily-unavailable\"\n								/>\n							</div>\n						</div>\n					</#if>\n				</li>\n			</#list>\n		</#if>\n	</ul>\n</div>\n\n<@liferay_aui.script use=\"aui-base\">\n	A.one(\'#search-results-display-list\').delegate(\n		\'click\',\n		function(event) {\n			var currentTarget = event.currentTarget;\n\n			currentTarget.siblings(\'.search-results-list\').toggleClass(\'hide\');\n		},\n		\'.expand-details\'\n	);\n</@liferay_aui.script>', 0, 20103, NULL, '2022-07-05 09:10:29.693000'),
(0, 0, 28995, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.734000', 28819, 0, 28993, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kortlayout</Name><Name language-id=\"pt_BR\">Layout do cartão</Name><Name language-id=\"ja_JP\">カードレイアウト</Name><Name language-id=\"fr_FR\">Disposition de la carte</Name><Name language-id=\"hu_HU\">Kártyaelrendezés</Name><Name language-id=\"de_DE\">Kartenlayout</Name><Name language-id=\"ca_ES\">Disposició de la targeta</Name><Name language-id=\"ar_SA\">مخطط البطاقة</Name><Name language-id=\"fi_FI\">Kortin Asettelu</Name><Name language-id=\"en_US\">Card Layout</Name><Name language-id=\"zh_CN\">卡片布局</Name><Name language-id=\"es_ES\">Diseño de tarjeta</Name><Name language-id=\"nl_NL\">Kaartlay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa resultat som ett rutnät med kort.</Description><Description language-id=\"pt_BR\">Exibir resultados com uma série de cartões.</Description><Description language-id=\"ja_JP\">結果をグリッド状に配置したカードで表示します。</Description><Description language-id=\"fr_FR\">Afficher les résultats sous la forme de grille de cartes.</Description><Description language-id=\"hu_HU\">Az eredményeket jelenítse meg kártyarácsként.</Description><Description language-id=\"de_DE\">Ergebnisse als Kartengitter anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els resultats com una sèrie de cartes.</Description><Description language-id=\"ar_SA\">عرض النتائج من خلال شبكة من البطاقات.</Description><Description language-id=\"fi_FI\">Näytä tulokset korttien ruudukkona.</Description><Description language-id=\"en_US\">Display results with a grid of cards.</Description><Description language-id=\"zh_CN\">显示结果与卡片网格。</Description><Description language-id=\"es_ES\">Muestra resultados con una cuadrícula de tarjetas.</Description><Description language-id=\"nl_NL\">Resultaten weergeven als een kaartenrooster.</Description></root>', 'ftl', '<div class=\"search-total-label\">\n	${languageUtil.format(locale, \"x-results-for-x\", [searchContainer.getTotal(), \"<strong>\" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + \"</strong>\"], false)}\n</div>\n\n<div class=\"display-card\">\n	<ul class=\"card-page\">\n		<#if entries?has_content>\n			<#list entries as entry>\n				<li class=\"card-page-item card-page-item-asset\">\n					<div class=\"card card-type-asset file-card\">\n						<div class=\"aspect-ratio card-item-first\">\n							<#if entry.isThumbnailVisible()>\n								<img alt=\"${htmlUtil.escape(entry.getTitle())}\" class=\"aspect-ratio-item aspect-ratio-item-center-middle aspect-ratio-item-vertical-fluid\" src=\"${entry.getThumbnailURLString()}\" />\n							<#elseif entry.isUserPortraitVisible() && stringUtil.equals(entry.getClassName(), userClassName)>\n								<div class=\"user-card\">\n									<div class=\"aspect-ratio-item aspect-ratio-item-center-middle aspect-ratio-item-vertical-fluid card-type-asset-icon\">\n											<span class=\"sticker sticker-secondary sticker-user-icon\">\n												<span class=\"sticker-overlay\">\n													<img alt=\"${htmlUtil.escape(entry.getTitle())}\" class=\"img-fluid\" src=\"${entry.getUserPortraitURLString()}\" />\n												</span>\n											</span>\n									</div>\n								</div>\n							<#else>\n								<div class=\"aspect-ratio-item aspect-ratio-item-center-middle aspect-ratio-item-vertical-fluid card-type-asset-icon\">\n									<@clay.icon symbol=\"${(entry.isIconVisible())?then(entry.getIconId(),\'web-content\')}\" />\n								</div>\n							</#if>\n						</div>\n\n						<div class=\"card-body\">\n							<div class=\"card-row\">\n								<div class=\"autofit-col autofit-col-expand\">\n									<section class=\"autofit-section\">\n										<h3 class=\"card-title\">\n											<a href=\"${entry.getViewURL()}\">\n												${entry.getHighlightedTitle()}\n											</a>\n										</h3>\n\n										<#if entry.isCreatorVisible()>\n											<p class=\"card-subtitle\">\n												<span class=\"text-truncate-inline\">\n													<span class=\"text-truncate\">\n														${htmlUtil.escape(entry.getCreatorUserName())}\n													</span>\n												</span>\n											</p>\n										</#if>\n\n										<#if entry.isCreationDateVisible()>\n											<p class=\"card-subtitle\">\n												<span class=\"text-truncate-inline\">\n													<span class=\"text-truncate\">\n														${entry.getCreationDateString()}\n													</span>\n												</span>\n											</p>\n										</#if>\n\n										<#if entry.isModelResourceVisible()>\n											<p class=\"card-subtitle\">\n												<span class=\"text-truncate-inline\">\n													<span class=\"text-truncate\">\n														${entry.getModelResource()}\n													</span>\n												</span>\n											</p>\n										</#if>\n\n										<#if entry.isContentVisible()>\n											<p class=\"card-description\">\n												${entry.getContent()}\n											</p>\n										</#if>\n									</section>\n								</div>\n							</div>\n						</div>\n					</div>\n				</li>\n			</#list>\n		</#if>\n	</ul>\n</div>', 0, 20103, NULL, '2022-07-05 09:10:29.734000'),
(0, 0, 28998, 20125, 20099, 20103, NULL, '2022-07-05 09:10:29.777000', 28820, 0, 28996, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezés</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposició compacta</Name><Name language-id=\"ar_SA\">مخطط مضغوط</Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\">紧凑布局</Name><Name language-id=\"es_ES\">Diseño compacto</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en lista med länkar.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista de links.</Description><Description language-id=\"ja_JP\">用語をリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste de liens.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások listájaként.</Description><Description language-id=\"de_DE\">Begriffe als Linkliste anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista d\'enllaços.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة من الروابط.</Description><Description language-id=\"fi_FI\">Näytä termit linkkien luettelona.</Description><Description language-id=\"en_US\">Display terms as a list of links.</Description><Description language-id=\"zh_CN\">将搜索词显示为链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces.</Description><Description language-id=\"nl_NL\">Termen weergeven als een lijst met links.</Description></root>', 'ftl', '<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetScopePanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetScopePanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"site\"\n	>\n		<ul class=\"list-unstyled\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<li>\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} term-name\"\n							data-term-id=\"${entry.getGroupId()}\"\n							disabled\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getDescriptiveName())}\n\n							<#if entry.isShowCount()>\n								<small class=\"term-count\">\n									(${entry.getCount()})\n								</small>\n							</#if>\n						</button>\n					</li>\n				</#list>\n			</#if>\n		</ul>\n\n		<#if !scopeSearchFacetDisplayContext.isNothingSelected()>\n			<@liferay_aui.button\n				cssClass=\"btn-link btn-unstyled facet-clear-btn\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n				value=\"clear\"\n			/>\n		</#if>\n	</@>\n</@>', 0, 20103, NULL, '2022-07-05 09:10:29.777000');
