(0, 0, 29028, 20125, 20099, 20103, NULL, '2022-07-05 09:10:30.322000', 28831, 0, 29026, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Ikon</Name><Name language-id=\"pt_BR\">Ícone</Name><Name language-id=\"ja_JP\">アイコン</Name><Name language-id=\"fr_FR\">Icône</Name><Name language-id=\"hu_HU\">Ikon</Name><Name language-id=\"de_DE\">Symbol</Name><Name language-id=\"ca_ES\">Icona</Name><Name language-id=\"ar_SA\">أيقونة</Name><Name language-id=\"fi_FI\">Kuvake</Name><Name language-id=\"en_US\">Icon</Name><Name language-id=\"zh_CN\">图标</Name><Name language-id=\"es_ES\">Icono</Name><Name language-id=\"nl_NL\">Pictogram</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar ikonen på flaggan som är associerad med varje språk.</Description><Description language-id=\"pt_BR\">Exibe o ícone do marcador associado com cada idioma.</Description><Description language-id=\"ja_JP\">各言語に関連付けられたフラグのアイコンを表示します</Description><Description language-id=\"fr_FR\">Affiche l\'icône de chaque option associé à chaque langue.</Description><Description language-id=\"hu_HU\">Megjeleníti az egyes nyelvekhez társított zászlót tartalmazó ikont.</Description><Description language-id=\"de_DE\">Zeigt das Symbol der Flagge für jede Sprache an.</Description><Description language-id=\"ca_ES\">Mostra la icona de la bandera associada a cada idioma.</Description><Description language-id=\"ar_SA\">يعرض أيقونة العلم المرتبط بكل لغة.</Description><Description language-id=\"fi_FI\">Näyttä kuhunkin kieleen liittyvän lippukuvakkeen.</Description><Description language-id=\"en_US\">Displays the icon of the flag associated with each language.</Description><Description language-id=\"zh_CN\">显示与每种语言关联的国旗的图标。</Description><Description language-id=\"es_ES\">Muestra el icono de la bandera asociada con cada idioma.</Description><Description language-id=\"nl_NL\">Geeft het pictogram weer van de vlag die bij elke taal hoort.</Description></root>', 'ftl', '<#if entries?has_content>\n	<#list entries as entry>\n		<#if entry.isSelected()>\n			<#assign cssClass = \"current-language\" />\n		</#if>\n\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"icon\"]\n				cssClass=cssClass\n				image=entry.getW3cLanguageId()?lower_case\n				markupView=\"lexicon\"\n				message=entry.getLongDisplayName()\n				url=entry.getURL()\n			/>\n		</#if>\n	</#list>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:30.322000'),
(0, 0, 29031, 20125, 20099, 20103, NULL, '2022-07-05 09:10:30.365000', 28831, 0, 29029, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Ikonmeny</Name><Name language-id=\"pt_BR\">Menu de ícones</Name><Name language-id=\"ja_JP\">アイコン メニュー</Name><Name language-id=\"fr_FR\">Menu d\'icônes</Name><Name language-id=\"hu_HU\">Ikon menü</Name><Name language-id=\"de_DE\">Symbolmenü</Name><Name language-id=\"ca_ES\">Menú d\'icones</Name><Name language-id=\"ar_SA\">قائمة أيقونات</Name><Name language-id=\"fi_FI\">Kuvakevalikko</Name><Name language-id=\"en_US\">Icon Menu</Name><Name language-id=\"zh_CN\">图标菜单</Name><Name language-id=\"es_ES\">Menú de icono</Name><Name language-id=\"nl_NL\">Pictogrammenu</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en ikonmeny med de valda språken.</Description><Description language-id=\"pt_BR\">Exibe um menu de ícone com os idiomas selecionados.</Description><Description language-id=\"ja_JP\">選択した言語のアイコンメニューを表示します。</Description><Description language-id=\"fr_FR\">Affiche un menu d\'icônes avec les langues sélectionnées.</Description><Description language-id=\"hu_HU\">Megjelenít egy ikonmenüt a kiválasztott nyelvekkel.</Description><Description language-id=\"de_DE\">Zeigt ein Symbolmenü mit den ausgewählten Sprachen.</Description><Description language-id=\"ca_ES\">Mostra una icona de menú amb els idiomes seleccionats.</Description><Description language-id=\"ar_SA\">يعرض قائمة الأيقونات باللغات المحددة.</Description><Description language-id=\"fi_FI\">Näyttää valittuihin kieliin liittyvän kuvakevalikon.</Description><Description language-id=\"en_US\">Displays an icon menu with the selected languages.</Description><Description language-id=\"zh_CN\">显示带有选定语言的图标菜单。</Description><Description language-id=\"es_ES\">Muestra un menú de icono con los idiomas seleccionados.</Description><Description language-id=\"nl_NL\">Geeft een pictogrammenu weer met de geselecteerde talen.</Description></root>', 'ftl', '<#if entries?has_content>\n	<#assign normalizedDefaultLanguageId = stringUtil.replace(languageId, \"_\", \"-\") />\n\n	<div class=\"text-truncate\">\n		<@liferay_ui[\"icon-menu\"]\n			direction=\"left-side\"\n			icon=stringUtil.toLowerCase(normalizedDefaultLanguageId)\n			markupView=\"lexicon\"\n			showWhenSingleIcon=true\n			triggerLabel=normalizedDefaultLanguageId\n			triggerType=\"button\"\n		>\n			<#list entries as entry>\n				<#if !entry.isSelected() && !entry.isDisabled()>\n					<#assign\n						entryLocale = entry.getLocale()\n						displayName = stringUtil.toLowerCase(entryLocale.getDisplayLanguage(entryLocale)) + \"-\" + entryLocale.getDisplayCountry(entryLocale)\n						normalizedDefaultLanguageId = stringUtil.toLowerCase(stringUtil.replace(entry.getLanguageId(), \"_\", \"-\"))\n					/>\n\n					<#if languageUtil.isBetaLocale(entryLocale)>\n						<#assign displayName += \" [beta]\" />\n					</#if>\n\n					<@liferay_ui[\"icon\"]\n						icon=normalizedDefaultLanguageId\n						iconCssClass=\"inline-item inline-item-before\"\n						markupView=\"lexicon\"\n						message=displayName\n						url=entry.getURL()\n					/>\n				</#if>\n			</#list>\n		</@>\n	</div>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:30.365000'),
(0, 0, 29034, 20125, 20099, 20103, NULL, '2022-07-05 09:10:30.396000', 28831, 0, 29032, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Lång text</Name><Name language-id=\"pt_BR\">Texto Longo</Name><Name language-id=\"ja_JP\">長いテキスト</Name><Name language-id=\"fr_FR\">Texte Long</Name><Name language-id=\"hu_HU\">Hosszú szöveg</Name><Name language-id=\"de_DE\">Langer Text</Name><Name language-id=\"ca_ES\">Text Llarg</Name><Name language-id=\"ar_SA\">نص طويل</Name><Name language-id=\"fi_FI\">Pitkä Teksti</Name><Name language-id=\"en_US\">Long Text</Name><Name language-id=\"zh_CN\">长文本</Name><Name language-id=\"es_ES\">Texto largo</Name><Name language-id=\"nl_NL\">Lange tekst</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar det fullständiga namnet på varje språk (t.ex. spanska).</Description><Description language-id=\"pt_BR\">Exibe o nome completo de cada idioma (por exemplo, Espanhol).</Description><Description language-id=\"ja_JP\">各言語 (スペイン語など) を完全な名前で表示します</Description><Description language-id=\"fr_FR\">Affiche le nom complet de chaque langue (e.x. espagnol).</Description><Description language-id=\"hu_HU\">Megjeleníti az egyes nyelvek teljes nevét (pl. Spanyol).</Description><Description language-id=\"de_DE\">Zeigt den vollständigen Namen einer jeden Sprache (z. B. Spanisch).</Description><Description language-id=\"ca_ES\">Mostra el nom sencer de cada idioma (p. ex. espanyol).</Description><Description language-id=\"ar_SA\">يعرض الاسم الكامل لكل لغة (على سبيل المثال، باللغة الإسبانية).</Description><Description language-id=\"fi_FI\">Näyttää kunkin kielen koko nimen (esim. espanja).</Description><Description language-id=\"en_US\">Displays the full name of each language (e.g. Spanish).</Description><Description language-id=\"zh_CN\">显示每种语言的全名（例如，Spanish）。</Description><Description language-id=\"es_ES\">Muestra el nombre completo de cada idioma (por ejemplo, español).</Description><Description language-id=\"nl_NL\">Geeft de volledige naam weer van elke taal (bijv. Spaans).</Description></root>', 'ftl', '<style>\n	.language-entry-long-text {\n		display: inline-block;\n		padding: 0 0.5em;\n	}\n</style>\n\n<#if entries?has_content>\n	<#list entries as entry>\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"a\"]\n				cssClass=\"language-entry-long-text\"\n				href=entry.getURL()\n				label=entry.getLongDisplayName()\n				lang=entry.getW3cLanguageId()\n				localizeLabel=false\n			/>\n		</#if>\n	</#list>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:30.396000'),
(0, 0, 29037, 20125, 20099, 20103, NULL, '2022-07-05 09:10:30.432000', 28831, 0, 29035, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Markeringsruta</Name><Name language-id=\"pt_BR\">Caixa de seleção</Name><Name language-id=\"ja_JP\">セレクトボックス</Name><Name language-id=\"fr_FR\">Sélectionner la case</Name><Name language-id=\"hu_HU\">Jelölje be</Name><Name language-id=\"de_DE\">Auswahlkasten</Name><Name language-id=\"ca_ES\">Selecciona la casella</Name><Name language-id=\"ar_SA\">تحديد مربع</Name><Name language-id=\"fi_FI\">Valintalaatikko</Name><Name language-id=\"en_US\">Select Box</Name><Name language-id=\"zh_CN\">选择框</Name><Name language-id=\"es_ES\">Cuadro de selección</Name><Name language-id=\"nl_NL\">Selectievak</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en markeringsruta med de valda språken.</Description><Description language-id=\"pt_BR\">Exibe uma caixa de seleção com os idiomas selecionados.</Description><Description language-id=\"ja_JP\">セレクトボックスで選択された言語を表示します。</Description><Description language-id=\"fr_FR\">Affiche une boîte de sélection contenant les langues choisies.</Description><Description language-id=\"hu_HU\">Megjelenít egy választómezőt a kiválasztott nyelvekkel.</Description><Description language-id=\"de_DE\">Zeigt einen Auswahlkasten mit den ausgewählten Sprachen an.</Description><Description language-id=\"ca_ES\">Mostra una casella amb els idiomes seleccionats.</Description><Description language-id=\"ar_SA\">يعرض خانة اختيار باللغات المحددة.</Description><Description language-id=\"fi_FI\">Näyttää valittuihin kieliin liittyvän valintalaatikon.</Description><Description language-id=\"en_US\">Displays a select box with the selected languages.</Description><Description language-id=\"zh_CN\">显示带有选定语言的选择框。</Description><Description language-id=\"es_ES\">Muestra una casilla con los idiomas seleccionados.</Description><Description language-id=\"nl_NL\">Geeft een selectievak weer met de geselecteerde talen.</Description></root>', 'ftl', '<#if entries?has_content>\n	<#assign languageId = localeUtil.toLanguageId(locale) />\n\n	<style>\n		.taglib-language-option {\n			background: none no-repeat 5px center;\n			padding-left: 25px;\n		}\n\n		<#list entries as entry>\n			.taglib-language-option-${entry.getW3cLanguageId()} {\n				background-image: url(${themeDisplay.getPathThemeImages()}/language/${entry.getLanguageId()}.png);\n			}\n		</#list>\n	</style>\n\n	<@liferay_aui[\"form\"]\n		action=formAction\n		method=\"post\"\n		name=\'${namespace + formName}\'\n		useNamespace=false\n	>\n		<@liferay_aui[\"select\"]\n			changesContext=true\n			id=\'${namespace + formName}\'\n			label=\"\"\n			name=\'${name}\'\n			onChange=\'${namespace + \"changeLanguage();\"}\'\n			title=\"language\"\n		>\n			<#list entries as entry>\n				<@liferay_aui[\"option\"]\n					cssClass=\"taglib-language-option taglib-language-option-${entry.getW3cLanguageId()}\"\n					disabled=entry.isDisabled()\n					label=entry.getLongDisplayName()\n					lang=entry.getW3cLanguageId()\n					localizeLabel=false\n					selected=entry.isSelected()\n					value=entry.getLanguageId()\n				/>\n			</#list>\n		</@>\n	</@>\n\n	<@liferay_aui[\"script\"]>\n		function ${namespace}changeLanguage() {\n			submitForm(document.${namespace + formName});\n		}\n	</@>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:30.432000'),
(0, 0, 29040, 20125, 20099, 20103, NULL, '2022-07-05 09:10:30.475000', 28831, 0, 29038, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kort text</Name><Name language-id=\"pt_BR\">Texto curto</Name><Name language-id=\"ja_JP\">短いテキスト</Name><Name language-id=\"fr_FR\">Texte Court</Name><Name language-id=\"hu_HU\">Rövid szöveg</Name><Name language-id=\"de_DE\">Kurztext</Name><Name language-id=\"ca_ES\">Text curt</Name><Name language-id=\"ar_SA\">نص قصير</Name><Name language-id=\"fi_FI\">Lyhyt Teksti</Name><Name language-id=\"en_US\">Short Text</Name><Name language-id=\"zh_CN\">短文本</Name><Name language-id=\"es_ES\">Texto corto</Name><Name language-id=\"nl_NL\">Korte tekst</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en förkortning av varje språk (t.ex. ES).</Description><Description language-id=\"pt_BR\">Exibe uma abreviatura de cada idioma (por exemplo, ES).</Description><Description language-id=\"ja_JP\">各言語 (例えば ES) の省略形で表示します。</Description><Description language-id=\"fr_FR\">Affiche une abréviation pour chaque langue (par ex. : ES).</Description><Description language-id=\"hu_HU\">Megjeleníti az egyes nyelvek rövidítését (pl. ES).</Description><Description language-id=\"de_DE\">Zeigt eine Abkürzung jeder Sprache an (z. B. ES).</Description><Description language-id=\"ca_ES\">Mostra una abreviatura de cada idioma (p. ex. ES).</Description><Description language-id=\"ar_SA\">يعرض اختصارًا لكل لغة (مثل، ES).</Description><Description language-id=\"fi_FI\">Näyttää jokaisen kielen lyhenteen (esim. ES).</Description><Description language-id=\"en_US\">Displays an abbreviation of each language (e.g. ES).</Description><Description language-id=\"zh_CN\">显示每种语言的缩写（例如，ES）。</Description><Description language-id=\"es_ES\">Muestra una abreviatura de cada idioma (por ejemplo, ES).</Description><Description language-id=\"nl_NL\">Geeft een afkorting weer van elke taal (bijv. ES).</Description></root>', 'ftl', '<style>\n	.language-entry-short-text {\n		padding: 0 0.5em;\n	}\n</style>\n\n<#if entries?has_content>\n	<#list entries as entry>\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"a\"]\n				cssClass=\"language-entry-short-text\"\n				href=entry.getURL()\n				label=entry.getShortDisplayName()\n				lang=entry.getW3cLanguageId()\n			/>\n		</#if>\n	</#list>\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:30.475000');
INSERT INTO `ddmtemplateversion` (`mvccVersion`, `ctCollectionId`, `templateVersionId`, `groupId`, `companyId`, `userId`, `userName`, `createDate`, `classNameId`, `classPK`, `templateId`, `version`, `name`, `description`, `language`, `script`, `status`, `statusByUserId`, `statusByUserName`, `statusDate`) VALUES
(0, 0, 29043, 20125, 20099, 20103, NULL, '2022-07-05 09:10:30.517000', 28832, 0, 29041, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Básico</Name><Name language-id=\"ja_JP\">通常の検索に戻る</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszerű</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"ca_ES\">Bàsic</Name><Name language-id=\"ar_SA\">أساسي</Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"en_US\">Basic</Name><Name language-id=\"zh_CN\">基本的</Name><Name language-id=\"es_ES\">Básico</Name><Name language-id=\"nl_NL\">Basis</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"ja_JP\">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id=\"hu_HU\">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>', 'ftl', '<div class=\"row\">\n	<#assign\n		image = \'\'\n\n		title = \'\'\n\n		description = \'\'\n	/>\n\n	<#if cpCategoryContentDisplayContext.getDefaultImageSrc(themeDisplay)??>\n		<#assign\n			image = cpCategoryContentDisplayContext.getDefaultImageSrc(themeDisplay)\n		/>\n	</#if>\n\n	<#if assetCategory??>\n		<#assign\n			title = assetCategory.getTitle(locale)\n\n			description = assetCategory.getTitle(locale)\n		/>\n	</#if>\n\n	<div>\n		<img src=\"${htmlUtil.escapeAttribute(image)}\">\n	</div>\n\n	<div class=\"container-fluid container-fluid-max-xl\">\n		<h1>${htmlUtil.escape(title)}</h1>\n\n		<p>${htmlUtil.escape(description)}</p>\n	</div>\n</div>', 0, 20103, NULL, '2022-07-05 09:10:30.517000'),
(0, 0, 29046, 20125, 20099, 20103, NULL, '2022-07-05 09:10:30.552000', 20019, 0, 29044, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Färga efter popularitet</Name><Name language-id=\"pt_BR\">Colorir por Popularidade</Name><Name language-id=\"ja_JP\">頻出度により色分けする</Name><Name language-id=\"fr_FR\">Couleur par popularité</Name><Name language-id=\"hu_HU\">Szín népszerűség alapján</Name><Name language-id=\"de_DE\">Nach Popularität färben</Name><Name language-id=\"ca_ES\">Color per popularitat</Name><Name language-id=\"ar_SA\">الألوان حسب الأولوية</Name><Name language-id=\"fi_FI\">Väri suosion mukaan</Name><Name language-id=\"en_US\">Color by Popularity</Name><Name language-id=\"zh_CN\">受欢迎的颜色</Name><Name language-id=\"es_ES\">Color por popularidad</Name><Name language-id=\"nl_NL\">Kleur op populariteit</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar tillgångstaggar färgade efter popularitet: röd (hög), gul (medelhög) och grön (låg).</Description><Description language-id=\"pt_BR\">Exibe marcadores coloridos por popularidade: vermelho (alta), amarelo (média) e verde (baixa).</Description><Description language-id=\"ja_JP\">アセットタグを人気順に表示する:赤(高い)、黄色（普通)、緑（低い）</Description><Description language-id=\"fr_FR\">Affiche les étiquettes d\'asset coloriées par popularité: rouge (élevé), jaune (moyen), et vert (bas).</Description><Description language-id=\"hu_HU\">Megjeleníti a tartalom címkéket népszerűség szerint színezve: vörös (magas), sárga (közepes), és zöld (alacsony).</Description><Description language-id=\"de_DE\">Schlagwörter nach Popularität färben: Rot (hoch), gelb (mittel), grün (niedrig).</Description><Description language-id=\"ca_ES\">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id=\"ar_SA\">يعرض علامات الأصول الملونة حسب الأولوية: الأحمر (مرتفع) والأصفر (متوسط) والأخضر (منخفض).</Description><Description language-id=\"fi_FI\">Näyttää sisältötageja, mitkä on väritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virheä (alhainen)</Description><Description language-id=\"en_US\">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description><Description language-id=\"zh_CN\">显示资源标签颜色等级： 红色 (高), 黄色 (中), 绿色 (低).</Description><Description language-id=\"es_ES\">Muestra las etiquetas de contenido coloreadas según su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id=\"nl_NL\">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description></root>', 'ftl', '<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n			scopedAssetCounts = assetTagsNavigationDisplayContext.getScopedAssetCounts()\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#if scopedAssetCounts??>\n				<#assign assetCount = scopedAssetCounts[entry.getName()] />\n			<#else>\n				<#assign assetCount = entry.getAssetCount() />\n			</#if>\n\n			<#if (assetCount > 0) || getterUtil.getBoolean(showZeroAssetCount)>\n				<#assign\n					maxCount = liferay.max(maxCount, assetCount)\n					minCount = liferay.min(minCount, assetCount)\n				/>\n			</#if>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<#if scopedAssetCounts??>\n				<#assign assetCount = scopedAssetCounts[entry.getName()] />\n			<#else>\n				<#assign assetCount = entry.getAssetCount() />\n			</#if>\n\n			<#if (assetCount > 0) || getterUtil.getBoolean(showZeroAssetCount)>\n				<li class=\"taglib-asset-tags-summary\">\n					<#assign popularity = (maxCount - (maxCount - (assetCount - minCount))) * multiplier />\n\n					<#if popularity < 1>\n						<#assign displayType = \"success\" />\n					<#elseif (popularity >= 1) && (popularity < 2)>\n						<#assign displayType = \"warning\" />\n					<#else>\n						<#assign displayType = \"danger\" />\n					</#if>\n\n					<#assign tagURL = renderResponse.createRenderURL() />\n\n					${tagURL.setParameter(\"resetCur\", \"true\")}\n					${tagURL.setParameter(\"tag\", entry.getName())}\n\n					<a class=\"label label-${displayType} tag\" href=\"${tagURL}\">\n						<span class=\"label-item label-item-expand\">${entry.getName()}</span>\n\n						<#if assetCount?? && getterUtil.getBoolean(showAssetCount)>\n							<span class=\"label-item label-item-after tag-asset-count\">(${assetCount})</span>\n						</#if>\n					</a>\n				</li>\n			</#if>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>', 0, 20103, NULL, '2022-07-05 09:10:30.552000'),
(0, 0, 29049, 20125, 20099, 20103, NULL, '2022-07-05 09:10:30.579000', 23802, 0, 29047, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Sociala nätverk</Name><Name language-id=\"pt_BR\">Social</Name><Name language-id=\"ja_JP\">ソーシャル</Name><Name language-id=\"fr_FR\">Social</Name><Name language-id=\"hu_HU\">Közösségi</Name><Name language-id=\"de_DE\">Gemeinschaft</Name><Name language-id=\"ca_ES\">Social</Name><Name language-id=\"ar_SA\">اجتماعي</Name><Name language-id=\"fi_FI\">Sosiaalinen</Name><Name language-id=\"en_US\">Social</Name><Name language-id=\"zh_CN\">社交</Name><Name language-id=\"es_ES\">Social</Name><Name language-id=\"nl_NL\">Sociaal</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar sociala bokmärken och omdömen för wiki-sidor och deras underordnade sidor.</Description><Description language-id=\"pt_BR\">Exibe marcadores sociais e avaliações para páginas da wiki e suas páginas filhas.</Description><Description language-id=\"ja_JP\">Wikiページとそのサブページ用のソーシャルブックマークと評価を表示する</Description><Description language-id=\"fr_FR\">Affiche les signets sociaux and les notations pour page wiki et leur pages enfants.</Description><Description language-id=\"hu_HU\">Megjeleníti a közösségi könyvjelzőket és értékeléseket a wiki oldalak és gyermek oldalaik részére.</Description><Description language-id=\"de_DE\">Darstellung für Social Bookmarks und Bewertungen von Wikiseiten und deren Unterseiten.</Description><Description language-id=\"ca_ES\">Mostra adreces d\'interès socials i classificacions per a planes del wiki.</Description><Description language-id=\"ar_SA\">يعرض إشارات مرجعية اجتماعية وتقييمات لصفحات ويكي وصفحاتها الفرعية.</Description><Description language-id=\"fi_FI\">Näyttää sosiaaliset kirjanmerkit ja arvostelut wikisivuilla ja niiden alisivuilla.</Description><Description language-id=\"en_US\">Displays social bookmarks and ratings for wiki pages and their child pages.</Description><Description language-id=\"zh_CN\">显示社交书签和维基页的评分和它们的子页。</Description><Description language-id=\"es_ES\">Muestra los marcadores sociales y las clasificaciones para páginas wiki y sus páginas secundarias.</Description><Description language-id=\"nl_NL\">Geeft sociale favorieten en waarderingen van wikipagina\'s en onderliggende wikipagina\'s weer.</Description></root>', 'ftl', '<#assign\n	wikiPageClassName = \"com.liferay.wiki.model.WikiPage\"\n\n	assetRenderer = assetEntry.getAssetRenderer()\n/>\n\n<div class=\"taglib-header\">\n	<h1 class=\"header-title\">${entry.getTitle()}</h1>\n</div>\n\n<div style=\"float: right;\">\n	<@getEditIcon />\n\n	<@getPageDetailsIcon />\n\n	<@getPrintIcon />\n</div>\n\n<div class=\"wiki-body\">\n	<div class=\"wiki-info\">\n		<span class=\"stats\">${assetEntry.getViewCount()} <@liferay.language key=\"views\" /></span> |\n\n		<span class=\"date\"><@liferay.language key=\"last-modified\" /> ${dateUtil.getDate(entry.getModifiedDate(), \"dd MMM yyyy - HH:mm:ss\", locale)}</span>\n\n		<span class=\"author\"><@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(entry.getUserId(), entry.getUserName()))}</span>\n	</div>\n\n	<div class=\"wiki-content\">\n		<@liferay_social_bookmarks[\"bookmarks\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			displayStyle=\"normal\"\n			target=\"_blank\"\n			title=entry.getTitle()\n			url=viewURL\n		/>\n\n		${formattedContent}\n	</div>\n\n	<div class=\"page-actions\">\n		<div class=\"article-actions\">\n			<@getAddChildPageIcon />\n\n			<@getAttatchmentsIcon />\n		</div>\n	</div>\n\n	<br />\n\n	<@getRatings\n		cssClass=\"page-ratings\"\n		entry=entry\n	/>\n\n	<@getRelatedAssets />\n</div>\n\n<div class=\"page-categorization\">\n	<div class=\"page-categories\">\n		<#assign viewCategorizedPagesURL = renderResponse.createRenderURL() />\n\n		${viewCategorizedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_categorized_pages\")}\n		${viewCategorizedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_asset[\"asset-categories-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewCategorizedPagesURL\n		/>\n	</div>\n\n	<div class=\"page-tags\">\n		<#assign viewTaggedPagesURL = renderResponse.createRenderURL() />\n\n		${viewTaggedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_tagged_pages\")}\n		${viewTaggedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_asset[\"asset-tags-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewTaggedPagesURL\n		/>\n	</div>\n</div>\n\n<#assign childPages = entry.getChildPages() />\n\n<#if (childPages?has_content)>\n	<div class=\"child-pages\">\n		<h2><@liferay.language key=\"children-pages\" /></h2>\n\n		<table class=\"taglib-search-iterator\">\n			<tr class=\"portlet-section-header results-header\">\n				<th>\n					<@liferay.language key=\"page\" />\n				</th>\n				<th>\n					<@liferay.language key=\"last-modified\" />\n				</th>\n				<th>\n					<@liferay.language key=\"ratings\" />\n				</th>\n			</tr>\n\n			<#list childPages as childPage>\n				<tr class=\"results-row\">\n					<#assign viewPageURL = renderResponse.createRenderURL() />\n\n					${viewPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view\")}\n\n					<#assign childNode = childPage.getNode() />\n\n					${viewPageURL.setParameter(\"nodeName\", childNode.getName())}\n					${viewPageURL.setParameter(\"title\", childPage.getTitle())}\n\n					<td>\n						<a href=\"${viewPageURL}\">${childPage.getTitle()}</a>\n					</td>\n					<td>\n						<a href=\"${viewPageURL}\">${dateUtil.getDate(childPage.getModifiedDate(),\"dd MMM yyyy - HH:mm:ss\", locale)} <@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(childPage.getUserId(), childPage.getUserName()))}</a>\n					</td>\n					<td>\n						<@getRatings\n							cssClass=\"child-ratings\"\n							entry=childPage\n						/>\n					</td>\n				</tr>\n			</#list>\n		</table>\n	</div>\n</#if>\n\n<@getDiscussion />\n\n<#macro getAddChildPageIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign addPageURL = renderResponse.createRenderURL() />\n\n		${addPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${addPageURL.setParameter(\"redirect\", currentURL)}\n		${addPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${addPageURL.setParameter(\"title\", \"\")}\n		${addPageURL.setParameter(\"editTitle\", \"1\")}\n		${addPageURL.setParameter(\"parentTitle\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			icon=\"plus\"\n			label=true\n			markupView=\"lexicon\"\n			message=\"add-child-page\"\n			url=addPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getAttatchmentsIcon>\n	<#assign viewPageAttachmentsURL = renderResponse.createRenderURL() />\n\n	${viewPageAttachmentsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_attachments\") }\n\n	<@liferay_ui[\"icon\"]\n		icon=\"paperclip\"\n		label=true\n		markupView=\"lexicon\"\n		message=\'${entry.getAttachmentsFileEntriesCount() + languageUtil.get(locale, \"attachments\")}\'\n		url=viewPageAttachmentsURL?string\n	/>\n</#macro>\n\n<#macro getDiscussion>\n	<#if validator.isNotNull(assetRenderer.getDiscussionPath()) && wikiPortletInstanceConfiguration.enableComments()>\n		<br />\n\n		<@liferay_comment[\"discussion\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			ratingsEnabled=wikiPortletInstanceConfiguration.enableCommentRatings()\n			redirect=currentURL\n			subject=assetRenderer.getTitle(locale)\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign editPageURL = renderResponse.createRenderURL() />\n\n		${editPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${editPageURL.setParameter(\"redirect\", currentURL)}\n		${editPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${editPageURL.setParameter(\"title\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			icon=\"pencil\"\n			markupView=\"lexicon\"\n			message=entry.getTitle()\n			url=editPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getPageDetailsIcon>\n	<#assign viewPageDetailsURL = renderResponse.createRenderURL() />\n\n	${viewPageDetailsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_details\")}\n	${viewPageDetailsURL.setParameter(\"redirect\", currentURL)}\n\n	<@liferay_ui[\"icon\"]\n		icon=\"document\"\n		markupView=\"lexicon\"\n		message=\"details\"\n		url=viewPageDetailsURL?string\n	/>\n</#macro>\n\n<#macro getPrintIcon>\n	<#assign printURL = renderResponse.createRenderURL() />\n\n	${printURL.setParameter(\"viewMode\", \"print\")}\n	${printURL.setWindowState(\"pop_up\")}\n\n	<#assign\n		title = languageUtil.format(locale, \"print-x-x\", [\"hide-accessible\", htmlUtil.escape(assetRenderer.getTitle(locale))], false)\n		taglibPrintURL = \"javascript:Liferay.Util.openWindow({dialog: {width: 960}, id:\'\" + renderResponse.getNamespace() + \"printAsset\', title: \'\" + title + \"\', uri: \'\" + htmlUtil.escapeURL(printURL.toString()) + \"\'});\"\n	/>\n\n	<@liferay_ui[\"icon\"]\n		icon=\"print\"\n		markupView=\"lexicon\"\n		message=\"print\"\n		url=taglibPrintURL\n	/>\n</#macro>\n\n<#macro getRatings\n	cssClass\n	entry\n>\n	<#if wikiPortletInstanceConfiguration.enablePageRatings()>\n		<div class=\"${cssClass}\">\n			<@liferay_ratings[\"ratings\"]\n				className=wikiPageClassName\n				classPK=entry.getResourcePrimKey()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if assetEntry?? && wikiPortletInstanceConfiguration.enableRelatedAssets()>\n		<@liferay_asset[\"asset-links\"] assetEntryId=assetEntry.getEntryId() />\n	</#if>\n</#macro>', 0, 20103, NULL, '2022-07-05 09:10:30.579000'),
(0, 0, 29052, 20125, 20099, 20103, NULL, '2022-07-05 09:10:36.624000', 26853, 0, 29050, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Básico</Name><Name language-id=\"ja_JP\">通常の検索に戻る</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszerű</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"ca_ES\">Bàsic</Name><Name language-id=\"ar_SA\">أساسي</Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"en_US\">Basic</Name><Name language-id=\"zh_CN\">基本的</Name><Name language-id=\"es_ES\">Básico</Name><Name language-id=\"nl_NL\">Basis</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"ja_JP\">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id=\"hu_HU\">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>', 'ftl', '<div class=\"widget-mode-simple\">\n	<#if entries?has_content>\n		<#list entries as curBlogEntry>\n			<div class=\"widget-mode-simple-entry\">\n				<div class=\"autofit-row widget-topbar\">\n					<div class=\"autofit-col autofit-col-expand\">\n						<#assign viewEntryPortletURL = renderResponse.createRenderURL() />\n\n						${viewEntryPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n						${viewEntryPortletURL.setParameter(\"redirect\", currentURL)}\n\n						<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n							${viewEntryPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n						<#else>\n							${viewEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n						</#if>\n\n						<h3 class=\"title\">\n							<a class=\"title-link\" href=\"${viewEntryPortletURL.toString()}\">${htmlUtil.escape(blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry))}</a>\n						</h3>\n					</div>\n\n					<div class=\"autofit-col\">\n						<@clay[\"dropdown-actions\"]\n							additionalProps=blogsEntryActionDropdownAdditionalProps\n							dropdownItems=blogsEntryActionDropdownItemsProvider.getActionDropdownItems(curBlogEntry)\n							propsTransformer=\"blogs_admin/js/ElementsPropsTransformer\"\n							propsTransformerServletContext=blogsEntryActionDropdownPropsTransformerServletContext\n						/>\n					</div>\n				</div>\n\n				<div class=\"autofit-row widget-metadata\">\n					<div class=\"autofit-col inline-item-before\">\n						<@liferay_ui[\"user-portrait\"]\n							userId=curBlogEntry.userId\n							userName=curBlogEntry.userName\n						/>\n					</div>\n\n					<div class=\"autofit-col autofit-col-expand\">\n						<div class=\"autofit-row\">\n							<div class=\"autofit-col autofit-col-expand\">\n								<#if serviceLocator??>\n									<#assign\n										userLocalService = serviceLocator.findService(\"com.liferay.portal.kernel.service.UserLocalService\")\n\n										entryUser = userLocalService.fetchUser(curBlogEntry.getUserId())\n									/>\n\n									<#if entryUser?? && !entryUser.isDefaultUser()>\n										<#assign entryUserURL = entryUser.getDisplayURL(themeDisplay) />\n									</#if>\n								</#if>\n\n								<div class=\"text-truncate-inline\">\n									<a href=\"${(entryUserURL?? && validator.isNotNull(entryUserURL))?then(entryUserURL, \"\")}\" class=\"text-truncate username\">${curBlogEntry.getUserName()}</a>\n								</div>\n\n								<div>\n									${dateUtil.getDate(curBlogEntry.getStatusDate(), \"dd MMM\", locale)}\n\n									<#if blogsPortletInstanceConfiguration.enableReadingTime()>\n										- <@liferay_reading_time[\"reading-time\"] displayStyle=\"simple\" model=curBlogEntry />\n									</#if>\n\n									<#assign assetEntry = blogsEntryAssetEntryUtil.getAssetEntry(request, curBlogEntry) />\n\n									<#if blogsPortletInstanceConfiguration.enableViewCount()>\n										- <@liferay_ui[\"message\"] arguments=assetEntry.getViewCount() key=(assetEntry.getViewCount()==0)?then(\"x-view\", \"x-views\") />\n									</#if>\n								</div>\n							</div>\n						</div>\n					</div>\n				</div>\n\n				<div class=\"widget-content\">\n					<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(curBlogEntry.getContent()), 400)}</p>\n\n					<div class=\"autofit-float autofit-row autofit-row-center widget-toolbar\">\n						<#if blogsPortletInstanceConfiguration.enableComments()>\n							<div class=\"autofit-col\">\n								<#assign viewCommentsPortletURL = renderResponse.createRenderURL() />\n\n								${viewCommentsPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n								${viewCommentsPortletURL.setParameter(\"scroll\", renderResponse.getNamespace() + \"discussionContainer\")}\n\n								<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n									${viewCommentsPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n								<#else>\n									${viewCommentsPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n								</#if>\n\n								<a class=\"btn btn-outline-borderless btn-outline-secondary btn-sm\" href=\"${viewCommentsPortletURL.toString()}\" title=\"${language.get(locale, \"comments\")}\">\n									<span class=\"inline-item inline-item-before\">\n										<@clay[\"icon\"] symbol=\"comments\" />\n									</span> ${commentManager.getCommentsCount(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())}\n								</a>\n							</div>\n						</#if>\n\n						<#if blogsPortletInstanceConfiguration.enableRatings()>\n							<div class=\"autofit-col\">\n								<@liferay_ratings[\"ratings\"]\n									className=\"com.liferay.blogs.model.BlogsEntry\"\n									classPK=curBlogEntry.getEntryId()\n								/>\n							</div>\n						</#if>\n\n						<div class=\"autofit-col autofit-col-end\">\n							<#assign bookmarkURL = renderResponse.createRenderURL() />\n\n							${bookmarkURL.setWindowState(windowStateFactory.getWindowState(\"NORMAL\"))}\n							${bookmarkURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n\n							<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n								${bookmarkURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n							<#else>\n								${bookmarkURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n							</#if>\n\n							<@liferay_social_bookmarks[\"bookmarks\"]\n								className=\"com.liferay.blogs.model.BlogsEntry\"\n								classPK=curBlogEntry.getEntryId()\n								displayStyle=\"inline\"\n								target=\"_blank\"\n								title=blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry)\n								types=blogsPortletInstanceConfiguration.socialBookmarksTypes()\n								url=portalUtil.getCanonicalURL(bookmarkURL.toString(), themeDisplay, themeDisplay.getLayout())\n							/>\n						</div>\n					</div>\n				</div>\n			</div>\n		</#list>\n	</#if>\n</div>', 0, 20103, NULL, '2022-07-05 09:10:36.624000'),
(0, 0, 29055, 20125, 20099, 20103, NULL, '2022-07-05 09:10:36.664000', 26853, 0, 29053, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kort</Name><Name language-id=\"pt_BR\">Cartão</Name><Name language-id=\"ja_JP\">カード</Name><Name language-id=\"fr_FR\">Carte</Name><Name language-id=\"hu_HU\">Kártya</Name><Name language-id=\"de_DE\">Karte</Name><Name language-id=\"ca_ES\">Targeta</Name><Name language-id=\"ar_SA\">البطاقة</Name><Name language-id=\"fi_FI\">Kortti</Name><Name language-id=\"en_US\">Card</Name><Name language-id=\"zh_CN\">卡片</Name><Name language-id=\"es_ES\">Tarjeta</Name><Name language-id=\"nl_NL\">Kaart</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa omslagsbilder, rubriker, författare och sammanfattningar genom att använda kort för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibir imagens da cobertura, títulos, autores e resumos usando cartões para entradas do blog.</Description><Description language-id=\"ja_JP\">ブログ エントリを表紙の画像、タイトル、著者と要約をカード形式で表示します</Description><Description language-id=\"fr_FR\">Afficher dans les entrées de blog les images de couvertures, les titres, les auteurs et les résumés en utilisant des cartes.</Description><Description language-id=\"hu_HU\">Borítóképek, címek, szerzők és absztraktok megjelenítése blogbejegyzések kártyái segítségével.</Description><Description language-id=\"de_DE\">Zeigen Sie Coverbilder, Titel, Autoren und Kurzfassungen mit Karten für Blog-Einträge an.</Description><Description language-id=\"ca_ES\">Mostra imatges de portada, títols, autors i resums amb targetes per a les entrades del blog.</Description><Description language-id=\"ar_SA\">اعرض صور الأغلفة والعناوين والمؤلفين والملخصات باستخدام البطاقات الخاصة بإدخالات المدونات.</Description><Description language-id=\"fi_FI\">Näyttö kattaa kuvat, otsikot, tekijät ja abstraktit käyttäen kortteja blogientryille.</Description><Description language-id=\"en_US\">Display cover images, titles, authors and abstracts using cards for blog entries.</Description><Description language-id=\"zh_CN\">使用卡片为博客条目显示封面、标题、作者和摘要。</Description><Description language-id=\"es_ES\">Muestra imágenes de portada, títulos, autores y abstractos con tarjetas de entradas de blog.</Description><Description language-id=\"nl_NL\">Toon cover-afbeeldingen, titels, auteurs en samenvattingen m. b. v. kaarten voor blogberichten.</Description></root>', 'ftl', '<div class=\"row widget-mode-card\">\n	<ul class=\"card-page\">\n		<#if entries?has_content>\n			<#list entries as curBlogEntry>\n				<#if curBlogEntry.getCoverImageURL(themeDisplay)??>\n					<#assign cardImage = true />\n				<#else>\n					<#assign cardImage = false />\n				</#if>\n\n				<li class=\"card-page-item card-page-item-asset\">\n					<div class=\"card\">\n						<div class=\"aspect-ratio aspect-ratio-8-to-3 card-item-first\">\n								<img alt=\"thumbnail\" class=\"aspect-ratio-item-center-middle aspect-ratio-item-fluid\" src=\"${cardImage?then(curBlogEntry.getCoverImageURL(themeDisplay), portalUtil.getPathContext(renderRequest) + \"/images/cover_image_placeholder.jpg\")}\">\n						</div>\n\n						<div class=\"card-body widget-topbar\">\n							<div class=\"autofit-row card-title\">\n									<div class=\"autofit-col autofit-col-expand\">\n										<#assign viewEntryPortletURL = renderResponse.createRenderURL() />\n\n										${viewEntryPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n										${viewEntryPortletURL.setParameter(\"redirect\", currentURL)}\n\n										<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n											${viewEntryPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n										<#else>\n											${viewEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n										</#if>\n\n										<h3 class=\"title\">\n											<a class=\"title-link\" href=\"${viewEntryPortletURL.toString()}\">\n											${htmlUtil.escape(blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry))}</a>\n										</h3>\n									</div>\n\n									<div class=\"autofit-col\">\n										<@clay[\"dropdown-actions\"]\n											additionalProps=blogsEntryActionDropdownAdditionalProps\n											dropdownItems=blogsEntryActionDropdownItemsProvider.getActionDropdownItems(curBlogEntry)\n											propsTransformer=\"blogs_admin/js/ElementsPropsTransformer\"\n											propsTransformerServletContext=blogsEntryActionDropdownPropsTransformerServletContext\n										/>\n									</div>\n							</div>\n\n							<div class=\"autofit-row widget-metadata\">\n								<div class=\"autofit-col inline-item-before\">\n									<@liferay_ui[\"user-portrait\"]\n										size=\"lg\"\n										userId=curBlogEntry.userId\n										userName=curBlogEntry.userName\n									/>\n								</div>\n\n								<div class=\"autofit-col autofit-col-expand\">\n									<div class=\"autofit-row\">\n										<div class=\"autofit-col autofit-col-expand\">\n											<#if serviceLocator??>\n												<#assign\n													userLocalService = serviceLocator.findService(\"com.liferay.portal.kernel.service.UserLocalService\")\n\n													entryUser = userLocalService.fetchUser(curBlogEntry.getUserId())\n												/>\n\n												<#if entryUser?? && !entryUser.isDefaultUser()>\n													<#assign entryUserURL = entryUser.getDisplayURL(themeDisplay) />\n												</#if>\n											</#if>\n\n											<div class=\"text-truncate-inline\">\n												<a href=\"${(entryUserURL?? && validator.isNotNull(entryUserURL))?then(entryUserURL, \"\")}\" class=\"text-truncate username\">${curBlogEntry.getUserName()}</a>\n											</div>\n\n											<div>\n												${dateUtil.getDate(curBlogEntry.getStatusDate(), \"dd MMM\", locale)}\n\n												<#if blogsPortletInstanceConfiguration.enableReadingTime()>\n													- <@liferay_reading_time[\"reading-time\"] displayStyle=\"simple\" model=curBlogEntry />\n												</#if>\n\n												<#assign assetEntry = blogsEntryAssetEntryUtil.getAssetEntry(request, curBlogEntry) />\n\n												<#if blogsPortletInstanceConfiguration.enableViewCount()>\n													- <@liferay_ui[\"message\"] arguments=assetEntry.getViewCount() key=(assetEntry.getViewCount()==0)?then(\"x-view\", \"x-views\") />\n												</#if>\n											</div>\n										</div>\n									</div>\n								</div>\n							</div>\n\n							<#if validator.isNotNull(curBlogEntry.getDescription())>\n								<#assign content = curBlogEntry.getDescription() />\n							<#else>\n								<#assign content = curBlogEntry.getContent() />\n							</#if>\n\n							<#if cardImage>\n								<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(content), 150)}</p>\n							<#else>\n								<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(content), 400)}</p>\n							</#if>\n						</div>\n\n						<div class=\"card-footer\">\n							<div class=\"autofit-float autofit-row autofit-row-center widget-toolbar\">\n								<#if blogsPortletInstanceConfiguration.enableComments()>\n									<div class=\"autofit-col\">\n										<#assign viewCommentsPortletURL = renderResponse.createRenderURL() />\n\n										${viewCommentsPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n										${viewCommentsPortletURL.setParameter(\"scroll\", renderResponse.getNamespace() + \"discussionContainer\")}\n\n										<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n											${viewCommentsPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n										<#else>\n											${viewCommentsPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n										</#if>\n\n										<a class=\"btn btn-outline-borderless btn-outline-secondary btn-sm\" href=\"${viewCommentsPortletURL.toString()}\" title=\"${language.get(locale, \"comments\")}\">\n											<span class=\"inline-item inline-item-before\">\n												<@clay[\"icon\"] symbol=\"comments\" />\n											</span> ${commentManager.getCommentsCount(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())}\n										</a>\n									</div>\n								</#if>\n\n								<#if blogsPortletInstanceConfiguration.enableRatings()>\n									<div class=\"autofit-col\">\n										<@liferay_ratings[\"ratings\"]\n											className=\"com.liferay.blogs.model.BlogsEntry\"\n											classPK=curBlogEntry.getEntryId()\n										/>\n									</div>\n								</#if>\n\n								<div class=\"autofit-col autofit-col-end\">\n									<#assign bookmarkURL = renderResponse.createRenderURL() />\n\n									${bookmarkURL.setWindowState(windowStateFactory.getWindowState(\"NORMAL\"))}\n									${bookmarkURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n\n									<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n										${bookmarkURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n									<#else>\n										${bookmarkURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n									</#if>\n\n									<@liferay_social_bookmarks[\"bookmarks\"]\n										className=\"com.liferay.blogs.model.BlogsEntry\"\n										classPK=curBlogEntry.getEntryId()\n										maxInlineItems=0\n										target=\"_blank\"\n										title=blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry)\n										types=blogsPortletInstanceConfiguration.socialBookmarksTypes()\n										url=portalUtil.getCanonicalURL(bookmarkURL.toString(), themeDisplay, themeDisplay.getLayout())\n									/>\n								</div>\n							</div>\n						</div>\n					</div>\n				</li>\n			</#list>\n		</#if>\n	</ul>\n</div>', 0, 20103, NULL, '2022-07-05 09:10:36.664000'),
(0, 0, 29103, 20125, 20099, 20103, NULL, '2022-07-05 09:10:39.169000', 20017, 0, 29101, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kartor</Name><Name language-id=\"pt_BR\">Mapa</Name><Name language-id=\"ja_JP\">マッピング</Name><Name language-id=\"fr_FR\">Carte</Name><Name language-id=\"hu_HU\">Térkép</Name><Name language-id=\"de_DE\">Landkarte</Name><Name language-id=\"ca_ES\">Mapa</Name><Name language-id=\"ar_SA\">الخريطه</Name><Name language-id=\"fi_FI\">Kartta</Name><Name language-id=\"en_US\">Map</Name><Name language-id=\"zh_CN\">映射</Name><Name language-id=\"es_ES\">Mapa</Name><Name language-id=\"nl_NL\">Kaart</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar geolokaliserade tillgångar på en karta.</Description><Description language-id=\"pt_BR\">Exibe os conteúdos geolocalizados em um mapa.</Description><Description language-id=\"ja_JP\">地図内にジオローカライズされたアセットを表示する</Description><Description language-id=\"fr_FR\">Affiche les assets géolocalisés dans un plan</Description><Description language-id=\"hu_HU\">Megjeleníti a földrajzi tartalmakat egy térképen.</Description><Description language-id=\"de_DE\">Stellt Assets mit geografischen Informationen in einer Karte dar.</Description><Description language-id=\"ca_ES\">Mostra contingut geolocalitzat en un mapa.</Description><Description language-id=\"ar_SA\">يعرض الأصول الجيوجغرافية في خريطة.</Description><Description language-id=\"fi_FI\">Näyttää maantieteelliset sisällöt kartalla.</Description><Description language-id=\"en_US\">Displays geolocalized assets in a map.</Description><Description language-id=\"zh_CN\">显示在地图上定位的资源</Description><Description language-id=\"es_ES\">Muestra activos geolocalizados en un mapa.</Description><Description language-id=\"nl_NL\">Toon geolocale content op een kaart.</Description></root>', 'ftl', '<#assign\n	group = themeDisplay.getScopeGroup()\n\n	mapsAPIProvider = group.getLiveParentTypeSettingsProperty(\"mapsAPIProvider\")!\"\"\n\n	companyPortletPreferences = prefsPropsUtil.getPreferences(companyId)\n/>\n\n<#if validator.isNull(mapsAPIProvider)>\n	<#assign mapsAPIProvider = companyPortletPreferences.getValue(\"mapsAPIProvider\", \"Google\") />\n</#if>\n\n<#assign featureCollectionJSONObject = jsonFactoryUtil.createJSONObject() />\n\n<@liferay.silently featureCollectionJSONObject.put(\"type\", \"FeatureCollection\") />\n\n<#assign featureJSONArray = jsonFactoryUtil.createJSONArray() />\n\n<#list entries as entry>\n	<#assign\n		assetRenderer = entry.getAssetRenderer()\n\n		ddmFormValuesReader = assetRenderer.getDDMFormValuesReader()\n\n		ddmFormFieldValues = ddmFormValuesReader.getDDMFormFieldValues(\"geolocation\")\n\n		coordinatesJSONObjects = []\n	/>\n\n	<#list ddmFormFieldValues as ddmFormFieldValue>\n		<#assign\n			value = ddmFormFieldValue.getValue()\n\n			coordinatesJSONObject = jsonFactoryUtil.createJSONObject(value.getString(locale))\n\n			coordinatesJSONObjects = coordinatesJSONObjects + [coordinatesJSONObject]\n		/>\n	</#list>\n\n	<#list coordinatesJSONObjects as coordinatesJSONObject>\n		<#assign featureJSONObject = jsonFactoryUtil.createJSONObject() />\n\n		<@liferay.silently featureJSONObject.put(\"type\", \"Feature\") />\n\n		<#assign geometryJSONObject = jsonFactoryUtil.createJSONObject() />\n\n		<@liferay.silently geometryJSONObject.put(\"type\", \"Point\") />\n\n		<#assign coordinatesJSONArray = [coordinatesJSONObject.getDouble(\"lng\"), coordinatesJSONObject.getDouble(\"lat\")] />\n\n		<@liferay.silently geometryJSONObject.put(\"coordinates\", coordinatesJSONArray) />\n\n		<@liferay.silently featureJSONObject.put(\"geometry\", geometryJSONObject) />\n\n		<#assign propertiesJSONObject = jsonFactoryUtil.createJSONObject() />\n\n		<@liferay.silently propertiesJSONObject.put(\"title\", assetRenderer.getTitle(locale)) />\n\n		<#assign entryAbstract>\n			<@getAbstract asset=entry />\n		</#assign>\n\n		<@liferay.silently propertiesJSONObject.put(\"abstract\", entryAbstract) />\n\n		<#if stringUtil.equals(mapsAPIProvider, \"Google\")>\n			<#assign\n				images = {\n					\"com.liferay.document.library.kernel.model.DLFileEntry\": \"${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/green-dot.png\",\n					\"com.liferay.portlet.dynamicdatalists.model.DDLRecord\": \"${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/red-dot.png\",\n					\"com.liferay.journal.model.JournalArticle\": \"${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/blue-dot.png\",\n					\"default\": \"${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/yellow-dot.png\"\n				}\n			/>\n\n			<#if images?keys?seq_contains(entry.getClassName())>\n				<@liferay.silently propertiesJSONObject.put(\"icon\", images[entry.getClassName()]) />\n			<#else>\n				<@liferay.silently propertiesJSONObject.put(\"icon\", images[\"default\"]) />\n			</#if>\n		</#if>\n\n		<@liferay.silently featureJSONObject.put(\"properties\", propertiesJSONObject) />\n\n		<@liferay.silently featureJSONArray.put(featureJSONObject) />\n	</#list>\n</#list>\n\n<@liferay.silently featureCollectionJSONObject.put(\"features\", featureJSONArray) />\n\n<style type=\"text/css\">\n	.asset-entry-abstract {\n		min-width: 400px;\n	}\n\n	.leaflet-popup .asset-entry-abstract {\n		display: inline-block;\n	}\n\n	.asset-entry-abstract .asset-entry-abstract-image {\n		display: block;\n		float: left;\n		height: 128px;\n		margin-right: 1em;\n		text-align: center;\n	}\n\n	.asset-entry-abstract .asset-entry-abstract-image img {\n		display: block;\n		margin: 0 auto;\n		max-height: 100%;\n	}\n\n	.asset-entry-abstract .taglib-icon {\n		float: right;\n	}\n</style>\n\n<@liferay_map[\"map-display\"]\n	name=\'Map\'\n	points=\"${featureCollectionJSONObject}\"\n/>\n\n<@liferay_aui.script use=\"liferay-map-base\">\n	Liferay.componentReady(\'<@portlet.namespace />Map\').then(\n		function(map) {\n			map.on(\n				\'featureClick\',\n				function(event) {\n					var feature = event.feature;\n\n					map.openDialog(\n						{\n							content: feature.getProperty(\'abstract\'),\n							marker: feature.getMarker(),\n							position: feature.getGeometry().get(\'location\')\n						}\n					);\n				}\n			);\n		}\n	);\n</@liferay_aui.script>\n\n<#macro getAbstract asset>\n	<div class=\"asset-entry-abstract\" id=\"<@portlet.namespace />assetEntryAbstract\">\n		<#assign\n			showEditURL = paramUtil.getBoolean(renderRequest, \"showEditURL\", true)\n\n			assetRenderer = asset.getAssetRenderer()\n		/>\n\n		<#if showEditURL && assetRenderer.hasEditPermission(permissionChecker)>\n			<#assign\n				editPortletURL = assetRenderer.getURLEdit(renderRequest, renderResponse, windowStateFactory.getWindowState(\"NORMAL\"), themeDisplay.getURLCurrent())\n			/>\n\n			<@liferay_ui.icon\n				image=\"edit\"\n				label=true\n				message=\"edit\"\n				url=editPortletURL.toString()\n			/>\n		</#if>\n\n		<#if assetRenderer.getThumbnailPath(renderRequest)??>\n			<div class=\"asset-entry-abstract-image\">\n				<img src=\"${assetRenderer.getThumbnailPath(renderRequest)}\" />\n			</div>\n		</#if>\n\n		<#assign assetURL = assetPublisherHelper.getAssetViewURL(renderRequest, renderResponse, assetRenderer, asset, !stringUtil.equals(assetLinkBehavior, \"showFullContent\")) />\n\n		<div class=\"asset-entry-abstract-content\">\n			<h3><a href=\"${assetURL}\">${assetRenderer.getTitle(locale)}</a></h3>\n\n			<div>\n				${assetRenderer.getSummary(renderRequest, renderResponse)}\n			</div>\n		</div>\n\n		<div class=\"asset-entry-abstract-footer\">\n			<a href=\"${assetURL}\">${languageUtil.get(locale, \"read-more\")} &raquo;</a>\n		</div>\n	</div>\n</#macro>', 0, 20103, NULL, '2022-07-05 09:10:39.169000');
INSERT INTO `ddmtemplateversion` (`mvccVersion`, `ctCollectionId`, `templateVersionId`, `groupId`, `companyId`, `userId`, `userName`, `createDate`, `classNameId`, `classPK`, `templateId`, `version`, `name`, `description`, `language`, `script`, `status`, `statusByUserId`, `statusByUserName`, `statusDate`) VALUES
(0, 0, 29106, 20125, 20099, 20103, NULL, '2022-07-05 09:10:39.234000', 20017, 0, 29104, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Utförlig sammanfattning</Name><Name language-id=\"pt_BR\">Sumário Rico</Name><Name language-id=\"ja_JP\">要約（文字数多め）</Name><Name language-id=\"fr_FR\">Sommaire enrichi</Name><Name language-id=\"hu_HU\">Bő összesítő</Name><Name language-id=\"de_DE\">Rich-Text-Zusammenfassung</Name><Name language-id=\"ca_ES\">Resum enriquit</Name><Name language-id=\"ar_SA\">ملخص غني</Name><Name language-id=\"fi_FI\">Muotoiltu yhteenveto</Name><Name language-id=\"en_US\">Rich Summary</Name><Name language-id=\"zh_CN\">丰富总结</Name><Name language-id=\"es_ES\">Resumen completo</Name><Name language-id=\"nl_NL\">Rijke samenvatting</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar sammanfattningar, ikoner, liknande tillgångar samt utskrifts- och redigeringsåtgärder för tillgångar. Valfritt inkluderar bokmärken och omdömen för tillgångar.</Description><Description language-id=\"pt_BR\">Exibe abstracts, ícones, conteúdos relacionados e ações de imprimir/editar para os conteúdos. Opcionalmente, inclui marcadores e classificações de conteúdos.</Description><Description language-id=\"ja_JP\">概要、アイコン、関連するアセット、アセットの印刷/編集を表示する。アセットのブックマークと評価も設定できます</Description><Description language-id=\"fr_FR\">Affiche les résumés, icons, les assets relatifs, et les actions imprimer/éditer pour les assets. Facultativement inclut les signets et les notations d\'assets.</Description><Description language-id=\"hu_HU\">Megjeleníti a kivonatokat, ikonokat, a kapcsolódó tartalmakat, és a nyomtatási/szerkesztési műveleteket a tarlamakhoz. Opcionálisan tartalmazza a tartalom könyvjelzőket és értékeléseket.</Description><Description language-id=\"de_DE\">Stellt Kurzfassungen, Icons, verwandte Assets sowie Druck- und Bearbeitungsoptionen für Assets dar. Kann auch Bookmarks und Bewertungen enthalten.</Description><Description language-id=\"ca_ES\">Mostra resums, icones, continguts relacionats i accions d\'impressió o edició per continguts. Opcionalment, inclou enllaços i valoracions.</Description><Description language-id=\"ar_SA\">يعرض الملخصات والأيقونات والأصول ذات الصلة وإجراءات الطباعة/التحرير للأصول. ويمكنك بشكل اختياري تضمين الإشارات المرجعية وتقييمات الأصول.</Description><Description language-id=\"fi_FI\">Näyttää lyhenteet, kuvakkeet, liittyvät sisällöt ja sisältöjen tulosta/muokkaa toiminnot. Voit ottaa mukaan myös sisältöjen kirjanmerkit ja arvostelut.</Description><Description language-id=\"en_US\">Displays abstracts, icons, related assets, and print/edit actions for assets. Optionally include asset bookmarks and ratings.</Description><Description language-id=\"zh_CN\">显示摘要、图标、相关资产以及资产的打印和编辑操作。可选择性包含资产书签和评分。</Description><Description language-id=\"es_ES\">Muestra abstractos, iconos, activos relacionados e imprime/edita acciones para activos. Opcionalmente incluye marcadores de activos y calificaciones.</Description><Description language-id=\"nl_NL\">Toon samenvattingen, pictogrammen, gerelateerde content en afdruk en bewerk acties voor content. Voeg optioneel bladwijzers en beoordelingen toe.</Description></root>', 'ftl', '<#if !entries?has_content>\n	<#if !themeDisplay.isSignedIn()>\n		${renderRequest.setAttribute(\"PORTLET_CONFIGURATOR_VISIBILITY\", true)}\n	</#if>\n\n	<div class=\"alert alert-info\">\n		<@liferay_ui[\"message\"] key=\"there-are-no-results\" />\n	</div>\n</#if>\n\n<#list entries as entry>\n	<#assign\n		entry = entry\n\n		assetRenderer = entry.getAssetRenderer()\n\n		entryTitle = htmlUtil.escape(assetRenderer.getTitle(locale))\n\n		viewURL = assetPublisherHelper.getAssetViewURL(renderRequest, renderResponse, assetRenderer, entry, !stringUtil.equals(assetLinkBehavior, \"showFullContent\"))\n	/>\n\n	<div class=\"asset-abstract\">\n		<div class=\"float-right\">\n			<@getPrintIcon />\n\n			<@getFlagsIcon />\n\n			<@getEditIcon />\n		</div>\n\n		<h3 class=\"asset-title\">\n			<a href=\"${viewURL}\">\n				${entryTitle}\n			</a>\n		</h3>\n\n		<@getMetadataField fieldName=\"tags\" />\n\n		<@getMetadataField fieldName=\"create-date\" />\n\n		<@getMetadataField fieldName=\"view-count\" />\n\n		<div class=\"asset-content\">\n			<@getSocialBookmarks />\n\n			<div class=\"asset-summary\">\n				<@getMetadataField fieldName=\"author\" />\n\n				${htmlUtil.escape(assetRenderer.getSummary(renderRequest, renderResponse))}\n\n				<a href=\"${viewURL}\"><@liferay.language key=\"read-more\" /><span class=\"hide-accessible sr-only\"><@liferay.language key=\"about\" />${entryTitle}</span> &raquo;</a>\n			</div>\n\n			<@getRatings />\n\n			<@getRelatedAssets />\n\n			<@getDiscussion />\n		</div>\n	</div>\n</#list>\n\n<#macro getDiscussion>\n	<#if getterUtil.getBoolean(enableComments) && assetRenderer.isCommentable()>\n		<br />\n\n		<@liferay_comment[\"discussion\"]\n			className=entry.getClassName()\n			classPK=entry.getClassPK()\n			formName=\"fm\" + entry.getClassPK()\n			ratingsEnabled=getterUtil.getBoolean(enableCommentRatings)\n			redirect=currentURL\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign editPortletURL = assetRenderer.getURLEdit(renderRequest, renderResponse, windowStateFactory.getWindowState(\"NORMAL\"), themeDisplay.getURLCurrent())!\"\" />\n\n		<#if validator.isNotNull(editPortletURL)>\n			<#assign title = languageUtil.format(locale, \"edit-x\", entryTitle, false) />\n\n			<@liferay_ui[\"icon\"]\n				cssClass=\"icon-monospaced visible-interaction\"\n				icon=\"pencil\"\n				markupView=\"lexicon\"\n				message=title\n				url=editPortletURL.toString()\n			/>\n		</#if>\n	</#if>\n</#macro>\n\n<#macro getFlagsIcon>\n	<#if getterUtil.getBoolean(enableFlags)>\n		<@liferay_flags[\"flags\"]\n			className=entry.getClassName()\n			classPK=entry.getClassPK()\n			contentTitle=entry.getTitle(locale)\n			label=false\n			reportedUserId=entry.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getMetadataField\n	fieldName\n>\n	<#if stringUtil.split(metadataFields)?seq_contains(fieldName)>\n		<span class=\"metadata-entry metadata-${fieldName}\">\n			<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n			<#if stringUtil.equals(fieldName, \"author\")>\n				<@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(assetRenderer.getUserId(), assetRenderer.getUserName()))}\n			<#elseif stringUtil.equals(fieldName, \"categories\")>\n				<@liferay_asset[\"asset-categories-summary\"]\n					className=entry.getClassName()\n					classPK=entry.getClassPK()\n					portletURL=renderResponse.createRenderURL()\n				/>\n			<#elseif stringUtil.equals(fieldName, \"create-date\")>\n				${dateUtil.getDate(entry.getCreateDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"expiration-date\")>\n				${dateUtil.getDate(entry.getExpirationDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"modified-date\")>\n				${dateUtil.getDate(entry.getModifiedDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"priority\")>\n				${entry.getPriority()}\n			<#elseif stringUtil.equals(fieldName, \"publish-date\")>\n				${dateUtil.getDate(entry.getPublishDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"tags\")>\n				<@liferay_asset[\"asset-tags-summary\"]\n					className=entry.getClassName()\n					classPK=entry.getClassPK()\n					portletURL=renderResponse.createRenderURL()\n				/>\n			<#elseif stringUtil.equals(fieldName, \"view-count\")>\n				${entry.getViewCount()} <@liferay.language key=\"views\" />\n			</#if>\n		</span>\n	</#if>\n</#macro>\n\n<#macro getPrintIcon>\n	<#if getterUtil.getBoolean(enablePrint)>\n		<#assign printURL = renderResponse.createRenderURL() />\n\n		${printURL.setParameter(\"mvcPath\", \"/view_content.jsp\")}\n		${printURL.setParameter(\"assetEntryId\", entry.getEntryId()?string)}\n		${printURL.setParameter(\"viewMode\", \"print\")}\n		${printURL.setParameter(\"type\", entry.getAssetRendererFactory().getType())}\n		${printURL.setWindowState(\"pop_up\")}\n\n		<@liferay_ui[\"icon\"]\n			icon=\"print\"\n			markupView=\"lexicon\"\n			message=\"print\"\n			url=\"javascript:Liferay.Util.openModal({headerHTML: \'\" + languageUtil.format(locale, \"print-x-x\", [\"hide-accessible\", entryTitle], false) + \"\', id:\'\" + renderResponse.getNamespace() + \"printAsset\', url: \'\" + htmlUtil.escapeURL(printURL.toString()) + \"\'});\"\n		/>\n	</#if>\n</#macro>\n\n<#macro getRatings>\n	<#if getterUtil.getBoolean(enableRatings) && assetRenderer.isRatable()>\n		<div class=\"asset-ratings\">\n			<@liferay_ratings[\"ratings\"]\n				className=entry.getClassName()\n				classPK=entry.getClassPK()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if getterUtil.getBoolean(enableRelatedAssets)>\n		<@liferay_asset[\"asset-links\"]\n			assetEntryId=entry.getEntryId()\n			viewInContext=!stringUtil.equals(assetLinkBehavior, \"showFullContent\")\n		/>\n	</#if>\n</#macro>\n\n<#macro getSocialBookmarks>\n	<@liferay_social_bookmarks[\"bookmarks\"]\n		className=entry.getClassName()\n		classPK=entry.getClassPK()\n		displayStyle=\"${socialBookmarksDisplayStyle}\"\n		target=\"_blank\"\n		title=entry.getTitle(locale)\n		types=\"${socialBookmarksTypes}\"\n		url=assetPublisherHelper.getAssetSocialURL(renderRequest, renderResponse, entry)\n	/>\n</#macro>', 0, 20103, NULL, '2022-07-05 09:10:39.234000'),
(0, 0, 38209, 20125, 20099, 20103, NULL, '2022-07-05 09:10:57.616000', 26844, 38201, 38207, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Vanligt innehåll</Name><Name language-id=\"pt_BR\">Conteúdo Web básico</Name><Name language-id=\"ja_JP\">基本Webコンテンツ</Name><Name language-id=\"fr_FR\">Contenu web basique</Name><Name language-id=\"hu_HU\">Alapvető webtartalom</Name><Name language-id=\"de_DE\">Einfacher Webcontent</Name><Name language-id=\"ca_ES\">Contigut web bàsic</Name><Name language-id=\"ar_SA\">تحرير محتوى</Name><Name language-id=\"fi_FI\">Tavallinen web-sisältö</Name><Name language-id=\"en_US\">Basic Web Content</Name><Name language-id=\"zh_CN\">基本 Web 内容</Name><Name language-id=\"es_ES\">Contenido web básico</Name><Name language-id=\"nl_NL\">Basiswebcontent</Name></root>', '', 'ftl', '${content.getData()}', 0, 20103, NULL, '2022-07-05 09:10:57.616000');

