DROP TABLE IF EXISTS `dedatalistview`;
CREATE TABLE IF NOT EXISTS `dedatalistview` (
  `mvccVersion` bigint(20) NOT NULL DEFAULT '0',
  `ctCollectionId` bigint(20) NOT NULL DEFAULT '0',
  `uuid_` varchar(75) COLLATE utf8_unicode_ci DEFAULT NULL,
  `deDataListViewId` bigint(20) NOT NULL,
  `groupId` bigint(20) DEFAULT NULL,
  `companyId` bigint(20) DEFAULT NULL,
  `userId` bigint(20) DEFAULT NULL,
  `userName` varchar(75) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createDate` datetime(6) DEFAULT NULL,
  `modifiedDate` datetime(6) DEFAULT NULL,
  `appliedFilters` longtext COLLATE utf8_unicode_ci,
  `ddmStructureId` bigint(20) DEFAULT NULL,
  `fieldNames` longtext COLLATE utf8_unicode_ci,
  `name` longtext COLLATE utf8_unicode_ci,
  `sortField` varchar(75) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`deDataListViewId`,`ctCollectionId`),
  UNIQUE KEY `IX_275E4568` (`uuid_`,`groupId`,`ctCollectionId`),
  KEY `IX_8DD9CAE7` (`ddmStructureId`,`ctCollectionId`),
  KEY `IX_29FAA225` (`groupId`,`companyId`,`ddmStructureId`,`ctCollectionId`),
