(0, 0, '155fbea5-320e-26f9-bc2c-182fc86e8745', 20137, 20099, 20103, NULL, '2022-07-05 09:07:43.223000', '2022-07-05 09:07:43.223000', 20006, 20137, 'Asset Library Administrator', NULL, '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Administratörer av tillgångsbibliotek är superanvändare av sitt tillgångsbibliotek, men kan inte göra andra användare till administratörer i tillgångsbiblioteket.</Description><Description language-id=\"pt_BR\">Os Administradores da Biblioteca de Ativos são super usuários da biblioteca de ativos, mas não podem tornar outros usuários Administradores da Biblioteca de Ativos.</Description><Description language-id=\"ja_JP\">アセットライブラリの管理者はそれぞれのアセットライブラリのスーパーユーザーですが、他のユーザーをアセットライブラリの管理者にすることはできません。</Description><Description language-id=\"fr_FR\">Les administrateurs d\'un dépôt sont des super utilisateurs de leur dépôt, mais ne peuvent rendre administrateurs d\'autres utilisateurs.</Description><Description language-id=\"hu_HU\">Az adattár adminisztrátorai adattáruk magasabbrendű felhasználói, de nem nevezhetnek ki más felhasználókat az adattár adminisztrátoraivá.</Description><Description language-id=\"de_DE\">Repository-Administratoren sind Administratoren ihres Repositorys, können aber andere Benutzer nicht zu Repository-Administratoren machen.</Description><Description language-id=\"ca_ES\">Els administradors de la biblioteca de continguts són superusuaris de la seva biblioteca de continguts, però no poden assignar el rol d\'administrador de biblioteca de continguts a altres usuaris.</Description><Description language-id=\"ar_SA\">مسؤولو مكتبة الأصول هم مستخدمون متميزون لمكتبة الأصول الخاصة بهم ولكن لا يمكنهم تعيين مستخدمين آخرين كمسئولين لمكتبة الأصول.</Description><Description language-id=\"fi_FI\">Sisältökirjaston Pääkäyttäjät ovat sisältökirjastonsa superkäyttäjiä, mutta eivät voi tehdä muista käyttäjistä Sisältökirjaston Pääkäyttäjiä.</Description><Description language-id=\"en_US\">Asset Library Administrators are super users of their asset library but cannot make other users into Asset Library Administrators.</Description><Description language-id=\"zh_CN\">资产库管理员是其资产库的超级用户，但不能使其他用户成为资产库管理员。</Description><Description language-id=\"es_ES\">Los administradores del repositorio son superusuarios de su repositorio, pero no pueden convertir a otros usuarios en administradores del repositorio.</Description><Description language-id=\"nl_NL\">Assetbibliotheekbeheerders zijn supergebruikers van hun assetbibliotheek, maar kunnen geen assetbibliotheekbeheerders maken van andere gebruikers.</Description></root>', 5, NULL),
