(0, 0, '232b06d3-e286-2d90-5d78-b2ace89edaf3', 20140, 20099, 20103, NULL, '2022-07-05 09:07:43.303000', '2022-07-05 09:07:43.303000', 20006, 20140, 'Asset Library Member', NULL, '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Alla användare som tillhör ett tillgångsbibliotek har den här rollen i det tillgångsbiblioteket.</Description><Description language-id=\"pt_BR\">Todos os usuários que pertencem a uma biblioteca de ativos possuem esta função nessa biblioteca de ativos.</Description><Description language-id=\"ja_JP\">アセットライブラリに属している全ユーザーは、このアセットライブラリでこのロールを割り当てられています。</Description><Description language-id=\"fr_FR\">Tous les utilisateurs qui appartiennent à un dépôt ont ce rôle au sein de ce dépôt.</Description><Description language-id=\"hu_HU\">Egy adattárhoz tartozó összes felhasználó ezzel a szerepkörrel rendelkezik az adattáron belül.</Description><Description language-id=\"de_DE\">Alle Benutzer, die zu einem Repository gehören, haben diese Rolle innerhalb dieses Repositorys inne.</Description><Description language-id=\"ca_ES\">Tots els usuaris que pertanyin a una biblioteca de continguts tenen aquest rol en aquesta biblioteca de continguts.</Description><Description language-id=\"ar_SA\">جميع المستخدمين الذين ينتمون إلى مكتبة أصول ما لديهم هذا الدور داخل مكتبة الأصول تلك.</Description><Description language-id=\"fi_FI\">Kaikilla käyttäjillä, jotka kuuluvat sisältökirjastoon, on tämä rooli kyseisen sisältökirjaston sisällä.</Description><Description language-id=\"en_US\">All users who belong to an asset library have this role within that asset library.</Description><Description language-id=\"zh_CN\">属于资产库的所有用户都具有该资产库中的此角色。</Description><Description language-id=\"es_ES\">Todos los usuarios que pertenecen a un repositorio tienen este rol en ese repositorio.</Description><Description language-id=\"nl_NL\">Alle gebruikers die bij een assetbibliotheek horen, hebben deze rol in die assetbibliotheek.</Description></root>', 5, NULL),
(0, 0, '337262c8-32ab-f86b-a372-222fd5004b69', 20141, 20099, 20103, NULL, '2022-07-05 09:07:43.343000', '2022-07-05 09:07:43.343000', 20006, 20141, 'Asset Library Owner', NULL, '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Administratörer av tillgångsbibliotek är superanvändare av sitt tillgångsbibliotek och kan tilldela roller i tillgångsbiblioteket till användare.</Description><Description language-id=\"pt_BR\">Os Proprietários de Bibliotecas de Ativo são super usuários de suas bibliotecas de ativo e podem atribuir funções da biblioteca de ativos a outros usuários.</Description><Description language-id=\"ja_JP\">アセットライブラリの所有者は、それぞれのアセットライブラリのスーパーユーザーであり、ユーザーにアセットライブラリのロールを割り当てることができます。</Description><Description language-id=\"fr_FR\">Les propriétaires d\'un dépôt sont des super utilisateurs de ce dépôt et peuvent affecter des rôles à des utilisateurs.</Description><Description language-id=\"hu_HU\">Az adattár tulajdonosai adattáruk magasabbrendű felhasználói, és adattár szerepköröket rendelhetnek hozzá más felhasználókhoz.</Description><Description language-id=\"de_DE\">Besitzer von Assetbibliotheken sind Administratoren ihrer Assetbibliothek und können Benutzern Assetbibliothek-Rollen zuweisen.</Description><Description language-id=\"ca_ES\">Els propietaris de la biblioteca de continguts són superusuaris de la seva biblioteca de continguts, i poden assignar rols de la biblioteca de continguts als usuaris.</Description><Description language-id=\"ar_SA\">مالكو مكتبة الأصول هم مستخدمون متميزون لمكتبة الأصول الخاصة بهم ويمكنهم تعيين أدوار مكتبة الأصول إلى المستخدمين.</Description><Description language-id=\"fi_FI\">Sisältökirjaston Omistajat ovat sisältökirjastonsa superkäyttäjiä, ja voivat liittää sisältökirjaston rooleja käyttäjille.</Description><Description language-id=\"en_US\">Asset Library Owners are super users of their asset library and can assign asset library roles to users.</Description><Description language-id=\"zh_CN\">资产库所有者是其资产库的超级用户，且可以将资产库角色分配给用户。</Description><Description language-id=\"es_ES\">Los propietarios de repositorio son superusuarios de su repositorio y pueden asignar roles de repositorio a otros usuarios.</Description><Description language-id=\"nl_NL\">Assetbibliotheekeigenaars zijn supergebruikers van hun assetbibliotheek en kunnen assetbibliotheekrollen toewijzen aan gebruikers.</Description></root>', 5, NULL),
